Experimental_Aeon_010_010="[{i Choir}]: Генератор энергии, позволяющий Галактическому Колоссу вести огонь, расположен в области \"глаза\". Если уничтожить Колосса, из его грудной клетки вылетает нестабильный сгусток энергии, уничтожающий все, с чем соприкоснется."
Experimental_Aeon_010_020="[{i Choir}]: Да уничтожит твоих врагов Галактический Колосс."
Experimental_Aeon_020_010="[{i Choir}]: На огромном боевом корабле \"Буря\" установлена пушка \"Забвение\", которая позволяет поражать цели на огромном расстоянии. Внутри корабля находится собственная верфь, поэтому \"Буря\" может сама строить корабли в случае необходимости."
Experimental_Aeon_020_020="[{i Choir}]: Буря в вашем распоряжении."
Experimental_Aeon_030_010="[{i Choir}]: Огромная летающая тарелка, \"Царь\", испускает мощный энергетический луч, уничтожающий все на своем пути. \"Царь\" также может перевозить воздушную технику."
Experimental_Aeon_030_020="[{i Choir}]: \"Царь\" готов к запуску! Да здравствуют эон!"
Experimental_Cybran_010_010="[{i QAI}]: С помощью тяжелого микроволнового лазерного генератора киберпаук \"Царь обезьян\" способен за несколько секунд уничтожить целую армию. Из-за своего огромного размера он также может давить вражескую технику ногами."
Experimental_Cybran_010_020="[{i Ops}]: \"Царь обезьян\" к бою готов."
Experimental_Cybran_010_030="[{i Ops}]: \"Киберпаук\" к атаке готов."
Experimental_Cybran_020_010="[{i QAI}]: \"Разбойник\" - это тяжелая воздушная боевая платформа. На нем установлены пусковые установки с иридиевыми ракетами и тяжелые разрядники, что позволяет эффективно атаковать наземные войска."
Experimental_Cybran_020_020="[{i Ops}]: Командующий, ваш \"Разбойник\" готов к полевым испытаниям."
Experimental_Cybran_030_010="[{i QAI}]: \"Испепелитель\" - это самоходная артиллерийская установка, способная заменить целую артиллерийскую батарею. У него отличная дальность стрельбы и повышенная скорострельность."
Experimental_Cybran_030_020="[{i Ops}]: \"Испепелитель\" в состоянии готовности."
Experimental_UEF_010_010="[{i EarthCom}]: \"Толстяк\" - это наземный дредноут. Трехствольные пушки, расположенные по периметру, могут вести артиллерийский огонь, а строительный отсек в кормовой части - обеспечивать строительство подкреплений."
Experimental_UEF_010_020="[{i EarthCom}]: Строительство \"Толстяка\" завершено."
Experimental_UEF_020_010="[{i EarthCom}]: Авианосец \"Атлантида\" - это новейшая разработка ОФЗ. Он перевозит воздушную технику и оснащен легкими орудиями ПВО и торпедными аппаратами."
Experimental_UEF_020_020="[{i EarthCom}]: \"Атлантида\" к бою готова."
Experimental_UEF_030_010="[{i EarthCom}]: Зарядная камера \"Мавра\" была усовершенствована для ведения огня тактическими ядерными зарядами на сверхдальние расстояния. Такой дальностью стрельбы не может похвастаться ни одно современное орудие."
Experimental_UEF_030_020="[{i EarthCom}]: \"Мавр\" готов вступить в бой."
FMV_VO_Opening_010_005="Капелла. Два года спустя."
FMV_VO_Opening_010_010="В данный район направляются силы противника. Выводите оттуда этот корабль."
FMV_VO_Opening_010_020="Инженеры приступают к работе. Нужна еще пара минут."
FMV_VO_Opening_010_025="Основные двигатели запущены. Расчет траектории запуска завершен."
FMV_VO_Opening_010_030="Бандиты на экране. Захват примерно через четыре минуты. В вашем окне."
FMV_VO_Opening_010_040="Понял вас."
FMV_VO_Opening_010_050="Нахожусь под тяжелым обстрелом. Где, к чертям, мое подкрепление?!"
FMV_VO_Opening_010_060="Устанавливаю цель на силы противника."
FMV_VO_Opening_010_070="Черт, как раз вовремя. Установите линию обороны к северу от нас."
FMV_VO_Opening_010_080="Не пытайтесь читать мне лекцию об искусстве войны, Кларк."
FMV_VO_Opening_010_090="Просто делайте, что говорят. Ругаться будем потом."
FMV_VO_Opening_010_100="Основные двигатели запущены. Расчет траектории запуска завершен."
FMV_VO_Opening_010_110="Начинайте возвращение; дальше корабль будет сам по себе."
FMV_VO_Opening_010_120="Возвращение через 5, 4, 3, 2, 1."
FMV_VO_Opening_010_130="Корабль подбит! Он снижается!"
FMV_VO_Opening_010_140="Возвращайтесь, Кларк! Возвращайтесь!"
FMV_VO_Opening_010_150="Давай, ублюдок."
FMV_VO_Opening_010_160="Давай, сукин сын."
FMV_VO_Opening_010_170="Ублюдки."
FMV_VO_Opening_020_010="Серафим попали на Землю через квантовый разрыв, их военные машины сеяли смерть и разрушения. Земля была завоевана за три дня. Никто не выжил."
FMV_VO_Opening_020_020="Мне пришлось прятаться. Поскольку серафим считали, что только она раса может пойти по Пути к  восхождению, мои новые способности ставили всю их систему верований под сомнение. Серафим хотели уничтожить человечество."
FMV_VO_Opening_020_030="Большинство населения эон посчитали, что их боги вернулись и присоединились к кампании разрушения, которую вели серафим. Только Риза и еще некоторые сохраняли верность мне. Они начали партизанскую войну против ордена и серафим."
FMV_VO_Opening_020_040="Бесконечное количество подвластных ОФЗ и кибран миров было уничтожено. Загнанные в угол, находясь под угрозой уничтожения, ОФЗ и кибран заключили союз, который дался им нелегко. Их объединила Риза и другие верные."
FMV_VO_Opening_020_050="На протяжении почти трех лет  серафим и их союзники эон преследовали представителей человечества по всему космосу, уничтожая всех, кто встречался им на пути."
FMV_VO_Opening_020_060="Пришло время нанести ответный удар."
