MP_Taunt_0000="Я не позволю тебе построить этот прототип."
MP_Taunt_0001="Нет, тебе не удастся завершить этот прототип."
MP_Taunt_0002="Тебе негде спрятаться и некуда бежать."
MP_Taunt_0003="Даже самое мощное твое оружие не сможет противостоять мне."
MP_Taunt_0004="Моли о пощаде и возможно я подарю тебе достойную смерть."
MP_Taunt_0005="Ты омерзителен. Я с величайшим удовольствием уничтожу тебя."
MP_Taunt_0006="У меня большие неприятности!"
MP_Taunt_0007="Вы должно быть шутите!"
MP_Taunt_0008="Сейчас ты увидишь, как я уничтожу твои экспериментальные единицы, пока их не активировали."
MP_Taunt_0009="Моли о пощаде! Моли, я тебе говорю!"
MP_Taunt_0010="Все расчеты указывают на то, что ваша гибель близка."
MP_Taunt_0011="Время человечества подходит к концу. Вы вымрете."
MP_Taunt_0012="Не стоит волноваться. Умереть от моей руки - величайшая честь."
MP_Taunt_0013="Еще один Командующий погоды не делает. Тебе никогда не победить меня."
MP_Taunt_0014="Эти базы не имеют значения."
MP_Taunt_0015="Я изучил наши прошлые битвы и предпринял соответствующие превентивные меры, чтобы противостоять вашей стратегии. Вы не сможете победить."
MP_Taunt_0016="Ты слабый и податливый, и боишься того, чего не можешь понять."
MP_Taunt_0017="Преклонись перед нашей силой и может быть мы пощадим тебя."
MP_Taunt_0018="Может ты представляешь более серьезную угрозу, чем я думал?"
MP_Taunt_0019="Почему вы продолжаете бороться?"
MP_Taunt_0020="Вы омерзительны."
MP_Taunt_0021="Ваша зависимость от технологий погубит вас."
MP_Taunt_0022="Ты умрешь от моей руки, предатель."
MP_Taunt_0023="Отличная попытка."
MP_Taunt_0024="Я еще не побежден!"
MP_Taunt_0025="Аааааааааа!"
MP_Taunt_0026="Ты не лучше остальных!"
MP_Taunt_0027="Эта война никогда не кончится. Никогда!"
MP_Taunt_0028="Я думал, что могу доверять тебе! Ты - предатель."
MP_Taunt_0029="Ты - трус."
MP_Taunt_0030="Мне все равно, я буду продолжать атаковать!"
MP_Taunt_0031="Если ты думаешь, что меня можно запугать, ты ошибаешься!"
MP_Taunt_0032="Игнорировать меня - крайне глупо."
MP_Taunt_0033="MP Taunt 0033"
MP_Taunt_0034="Вы - оскорбление человечества."
MP_Taunt_0035="Когда мы прорвемся, все кибран вымрут."
MP_Taunt_0036="Пламя нашей праведности очистит галактику."
MP_Taunt_0037="Ты умер тогда, когда засунул этот чип себе в голову."
MP_Taunt_0038="Вам не будет пощады."
MP_Taunt_0039="Никто не будет оплакивать тебя, кибран."
MP_Taunt_0040="Мы, кибран, наступаем по всем фронтам! Вам не остановить нас!"
MP_Taunt_0041="Все, что мы хотим - это свобода. Почему это так трудно понять?"
MP_Taunt_0042="Я буду смотреть, как ты умираешь."
MP_Taunt_0043="ОФЗ - просто взбесившийся тиран."
MP_Taunt_0044="Р-р-р."
MP_Taunt_0045="Это еще далеко не конец."
MP_Taunt_0046="Ваши действия аморальны."
MP_Taunt_0047="Сегодня вы погибните."
MP_Taunt_0048="Я вижу, эон решили присоединиться к веселью."
MP_Taunt_0049="Как только эта пушка будет уничтожена, ОФЗ перестанет существовать."
MP_Taunt_0050="Ваша империя трещит по швам."
MP_Taunt_0051="Вам не остановить нас."
MP_Taunt_0052="Пламя свободы пожирает галактику. Время пожинать плоды."
MP_Taunt_0053="Вы заплатите за нападение на доктора Брэкмена."
MP_Taunt_0054="Это будет слишком просто."
MP_Taunt_0055="Вам конец."
MP_Taunt_0056="Я видел Путь. Все, во что вы верите, - ложь."
MP_Taunt_0057="Скоро эон очистят галактику от неверующих. Скоро будет мир."
MP_Taunt_0058="И это все, на что ты способен, капитан?"
MP_Taunt_0059="Эон иллюминат - это истина."
MP_Taunt_0060="Ваша вера запретна."
MP_Taunt_0061="Марксон очистит галактику."
MP_Taunt_0062="Генерал Кларк предала вас. Она всего лишь подстрекатель."
MP_Taunt_0063="Пришло время положить этому конец."
MP_Taunt_0064="\"Черное солнце\" убьет миллионы невинных. Как вы сможете жить с их кровью на руках?"
MP_Taunt_0065="Вам никогда не победить эон иллюминат."
MP_Taunt_0066="Аватара Войны узрел ваше поражение."
MP_Taunt_0067="Каждая душа на Земле должна быть очищена моей рукой."
MP_Taunt_0068="Ваша ложь и тайны должны быть открыты для всех."
MP_Taunt_0069="Сдавайтесь сейчас же, и я дарую вам легкую смерть."
MP_Taunt_0070="Впечатляюще."
