MP_Taunt_0072="Никто не остановит эон."
MP_Taunt_0073="Как только ОФЗ падет, кибран последуют за ним."
MP_Taunt_0074="Вы омерзительны."
MP_Taunt_0075="ОФЗ никогда не применит это оружие."
MP_Taunt_0076="Я лично уничтожу всех кибран."
