SCMP_001_Description="Первоначальное сканирование показало наличие на планете невысоких холмов, расположенных на одинаковом расстоянии друг от друга. Возникла теория, что это остатки захоронений древней цивилизации, но повторное сканирование опровергло это. Однако многие верят, что древняя Империя Земли на самом деле нашла и вывезла останки инопланетян, а результаты сканирования были подделаны."
SCMP_002_Description="Это не обычное озеро, а хлынувшее на поверхность скопление газов, которые соединились и образовали жидкость, похожую по своим характеристикам на воду. Большинство газов неизвестны, поэтому все три группировки стремятся исследовать этот район и раскрыть его секреты."
SCMP_003_Description="Дрейк, названный так в честь давно умершего офицера Империи, был отправлен подавить мятеж сепаратистов. Он столкнулся с организованной армией и отступил к краю лощины, где и создал достаточное количество войск, чтобы дать отпор врагу. Сепаратисты были разгромлены, и лощину назвали в его честь."
SCMP_004_Description="Миллионы лет в Кратере была вода, но в результате тектонических сдвигов он был осушен. При этом обнажились месторождения материи, необходимой для ведения Бесконечной войны. За несколько лет в Кратере выросли леса, но они постоянно выжигаются в ожесточенных боях."
SCMP_005_Description="Эти острова когда-то были раем для контрабандистов и получили название в честь \"джентльмена\", который заправлял здесь. Теперь на островах хозяйничают совсем другие джентльмены - командующие всех трех фракций, ведущих борьбу за господство на планете."
SCMP_006_Description="Крест Яна получил название в честь своего первого исследователя. Относительно открытая местность, богатая месторождениями материи, в последние годы стала ареной непрерывных боев."
SCMP_007_Description="Никто уже не помнит, кто первым назвал Раскрытыми ладонями маленькую полоску зелени среди льда и снега. Говорят, что раньше это была нейтральная земля, и солдаты любой группировки могли здесь отдохнуть, не опасаясь нападения."
SCMP_008_Description="Долгие годы эти ледники принадлежали эон, от которых и получили свое название. По воле судьбы эон были выбиты из тех мест. Теперь ледники будут принадлежать тому, кто сумеет их захватить."
SCMP_009_Description="Горловина Сетона помнит сотни битв. Терпеливый исследователь сможет найти в этом районе обломки тысяч единиц техники, находящихся как под землей, так и под водой."
SCMP_010_Description="Когда-то военный диктатор Сунг считал этот остров своим домом. Он выбрал его из-за красоты и изобилия ресурсов. Сунга давно уже изгнали отсюда, а ресурсы остались ждать того, кто завладеет ими."
SCMP_011_Description="Когда-то это был небольшой континент, на котором ОФЗ устроила полигон для испытания новых видов оружия. Однажды один эксперимент вышел из-под контроля, и в результате взрыва континент превратился в несколько островов. Теперь все три группировки пытаются отыскать следы этого оружия, чтобы использовать его в своих целях."
SCMP_012_Description="С самого основания поселения путешественники знали, что, если пройти через арку и держать курс строго на север, можно добраться до обитаемых районов. В наши дни Проход стал очень опасен из-за постоянных сражений, идущих по всей пустыне."
SCMP_013_Description="Иногда двум командующим надо выяснить отношения. Для этого отлично подходит арена под названием Зимняя дуэль."
SCMP_014_Description="Старые моряки любят рассказывать сказки о Бермудском треугольнике, в котором бесследно пропадали корабли. У Бермудского медальона такая же дурная слава. Единственное отличие - в нем пропадают командующие."
SCMP_015_Description="На Полях почти нет воды и очень мало растительности. Зато здесь очень много месторождений материи, и это превращает их в отличное место для сражений командующих."
SCMP_016_Description="Собачья река славится двумя вещами. Во-первых, это сама река, на дне которой много полезных ископаемых, особенно золота. Во-вторых, это идеальное место для поединков командующих один на один."
SCMP_017_Description="Это место примечательно во всех отношениях. В первую очередь тем, что здесь находится большое количество врат, открывающих доступ в различные уголки галактики. Именно из-за этого многие командующие так жаждут обладать этим районом."
SCMP_018_Description="Когда люди еще только начинали осваивать этот район, они построили башни на вершине горы, чтобы наблюдать за местностью. Много времени прошло с тех пор, но гора до сих пор известна под названием Сторожевой пост."
SCMP_019_Description="Много лет тому назад командующий по имени Финн проиграл сражение и был вынужден спасаться бегством. Позже он заманил своего противника на маленький остров и там разгромил его. С тех пор остров стали называть его именем."
SCMP_020_Description="Бездна - странная глубокая впадина посреди океана. Поговаривают, что ее создали пришельцы. И хотя научные исследования не подтвердили эту теорию, даже сплетен достаточно, чтобы все три группировки стремились завладеть этим районов в поисках артефактов."
SCMP_021_Description="Империя Земли когда-то объявила Альфу 7 зоной повышенного риска. Сотни лет сюда не ступала нога человека. Только теперь возникли вопросы о том, что же здесь произошло: высадка пришельцев? эпидемия? Ответа не знает никто, но все три группировки стремятся это выяснить."
SCMP_022_Description="Это единственное гостеприимное местечко на обледенелой планете получило название \"Убежище\". Если здесь построить врата, то оно превратится в отличный плацдарм для дальнейших операций."
SCMP_023_Description="Часто судьбу целого мира решает одна-единственная битва. Вся тактика, стратегия и подготовка проверяется в этом решающем бою. Победить в Ущелье Варги - значит завоевать всю планету."
SCMP_024_Description="Никто не знает, почему реки здесь сплетаются в столь причудливую форму. Существует множество теорий, но истина вряд ли когда-нибудь откроется."
SCMP_025_Description="Колония - единственный крупный остров в безбрежном океане, переживший немало войн. Теперь он заброшен, но командующие нередко проводят сражения за колонию Каменная соль."
SCMP_026_Description="Когда-то война на Виа-3 была технически невозможна. Облака красной пыли забивали воздухозаборники и вызывали замыкания приборов. Новые технологии позволили вести боевые действия даже в таких условиях, и теперь в красных степях нередко идут бои."
SCMP_027_Description="Утес - это самая настоящая скала, пока еще не поглощенная озером кипящей лавы. Залежи полезных ископаемых на Утесе привлекают сюда командующих, стремящихся завладеть этим богатством, несмотря на опасную окружающую среду."
SCMP_028_Description="Давным-давно в Оазисе располагались фешенебельные курорты для избранных. Местные воды бороздили яхты президентов и финансовых магнатов. Эон случайно обнаружили Оазис и уничтожили курорты, возведя на их месте храмы. Теперь, много лет спустя, бесконечная война снова пришла в Оазис."
SCMP_029_Description="Засекречено"
SCMP_030_Description="На этой планете ОФЗ строила и проводила испытания новых кораблей, а затем ее захватили эон. Сейчас это спорная территория, и командующие всех наций пытаются завоевать ее."
SCMP_031_Description="Кибран считали, что им повезло: они нашли такое чистое и богатое ресурсами место для нового поселения. Но вскоре появились эон, а за ними и ОФЗ. Теперь поселенцы могут считать, что им повезло, если они выживут в Бесконечной войне."
SCMP_032_Description="В иные времена Глухомань могла бы стать заповедником. В этих краях много рек, реликтовых лесов и всевозможных животных. Но, к сожалению, здесь построили врата, и теперь в лесах слышны выстрелы, а дно рек устилают корпуса погибших военных кораблей."
SCMP_033_Description="Белый огонь был засекреченной военно-морской базой эон. На ней они построили сотни кораблей, а затем обрушились на ничего не подозревавших врагов. Планета была почти захвачена, но ОФЗ нанесла ответный удар и разрушила базу. Теперь, через много лет, война вновь вернулась в эти края. Все стремятся завладеть заброшенной базой."
SCMP_034_Description="Командующие, желающие поразмяться, знают - они могут сделать это на Жарком полдне."
SCMP_035_Description="Первым исследователям, обнаружившим это место, показалось, что они нашли рай. Теплая вода, прохладный ветерок и безбрежные пляжи нечасто попадаются в суровой галактике. Слухи об этом месте быстро разошлись; каждому захотелось стать обладателем Рая."
SCMP_036_Description="Шахтеры-колонисты надеялись, что под песками на Опаленных скалах скрываются богатства. Однако скоро многие узнали об этих месторождениях, и теперь колония вынуждена сражаться за выживание."
SCMP_037_Description="Вязкая, соленая вода проникает повсюду. Все, чего она коснулась, ржавеет и разрушается. Если бы эта планета не находилась так близко от зоны карантина, здесь никого бы не было."
SCMP_038_Description="В этой местности раньше прятались бандиты. Они грабили прохожих, устраивая засады на дороге между холмами. Бандитов давно нет, но Лощина - до сих пор одно из излюбленных мест для сражений."
SCMP_039_Description="Когда-то здесь был полигон для военно-морских подразделений ОФЗ. Мишени, расставленные на суше, расстреливались различными кораблями с моря. Полигон заброшен, но возможность обнаружить ценную информацию и останки техники привлекает сюда командующих всех фракций."
SCMP_040_Description="Здесь нет ни атмосферы, ни растительности, ни животных. Канава - то место, куда никто не приедет по доброй воле. Но она богата полезными ископаемыми, а значит, за нее стоит сражаться."
