TU01_TUB200_001_020="Кнопки мыши командного интерфейса служат для выделения боевых единиц и отдачи им различных приказов. Левая кнопка мыши используется для выделения одной или более боевых единиц. Правая кнопка мыши предназначена для отдачи приказов выделенным боевым единицам и заводам."
TU01_TUB200_001_030="Чтобы выделить одну боевую единицу или завод, наведите курсор на боевую единицу и щелкните ее левой кнопкой мыши. Чтобы выбрать несколько боевых единиц, нажмите и удерживайте левую кнопку мыши и обведите рамкой нужных боевых единиц; индикатор на экране покажет количество и типы выделенных боевых единиц. Чтобы выделить все видимые в данный момент боевые единицы одного типа, дважды щелкните левой кнопкой мыши одну из боевых единиц. Обратите внимание, что при максимальном отдалении камеры боевые единицы данного типа будут выделены во всем театре военных действий."
TU01_TUB200_001_040="Как только вы выбрали боевую единицу или завод, щелкните правой кнопкой мыши, чтобы отдать приказ. Приказы зависят от боевой единицы и ситуации. Простейший пример - приказ о перемещении: выделите боевую единицу и щелкните правой кнопкой мыши точку назначения."
TU01_TUB200_001_050="Приказы зависят от типа боевой единицы и текущей ситуации. Если вы выделяете боевую единицу и щелкаете правой кнопкой мыши дружественную боевую единицу, то приказом по умолчанию будет команда \"Охранять\". Действие по умолчанию при щелчке по вражеской боевой единице - \"Атака\"."
TU01_TUB200_001_055="Инженеры обладают другими способностями; их действия по умолчанию при щелчке правой кнопкой мыши отличаются от действий других боевых единиц. Внешний вид курсора указывает на действие, которое будет произведено при щелчке правой кнопкой мыши."
TU01_TUB200_001_060="Все действия, которые могут быть предприняты боевой единицей или группой боевых единиц, также присутствуют в командном интерфейсе. Щелкните боевую единицу левой кнопкой мыши, затем - нужную команду и, наконец, точку назначения или нужный объект на экране."
TU01_TUB200_001_070="Помните, чему вас учили в академии: щелчок левой кнопкой мыши - выделение, правой - действие!"
TU01_TUB425_010_045="Например, отдав самоходной установке ПВО приказ содействовать БМК, вы обеспечите машину командующего защитой от атак с воздуха. Помните, что кнопка Shift работает в комбинации со всеми командами, формируя очередь приказов. Например, если вы хотите, чтобы боевая единица, продвигаясь к точке назначения, обошла вражескую линию обороны, удерживая Shift, укажите несколько точек маршрута движения."
TU01_TUB450_010_035="Вы можете добавить новые боевые единицы в очередь производства, щелкнув левой кнопкой мыши соответствующую пиктограмму в очереди производства. Также вы можете удалить боевые единицы из очереди, щелкнув пиктограмму боевой единицы правой кнопкой мыши. Вы можете прекратить производство и удалить все боевые единицы из очереди командой \"Остановка\"."
TU01_TUB450_010_055="Доступ к различным уровням осуществляется с помощью пиктограмм выбора в левой части строительного интерфейса. Очередь строительства может содержать любой уровень. Инженер 3-го уровня может получить доступ к строительству особых зданий и техники."
TU01_TUB500_010_055="В правой части главного экрана находятся пиктограммы командующего, инженеров и других важных боевых единиц. Щелкните правой кнопкой мыши пиктограммы, чтобы перейти к этим боевым единицам."
TU01_TUB600_010_040="На 2-м уровне вам становится доступна огневая мощь, с которой врагу придется считаться. Передвижная ракетная установка и тяжелый танк эффективны против любой сухопутной техники или здания. Танк-амфибия способен передвигаться как по суше, так и по воде, что дает ему возможность наносить удары по противнику из самых неожиданных мест."
TU01_TUB600_010_045="Самоходная зенитная установка - ключевой элемент обороны базы от усовершенствованной воздушной техники врага, а также противовоздушной обороны экспедиционных войск. Ну и наконец, передвижной генератор силового поля - уникальная оборонительная техника, обеспечивающая оборону вашей базы и фронтовых отрядов."
TU01_TUB600_010_050="На 3-м уровне производятся две невероятно сильные боевые единицы. Это осадный бот и мобильная артиллерия. Это две наиболее мощные боевые единицы, находящихся в вашем распоряжении. Осадный бот - очень маневренная машина, способная на ходу обстреливать ракетами любые сухопутные боевые единицы или здания. Это - убийца БМК. Не настолько маневренная артиллерия способна обстреливать противника с дальних расстояний и наносить сокрушительный урон."
TU01_TUB800_010_020="Так же как на бронетанковых и авиационных заводах, на верфях можно создавать боевые единицы трех технологических уровней с широким спектром возможностей. На 1-м уровне верфи производят фрегаты и подводные лодки. Фрегат - быстрый и маневренный корабль с вооружением класса 'корабль-корабль' и 'корабль-земля', также снабженный средствами ПВО."
TU01_TUB800_010_025="Он идеален для мобильной обороны ваших основных кораблей, верфей и морских подходов к базам. Подлодки 1-го уровня могут охотиться за любой морской целью, включая плавучие и подводные сооружения."
TU01_TUB800_010_030="На 2-м технологическом уровне верфи производят новые мощные корабли. Эсминец оснащен мощным вооружением класса \"корабль-корабль\" и \"корабль-земля\", и, если сопровождается кораблем с гидролокатором, способен отлично противостоять подводным лодкам. Крейсер вооружен мощной гаубицей для ведения боевых действий против кораблей и береговых сооружений, а также ракетами средней дальности."
TU01_TUB800_010_040="На 3-м уровне верфи производят корабли, с которыми вашему противнику будет сложно справиться. Линкор - плавучий остров смерти, вооруженный среди прочего дальнобойными гаубицами, многочисленными средствами ПВО, бортовыми торпедными аппаратами. Стратегическая ракетная подводная лодка позволяет вам запускать из-под воды ядерные ракеты по любой цели театра военных действий."
TU02_TUE200_001_020="Команда \"Содействие\" особенно важна для инженеров. Скорость строительства зданий и боевой техники зависит от количества инженеров содействующих другим инженером и заводам. Простой пример содействия - когда один инженер помогает другому. В очереди строительства этого инженера содержатся несколько зданий - это можно увидеть, щелкнув его удерживая Shift."
TU02_TUE200_001_025="Приказав другому инженеру оказать содействие первому, строительство будет выполнено быстрее. Чем больше инженеров вы привлечете к содействию, тем быстрее завершится строительство. Удерживая Shift, вы можете увидеть, какие инженеры помогают первому. Цепочка из нескольких инженеров помогающих первому - прекрасная стратегия."
TU02_TUE200_001_030="В этом примере у нас есть завод с длинной очередью производства боевых единиц, необходимых на линии фронта. Если отдать приказ \"Содействие\" они будут построены гораздо быстрее. Если команда \"Содействие\" отдана большому количеству инженеров, находящихся поблизости, скорость производства на заводе может быть увеличена в несколько раз. БМК обеспечивает максимальный уровень содействия в строительстве."
TU02_TUE200_001_040="Проходящему усовершенствование строению, например, экстрактору материи 1-го уровня, может содействовать инженер или БМК. Все команды, относящиеся к инженерам, также могут быть отданы БМК."
TU02_TUE200_001_060="Чем выше уровень инженера, тем выше его строительные возможности. (Например, инженер 3-го уровня содействует гораздо эффективнее, нежели инженер 1-го уровня). По мере того как ваша экономика будет расти, для вас станет обычным делом назначать несколько инженеров содействовать заводам, а также создавать большие группы инженеров, содействующих строительству энергетических и других строений."
TU02_TUE200_001_070="Запомните, строящий и содействующий инженер расходует энергию и материю; если экономический индекс стал красным - вы можете приостановить инженеров и снизить затраты."
TU04_TUC100_010_020="Сырьем для строительства вашей армии являются энергия и материя. Без стабильной развивающейся экономики, ваши действия против неприятеля будут сильно осложнены. Энергия вырабатывается с помощью генераторов 1-го, 2-го и 3-го уровней. Также ее можно получить, добывая природные ресурсы планеты с помощью инженеров или БМК."
TU04_TUC100_010_025="Выработка энергии очень важна на ранних стадиях игры. Строительство генераторов рядом с заводами и некоторыми другими зданиями даст вам небольшое увеличение экономичности и скорости производства. Используйте это везде, где возможно."
TU04_TUC100_010_030="Материю добывают из недр планеты, из залежей материи, которые отмечены на экране. БМК и инженеры также могут собирать минеральные ресурсы на поверхности планеты. Наконец, вы можете строить фабрикаторы материи 1-го и 3-го уровней. Помните, что фабрикаторам материи для работы необходима энергия."
TU04_TUC100_010_040="При переходе к новому театру военных действий рекомендуется строить от двух до трех экстракторов материи, затем от двух до трех силовых генераторов 1-го уровня, и только потом первый завод."
TU04_TUC100_010_045="Как только завод будет построен, нужно произвести инженеров, и несколько инженеров следует отправить строить генераторы и экстракторы материи. На ранних стадиях строительства базы и формирования военной мощи, имеет смысл использовать несколько инженеров для патрулирования областей, богатых природными ресурсами, чтобы дать толчок экономике."
TU04_TUC100_010_050="Аккумуляторы энергии и хранилища материи накапливают ресурсы, которые помогут в ситуации, когда производство затребует больше энергии и материи, чем вырабатывается. Постройка хранилищ при положительном состоянии производства может помочь, когда производство начнет расширяться и вы начнете испытывать недостаток энергии и материи. Пока в хранилищах будут энергия и материя, заводы и инженеры будут действовать в полную силу."
TU04_TUC115_010_020="Давайте изучим экономические индикаторы и слои карты экрана БМК. В верхних углах экрана находятся основные экономические индикаторы. Параметры добычи и расхода материи показаны в левом верхнем углу. В правом верхнем углу показаны добыча и расход энергии. Оба индикатора работают одинаково. Мы начнем с индикатора материи в левом верхнем углу."
TU04_TUC115_010_030="Основные элементы интерфейса материи - полоска количества и индикатор добычи. Их цвет и состояние даст вам полную информацию о материи. Если полоска количества заполнена, это значит, что количество материи в данный момент максимально. Вместимость хранилищ показана под полоской количества. Если индикатор добычи материи зеленого цвета, и в положительном состоянии, это значит, что вы добываете больше материи, чем расходуете."
TU04_TUC115_010_035="Оптимальное состояние - полные хранилища материи и положительное состояние индикатора добычи. Противоположность ему - отрицательное состояние индикатора и отсутствие материи в хранилищах. Желтый цвет свидетельствует о среднем состоянии. В зависимости от настроек основного экрана, предупреждения будут (или не будут) появляться, если состояние добычи материи дойдет до критического."
TU04_TUC115_010_040="Маленькие цифры в индикаторах добычи ресурсов отображают более детализированную информацию - сколько ресурсов вы добываете и сколько ресурсов расходуете. Вы можете щелкнуть индикатор добычи, чтобы переключиться между процентным и числовым режимами индикатора. В противоположной стороне экрана находится индикатор выработки энергии, который работает так же, как индикатор добычи материи."
TU04_TUC115_010_045="В центре экрана находятся цифры процентов, которые сообщают об общей эффективности экономики относительно строительства - 100% означает, что строители работают с максимально возможной скоростью. Вам следует стремиться к тому, чтобы удерживать это число выше 50% и как можно ближе к 100%."
TU04_TUC115_010_050="Наконец, давайте ознакомимся с экономическим слоем карты. Вы можете активировать слой в экономическом интерфейсе рядом с мини-картой. Когда слой активирован, вы можете четко видеть, какие именно боевые единицы и здания вырабатывают энергию или материю, а какие - расходуют. Обратите внимание, что БМК вырабатывает и материю, и энергию, когда не занята выполнением какой-либо задачи; однако, при строительстве БМК расходует и то, и другое с очень высокой скоростью. Потренируйтесь 'читать' с экрана состояние экономики."
TU04_TUC200_010_020="Существует множество стратегий, которые командующий может применить на поле боя. Многие из них опираются на стремительные удары, не требующие большого расхода энергии и материи. В длительном противостоянии вам потребуется сбалансировать свою экономику."
TU04_TUC200_010_025="Мы обсудили стратегии развития добычи энергии и материи на 1-м уровне; развившись до 2-го уровня, вам следует продолжать добывать ресурсы с помощью генераторов 2-го уровня и усовершенствованных до 2-го или даже 3-го уровня экстракторов материи. Важно помнить, что не следует усовершенствовать все экстракторы материи одновременно. Хорошим ходом может быть содействие экстракторам материи инженерами во время усовершенствования."
TU04_TUC200_010_030="На 1-м уровне хорошей стратегией может стать строительство группами инженеров новых генераторов, экстракторов и фабрикаторов материи. Если вы строите большое количество фабрикаторов, будьте готовы приостановить некоторые или даже все из них, если показатель выработки энергии упадет."
TU04_TUC200_010_035="Двойной щелчок по фабрикатору энергии в режиме стратегического обзора - наиболее быстрый способ приостановить все фабрикаторы. Хорошая стратегия создания групп инженеров по выработке энергии, заключается в приказе одному инженеру строить, а другим - содействовать первому."
TU04_TUC200_010_050="Залог стабильной экономики - постоянное совершенствование средств добычи материи и энергии. На 2-м уровне, это означает постройку силовых генераторов 2-го уровня и модернизацию экстракторов материи до 2-го и 3-го уровня. Для сохранения равновесия между материей и энергией применяйте фабрикаторы материи."
TU04_TUC250_010_020="Поддерживать экономику на стабильном уровне важно всегда, но особенно критично - на начальных стадиях развития. В начале развития особенно опасным является дисбаланс между производством материи и энергии."
TU04_TUC250_010_025="Другая типичная причина экономического краха - создание большого количества инженеров до того как построена стабильная инфраструктура добычи ресурсов. Также следует избегать одновременной модернизации нескольких экстракторов материи."
TU04_TUC250_010_030="Узнать о том, что ваша экономика под угрозой можно по нескольким признакам: индикатор материи или энергии на панели управления стал красными или вы получаете сообщение о том, что запас ресурсов низок или равен нулю. Если эффективность строительства упала ниже 50%, это также является характерным признаком. Чтобы справиться с крахом экономики, можно предпринять ряд действий. Если слишком много ресурсов уходит на строительство, вы можете приостановить работу нескольких инженеров."
TU04_TUC250_010_035="В данном примере мы начали слишком масштабное строительство, поэтому мы приостанавливаем часть инженеров, а остальных направляем с постройки завода на добычу материи и энергии. В данном примере мы погубили экономику, начав одновременную модернизацию трех экстракторов материи, поэтому мы приостанавливаем модернизацию двух из них."
TU04_TUC250_010_040="В данном случае производство материи в норме, но энергии не хватает - будет полезно приостановить работу экстракторов материи. Мы возобновим их работу, когда уровень энергии придет в норму."
TU04_TUC250_010_045="Еще один вариант действий - приостановить заводы. У нас есть хорошо работающий комплекс из шести заводов 1-го уровня, но мы производим слишком много, поэтому имеет смысл остановить несколько из них, чтобы освободить ресурсы для развития экономической инфраструктуры. Не забывайте возобновлять работу зданий и отрядов после того как состояние экономики стабилизируется."
TU05_TUA100_010_020="Авиационный завод 1-го уровня может производить легкий транспорт, способный перевозить инженеров, боевые единицы и даже БКМ в любую точку суши Театра Военных Действий. Данный транспорт имеет шесть узлов подвески (по три на борт), и может перевозить до шести боевых единиц, в зависимости от их веса и размеров. Хотя собственного вооружения транспорт 1-го уровня не имеет, перевозимые им боевые единицы могут вести огонь, находясь на подвеске, превращая транспорт в мощную оружейную платформу."
TU05_TUA100_010_030="Транспорт создается на авиационных заводах. Есть несколько способов загрузки транспорта: вы можете выбрать одну боевую единицу или группу боевых единиц, и указать им на нужный транспорт; когда курсор изменит свою форму на \"Погрузку\", щелкните правой кнопкой мыши."
TU05_TUA100_010_035="Если боевые единицы находятся рядом с транспортом, они переместятся к нему и закрепятся на магнитных подвесах. Если транспорт находится далеко, он подлетит к боевым единицам и загрузит их. Если боевых единиц больше, чем может поместиться в транспорт, и у вас есть несколько транспортов, выберите нужные боевые единицы и используйте клавишу Shift, чтобы загрузить их в каждый транспорт."
TU05_TUA100_010_040="Чтобы разгрузить транспорт, выделите его, щелкните кнопку \"Транспортировка\" в меню команд и щелкните левой кнопкой мыши точку разгрузки. Вы можете использовать кнопку Shift, чтобы проложить сложный маршрут перед выгрузкой - это позволит вам избежать обнаружения и уклониться от огня противника. Если вы используете транспорт как оружейную платформу, пошлите его в бой командой \"Перемещение\" или \"Патрулирование\". Транспорт, патрулирующий небо над вражеской базой, может произвести сильные разрушения."
TU05_TUA200_010_020="При помощи транспортов вы можете организовать автоматическую паромную линию. Это позволит вам непрерывно перемещать боевые единицы из одной точки в другую. Чтобы организовать паромную линию, поместите транспорт в точку отправления, выберите команду \"Паром\" из меню команд и щелкните точку назначения."
TU05_TUA200_010_025="Транспорт автоматически сбросит маяк. Если транспорт загружен, он сразу же начнет свой первый рейс. Если транспорт пуст, то он остановится возле маяка в ожидании боевых единиц, и начнет рейс после их прибытия."
TU05_TUA200_010_030="Чтобы отправить боевую единицу по паромной линии, загрузите ее не в сам транспорт, а в маяк. Если вы загрузите боевую единицу в транспорт, вы отмените команду \"Паром\" и маяк самоуничтожится. В этом примере мы выделяем большую группу боевых единиц и перемещаем их к маяку. Транспорт последовательно будет перевозить их в точку назначения."
TU05_TUA200_010_050="Вы можете автоматически отправлять боевые единицы к маяку прямо с завода. Чтобы сделать это, выделите завод и щелкните правой кнопкой мыши маяк. Если маяк снабжается несколькими заводами, то транспорт каждый раз будет уходить полностью загруженным, что обеспечит непрерывный поток подкреплений на линию фронта."
TU05_TUA400_010_020="На 2-м и 3-м уровнях вы можете строить генераторы силовых полей для защиты базы, БМК и прочих боевых единиц. Разница между генераторами 2-го и 3-го уровня заключается в зоне охвата, силе поля и потреблении энергии. Поле защищает находящуюся внутри него технику и здания от обстрела снаружи. Оно не защищает от огня вражеской техники, прорвавшейся внутрь защищаемого периметра."
TU05_TUA400_010_025="Поэтому наиболее эффективно строить несколько генераторов, поля которых будут перекрываться. Если враг проникнет под одно из полей или разрушит генератор, ваши войска все равно будут защищены. В этом примере БМК защищена тремя пересекающимися силовыми полями."
TU05_TUA400_010_030="Силовые поля потребляют большое количество энергии. Когда вы начнете строить генераторы силовых полей, обеспечьте мощный приток энергии во избежание проблем с энергоснабжением. Если уровень энергии упадет ниже 100%, генераторы полей будут менее эффективны и в их работе начнутся перебои - поля будут периодически отключаться."
TU05_TUA400_010_035="В этом случае отключите менее важные силовые поля, чтобы обеспечить работу генераторов щитов находящихся в стратегически важных местах. Для надежной работы на каждый генератор силового поля необходим как минимум один генератор энергии такого же технологического уровня. Также не забывайте, что силовые поля не защищают от ядерной бомбардировки."
TU05_TUA500_010_020="Ваши основные разведывательные единицы - наземный и воздушный разведчики. Это быстрые машины с увеличенным радиусом обзора. Постоянное патрулирование и разведка с их помощью - один из лучших способов всегда оставаться в курсе дел противника."
TU05_TUA500_010_025="На 1-м уровне инженеры также могут строить радары (на суше) и гидролокаторы (на воде) для раннего обнаружения сил противника. Многие командующие предпочитают расставить радары по всему полю боя. Радары 1-го уровня весьма дешевы, а гидролокаторы незаменимы для обнаружения подводных лодок."
TU05_TUA500_010_030="На 2-м уровне вы сможете строить радар дальнего действия, который отличается значительно увеличенным радиусом обзора. Помните, что радары можно обмануть или заглушить при помощи специальной техники. На 2-м уровне вы сможете также строить генераторы помех для противодействия вражеским радарам."
TU05_TUA500_010_035="Башни генераторов помех покрывают определенный радиус вокруг себя и потребляют при работе энергию. Они крайне важны при организации скрытых передовых баз. Обратите внимание, что генераторы помех неэффективны против всеволновых радаров, о которых мы поговорим позднее."
