Unit_Description_0004="Размещает одну крылатую ракету на спине БМК."
Unit_Description_0005="Увеличивает количество доступных чертежей, скорость постройки БМК и количество очков жизни."
Unit_Description_0006="Значительно увеличивает скорость самопочинки БМК."
Unit_Description_0007="Заменяет инженерный комплекс 2-го уровня. Увеличивает число доступных чертежей, а также  скорость постройки БМК и количество очков жизни."
Unit_Description_0008="Увеличивает  повреждения, наносимые главной пушкой. Также увеличивает радиус главной пушки и форсированного удара."
Unit_Description_0009="Добавление тактической ядерной ракеты."
Unit_Description_0010="Добавление телепортатора. Для активации требуется значительное количество энергии."
Unit_Description_0011="Увеличивает радиус защитного барьера БМК.  Для активации требуется энергия."
Unit_Description_0012="Увеличивает скорость производства ресурсов БМК."
Unit_Description_0013="Создает защитный барьер вокруг БМК. Для активации требуется энергия."
Unit_Description_0014="Инженерный дроид является вспомогательной инженерной единицей, содействующей БМК."
Unit_Description_0015="Добавление второго инженерного дроида. Требуется наличие первого."
Unit_Description_0016="Многофункциональная единица, может быстро восстановить или отремонтировать любое здание или технику. Соответствует инженеру 3-го уровня."
Unit_Description_0017="Инженерный дроид является вспомогательной инженерной единицей, содействующей АКБП в строительстве или ремонте."
Unit_Description_0018="Создает защитный барьер вокруг АКБП. Для активации требуется энергия."
Unit_Description_0019="Увеличивает радиус защитного барьера АКБП. Для активации требуется энергия."
Unit_Description_0020="Генератор помех создает ложные отметки на радарах противников. Неэффективен против всеволновых радаров."
Unit_Description_0021="Увеличивает скорость производства ресурсов АКБП."
Unit_Description_0022="Значительно увеличивает радиус стандартного радара АКБП."
Unit_Description_0023="Быстро охлаждает орудийные установки АКБП. Это позволяет увеличить скорострельность."
Unit_Description_0024="Позволяет тяжелому плазменному орудию АКБП наносить урон ударной волной."
Unit_Description_0025="Это быстрая, легкобронированная разведывательная машина, оснащенная пулеметом и отличным сенсорным оборудованием."
Unit_Description_0026="Это легкобронированная наземная боевая единица непосредственной огневой поддержки. Эффективна против целей низкого уровня."
Unit_Description_0027="Универсальная самоходная артиллерийская установка. Идеальна для поражения врага с большого расстояния."
Unit_Description_0028="Самоходная установка ПВО. Идеальна для поражения целей низкого  уровня в воздухе."
Unit_Description_0029="Легкобронированный танк. Оснащен единственной пушкой."
Unit_Description_0030="Тяжелый танк. Оснащен сдвоенной пушкой и защищен тяжелой броней."
Unit_Description_0031="Танк-амфибия. Обеспечивает непосредственную огневую поддержку с помощью двух картечных пушек."
Unit_Description_0032="Тяжелобронированная, самоходная боевая ракетная установка. Идеальна для поражения на больших расстояниях.  "
Unit_Description_0033="Мобильная система ПВО. Оснащена ЗА."
Unit_Description_0034="Мобильный генератор защитного поля."
Unit_Description_0035="Бронированный штурмовой осадный бот. Оснащен двумя пушками и тактической ракетной установкой."
Unit_Description_0036="Тяжелая артиллерийская установка, обладающая низкой скоростью перемещения. В режиме огня должна быть неподвижной."
Unit_Description_0037="Экспериментальный плавающий завод. Обладает броней и огневой мощью линкора. Для защитного поля требуется энергия."
Unit_Description_0038="Базовый самолет-разведчик."
Unit_Description_0039="Быстрый и маневренный самолет. Оснащен спаренными рельсовыми пушками системы \"воздух-воздух\"."
Unit_Description_0040="Мощный легкобронированный бомбардировщик"
Unit_Description_0041="Воздушный транспорт низкого уровня. Вмещает 6 боевых единиц."
Unit_Description_0042="Легкий штурмовик. Оснащен одиночной картечной пушкой и транспортным захватом. "
Unit_Description_0043="Торпедоносец. Оснащен торпедами класса \"Морской черт\"."
Unit_Description_0044="Очень быстрый самолет-шпион. Оснащен радарной системой среднего уровня."
Unit_Description_0045="Тяжело вооруженный воздушный транспорт среднего уровня. Оснащен картечными пушками и средствами ПВО. Вмещает 12 боевых единиц."
Unit_Description_0046="Следующее поколение истребителей. Идеален для уничтожения целей любого класса в воздухе. "
Unit_Description_0047="Следующее поколение стратегических бомбардировщиков. Оснащен маленькой ядерной бомбой и легкой зенитной установкой."
Unit_Description_0048="Тяж. штурмовик. Оснащен двумя тактическими ракетными установками и противовоздушной рельсовой пушкой."
Unit_Description_0049="Фрегат. Оснащен одной пушкой, противовоздушной рельсовой пушкой, радаром, гидролокатором, генератором помех."
Unit_Description_0050="Ударная подводная лодка."
Unit_Description_0051="Военный корабль ПВО. Оснащен системой \"земля-воздух\", системой ЗРК и тактическими крылатыми ракетами."
Unit_Description_0052="Корабль среднего уровня. Оснащен торпедами класса \"Морской черт\",  \"умными\" глубинными зарядами, системой ПВО."
Unit_Description_0053="Корабль для обстрела береговых целей и борьбы с кораблями противника. Оснащен трехствольными тяжелыми пушками Гаусса, четырьмя противовоздушными рельсовыми пушками и двумя противоракетными пушками \"Фаланга\"."
Unit_Description_0054="Подводная лодка со стратегическими ракетами. Оснащена тактическими ракетами дальнего действия и пусковой ракетной установкой."
Unit_Description_0055="Авианосец ПЛ. Может перевозить и ремонтировать самолеты. Оснащен торпедной установкой и системой ПВО."
Unit_Description_0056="Описание Верховного командующего ОФЗ"
Unit_Description_0057="Стандартная система обороны большинства колоний и военных объектов. Не действует против ВВС или ПЛ.  "
Unit_Description_0058="Зенитная турель. Эффективна против ВВС низкого уровня."
Unit_Description_0059="Система ВМО."
Unit_Description_0060="Блокирует продвижение противника. Обеспечивает некоторую защиту от прямого вражеского огня."
Unit_Description_0061="Мощное оборонительное сооружение, способное обезвредить ракеты наземного и морского базирования. Не действует против ВВС или ПЛ."
Unit_Description_0062="Зенитная турель. Эффективна против стандартных ВВС."
Unit_Description_0063="Система обороны против тактических ракет. Оборона ограничена радиусом боевых действий. "
Unit_Description_0064="Система ВМО. Эффективна против ВМС."
Unit_Description_0065="Обеспечивает находящиеся рядом боевые единицы и строения защитным полем."
Unit_Description_0066="Зенитный комплекс высокого уровня. Эффективен против вражеских самолетов любого класса."
Unit_Description_0067="ПРО. Защита ограничена радиусом действия установки."
Unit_Description_0068="Обеспечивает находящиеся рядом боевые единицы и строения мощным защитным полем."
Unit_Description_0069="Стационарная артиллерийская установка. Предназначена для уничтожения медленных целей и строений противника."
Unit_Description_0070="Тактическая ракетная установка. Для постройки ракет необходимо отдать соответствующий приказ."
Unit_Description_0071="Платформа для ремонта и дозаправки самолетов. Воздушный патруль автоматически использует сооружение."
Unit_Description_0072="Тяжелая стационарная артиллерийская установка. Обладает большим радиусом действия, точностью и силой удара."
Unit_Description_0073="Стратегическая ракетная установка. Для постройки ракет требуются ресурсы. Также необходимо отдать соответствующий приказ."
Unit_Description_0074="Позволяют вызвать автономного командного бота поддержки."
Unit_Description_0075="Усовершенствованная стратегическая артиллерия. Способна наносить мощнейшие точечные удары на огромном расстоянии."
Unit_Description_0076="Амфибия 1-го уровня. Способна производить, ремонтировать, захватывать и перепрограммировать."
