Unit_Description_0418="Гибридный истребитель/бомбардировщик предназначенный для уничтожения как наземных, так и воздушных целей. Вооружен нанопушкой и ракетной установкой."
Unit_Description_0419="Учитывая разрушительную силу и возможность доставки по воздуху \"Милосердия\", ученым эон пришлось разработать простую одноразовую систему доставки. В результате, основная часть крепится к управляемой ракете."
Unit_Description_0420="Здесь находится командующий. Совмещает в себе казармы и командный центр. Содержит все основные чертежи военной техники и может на пустом месте создать целую армию."
Unit_Description_0421="Добавляет телепортатор. Для активации требуется значительное кол-во Энергии."
Unit_Description_0422="Увеличивает скорость починки БМК. Также увеличивает кол-во очков жизни."
Unit_Description_0423="Значительно увеличивает скорость починки БМК. Также увеличивает кол-во очков жизни."
Unit_Description_0424="Увеличивает скорость, с которой БМК производит ресурсы."
