Unit_Description_0439="Добавляет телепортатор. Для активации требуется значительное кол-во Энергии."
Unit_Description_0440="Уничтожает большинство боевых единиц одним выстрелом. Потребляет огромное кол-во энергии."
Unit_Description_0441="Быстрый тяжеловооруженный штурмовой бот. Вооружен плазменной пушкой системы Гатлинга м гранатометом, использующим осколочные гранаты повышенной мощности."
Unit_Description_0442="Мобильная боевая единица поддержки. Предназначена для атаки и уничтожения защитных полей противника. Обладает чрезвычайно низкой эффективностью огня против боевых единиц противника."
Unit_Description_0443="Миномет системы Гатлинга использующий высокоэффективные разрывные снаряды и обладающий высокой точностью огня."
Unit_Description_0444="Тяжеловооруженный ракетный бот. Предназначен для атаки и уничтожения тяжелобронированной техники."
Unit_Description_0445="Подлодка-невидимка, предназначенная для разведопераций и не несущая вооружения. Оснащена протиторпедными зарядами."
Unit_Description_0446="Осуществляет починку, поддержку и захват любых боевых единиц в радиусе действия."
