Unit_Description_0449="Мобильная система ПВО. Вооружена зенитной пушкой."
Unit_Description_0450="Артиллерийская установка, обладающая низкой скоростью премещения. В режиме огня должна быть неподвижной."
Unit_Description_0451="Осуществляет починку, поддержку и захват любых боевых единиц в радиусе действия."
