Unit_test_Description="Много лет тому назад командующий по имени Финн проиграл сражение и был вынужден спасаться бегством. Позже он заманил своего противника на маленький остров и там разгромил его. С тех пор остров стали называть его именем."
VO_Credits_Aeon_Credits_010_010="Принцесса исчезла. Никаких следов."
VO_Credits_Aeon_Credits_010_020="Вне всякого сомнения, сегодня день печали и скорби. Но мы не забываем того, чего так хотела принцесса, будущего, которого она хотела для своего народа. До последнего вздоха мы будем сражаться с ее именем на устах."
VO_Credits_Aeon_Credits_010_030="Иначе это будет оскорбление ее памяти и жертвы, которую она принесла."
VO_Credits_Aeon_Credits_010_040="Именно поэтому, несмотря на опустошение, несмотря на скорбь, мы будем искать и уничтожим всех предателей, которые остались в ордене. Мы уничтожим все оставшиеся очаги сопротивления серафим."
VO_Credits_Aeon_Credits_010_050="Мы позаботимся о том, чтобы такая угроза больше не нависла над человечеством никогда."
VO_Credits_Aeon_Credits_010_060="После последней победы над предателями ордена и серафим, мы сложим наше оружие. С того момента Путь будет способствовать установлению мира и торжества красоты. Никогда более не будет он использоваться как оружие и оправдание убийств и войн."
VO_Credits_Aeon_Credits_010_070="Этот путь принцесса выбрала для нас. И мы пойдем по нему."
VO_Credits_Credits_010_010="Я вижу на ваших лицах облегчение, радость и чувство триумфа. Вне всякого сомнения, вы хотите только одного - отпраздновать нашу победу. Настал тот день, когда серафим и орден спасаются бегством, а КИИ больше не существует."
VO_Credits_Credits_010_020="Но я хочу предостеречь вас, не переусердствуйте в праздновании. Мы победили, но это пиррова победа. Наши позиции ненадежны, отовсюду нам угрожает опасность."
VO_Credits_Credits_010_030="Самая серьезная исходит не от серафим, а от самих нас."
VO_Credits_Credits_010_040="Нам нужно сделать очень простой выбор. Согласны ли мы простить наших бывших противников и принять общие цели, которые нас объединяют?"
VO_Credits_Credits_010_050="Или мы вернемся к тому, во что всегда верили? Позволим страху, ненависти и подозрениям влиять на наши поступки? Будем ли мы отвечать насилием на то, что не можем понять? Ради всего, что нам дорого, это не должно больше произойти."
VO_Credits_Credits_010_060="Я не позволю этому случиться."
VO_Credits_Credits_010_070="С настоящего момента Объединенная Федерация Земли официально признает независимость нации кибран и эон иллюминат. Обе нации имеют полное право занимать их текущие и исторические территории. Я надеюсь, что в ближайшем будущем будет заключен постоянный союз трех наций."
VO_Credits_Credits_010_080="Мы всегда мечтали об объединении галактики, объединении братьев и сестер человечества. Наконец-то эта мечта осуществилась. И я надеюсь, что мы никогда не забудем что нас привело к этому моменту -- не оружие, а миротворческий оптимизм."
VO_Credits_Credits_010_090="Пусть же он длится вечно."
VO_Credits_Credits_020_010="Принцесса исчезла. Никаких следов."
VO_Credits_Credits_020_020="Вне всякого сомнения, сегодня день печали и скорби. Но мы не забываем того, чего так хотела принцесса, будущего, которого она хотела для своего народа. До последнего вздоха мы будем сражаться с ее именем на устах."
VO_Credits_Credits_020_030="Иначе это будет оскорбление ее памяти и жертвы, которую она принесла."
VO_Credits_Credits_020_040="Именно поэтому, несмотря на опустошение, несмотря на скорбь, мы будем искать и уничтожим всех предателей, которые остались в ордене. Мы уничтожим все оставшиеся очаги сопротивления серафим."
VO_Credits_Credits_020_050="Мы позаботимся о том, чтобы такая угроза больше не нависла над человечеством никогда."
VO_Credits_Credits_020_060="После последней победы над предателями ордена и серафим, мы сложим наше оружие. С того момента Путь будет способствовать установлению мира и торжества красоты. Никогда более не будет он использоваться как оружие и оправдание убийств и войн."
VO_Credits_Credits_020_070="Этот путь принцесса выбрала для нас. И мы пойдем по нему."
VO_Credits_Credits_030_010="Я получил послание от генерала Холла, что ОФЗ признала суверенитет нации кибран и всех, кто в нее входит. О, да. Теперь мы можем жить так, как считаем нужным."
VO_Credits_Credits_030_020="Он также предложил постоянный союз между нашими двумя народами. Это предложение с тяжестью в сердце я был вынужден пока отклонить."
VO_Credits_Credits_030_030="Дети мои, мы свободны. Но что означает свобода? Означает ли она, что мы оставим наш народ и заключим союз с чудовищами? Что мы предадим наших братьев и сестер из личных побуждений и жадности?"
VO_Credits_Credits_030_040="Или же она означает, что мы примем ответственность, связанную со свободой, с чувством повиновения и благодарности? Что мы ставим общее благо выше личных интересов? О, да. Вот что свобода значит для меня. Для всех нас."
VO_Credits_Credits_030_050="Прежде всего мы должны залечить все недуги, которыми страдает нация кибран. Все узлы должны жить в мире и согласии. О, да. Жить в мире."
VO_Credits_Credits_030_060="Но всегда остается что-то еще. Что-то, что нужно сделать."
VO_Credits_Credits_030_070="Мы будем продолжать оказывать поддержку нашей сестре Ризе. Их противники - наши противники. Мы должны простить. И помогать тем, кого когда-то считали своими злейшими врагами."
VO_Credits_Credits_030_080="Мы будем двигаться в этом направлении. О, да. В этом направлении."
VO_Credits_Credits_030_090="Берегите себя, дети мои. Берегите себя."
VO_Credits_Credits_040_010="ААААААААА!"
