VO_Credits_Outro_VO_010_010="ААААААААА!"
VO_Credits_UEF_Credits_010_010="Я вижу на ваших лицах облегчение, радость и чувство триумфа. Вне всякого сомнения, вы хотите только одного - отпраздновать нашу победу. Настал тот день, когда серафим и орден спасаются бегством, а КИИ больше не существует."
VO_Credits_UEF_Credits_010_020="Но я хочу предостеречь вас, не переусердствуйте в праздновании. Мы победили, но это пиррова победа. Наши позиции ненадежны, отовсюду нам угрожает опасность."
VO_Credits_UEF_Credits_010_030="Самая серьезная исходит не от серафим, а от самих нас."
VO_Credits_UEF_Credits_010_040="Нам нужно сделать очень простой выбор. Согласны ли мы простить наших бывших противников и принять общие цели, которые нас объединяют?"
VO_Credits_UEF_Credits_010_050="Или мы вернемся к тому, во что всегда верили? Позволим страху, ненависти и подозрениям влиять на наши поступки? Будем ли мы отвечать насилием на то, что не можем понять? Ради всего, что нам дорого, это не должно больше произойти."
VO_Credits_UEF_Credits_010_060="Я не позволю этому случиться."
VO_Credits_UEF_Credits_010_070="С настоящего момента Объединенная Федерация Земли официально признает независимость нации кибран и эон иллюминат. Обе нации имют полное право занимать их текущие и исторические территории. Я надеюсь, что в ближайшем будущем будет заключен постоянный союз"
VO_Credits_UEF_Credits_010_080="Мы всегда мечтали об объединении галактики, объединении братьев и сестер человечества. Наконец-то эта мечта осуществилась. И я надеюсь, что мы никогда не забудем что нас привело к этому моменту -- не оружие, а миротворческий оптимизм."
VO_Credits_UEF_Credits_010_090="Пусть же он длится вечно."
Vedetta="Ведетта"
Vendetta="Ведетта"
Voice="Голос"
X01_B01_000_010="17377"
X01_B01_001_010="Я не знаю, как это произошло, но эти ублюдки нашли нас. Они высадились на планете, атакуют Форт Кларк и отдаленные гражданские центры."
X01_B01_002_010="Командующий, деваться нам некуда. Форт Кларк - наша последняя база, и все пути к отступлению отрезаны. Если мы не справимся сегодня, серафим и их прислужники смогут получить власть, которая позволит им уничтожить всех людей в галактике."
X01_B01_002_020="У нас нет другого выбора, кроме как окопаться и удерживать позиции. Генерал Флетчер уже прибыл на планету и возглавил оборону Форта Кларк. Мы хотим открыть еще один фронт, поэтому вы высаживаетесь к югу от его позиции."
X01_B01_002_030="Зона вашей высадки находится здесь. В этой местности находятся две базы Ордена, они обеспечивают подкрепления для атаки Форта Кларк. Вам нужно уничтожить все здания Ордена и продвинуться вглубь территории."
X01_B01_002_040="Продолжайте двигаться на север, пока не свяжетесь с Флетчером. Когда осада Форта Кларк будет снята, вы двое приступите к непосредственному уничтожению командующего серафим."
X01_B01_003_010="Командующий, вы должны победить, это приказ."
X01_DB01_010_010="[{i Hall}]: Нас приперли к стенке, но вы сделали это, командующий. Форт Кларк в безопасности, это важная победа над чертовыми пришельцами и их союзниками. Отныне мы больше не будем бегать от них. Если мы переживем это, у нас будет возможность перейти в наступление. Именно это мы и собираемся сделать."
X01_DB01_020_010="[{i Kael}]: Внимание, всем командующим ордена. Форт Кларк пал, то, что оставалось от командного пункта ОФЗ, уничтожено, коалиции больше не существует. Это славный день для ордена иллюминат! Мы победили!"
X01_M01_010_010="[{i HQ}]: Будьте готовы действовать быстро. Конец связи."
X01_M01_011_010="[{i HQ}]: Оборону баз осуществляет артиллерийская батарея. Она является второстепенной целью, но если вы уничтожите ее, это здорово облегчит вам жизнь."
X01_M01_012_010="[{i HQ}]: Мы свяжемся в вами после того, как вы уничтожите главную базу -- черт, атака вражеских штурмовиков. Пора отправлять вас туда, пока еще есть возможность."
X01_M01_013_010="[{i HQ}]: Черт подери, они атакуют Врата. Отправляйтесь на планету, пока есть возможность!"
X01_M01_014_010="[{i HQ}]: Это уже слишком. Выполняйте задачу, Командующий."
X01_M01_020_010="[{i HQ}]: Как и сказал Холл, вашим первым заданием будет уничтожить две базы Орден к северу от вас. Конец связи."
X01_M01_021_010="[{i HQ}]: Вижу несколько артиллерийских позиций. Они являются второстепенными целями, но если вы уничтожите их, это здорово облегчит вам жизнь."
X01_M01_030_010="[{i Fletcher}]: Вы только что высадились в аду, полковник, но я рад, что вы здесь."
X01_M01_031_010="[{i Rhiza}]: Мы предоставляем в ваше распоряжение реактивный истребитель средней дальности действия \"Быстрый Ветер\". Конец связи."
X01_M01_032_010="[{i Rhiza}]: Командующий, вы получили чертежи \"Пламени\". Броня легкая, но зато огневая мощь впечатляет. Конец связи."
X01_M01_040_010="[{i Fletcher}]: Кибран, да? А я думал, что вы, ребята, меняете воду в капсуле с мозгами Брэкмена."
X01_M01_040_020="[{i Dostya}]: Не обращайте на него внимания, командующий. Сконцентрируйтесь на предстоящей битве. Конец связи."
X01_M01_050_010="[{i Fletcher}]: Я слежу за тобой, эон. Я помню о том, что вы вытворяли во время войны."
X01_M01_050_020="[{i Rhiza}]: Забудь о нем, Победитель. Прославь принцессу."
X01_M01_060_010="[{i Gari}]: Сегодня коалиции придет конец. Никому не уйти от нашего гнева."
X01_M01_070_010="[{i HQ}]: Передаем чертеж Персиваля в вашу БМК; это модифицированный штурмовой осадный бот, который может перемещаться по воде. Конец связи."
X01_M01_080_010="[{i HQ}]: Передаем чертеж Кирпича в вашу БМК; это модифицированный штурмовой осадный бот, который может перемещаться по воде. Еще одна разработка Брэкмена. Конец связи."
X01_M01_090_010="[{i Fletcher}]: Мне бы очень пригодилась ваша помощь, полковник. Уничтожьте эти базы как можно скорее."
X01_M01_100_010="[{i Fletcher}]: Мы не сможем встретиться до тех пор, пока вы не уничтожите эти базы."
X01_M01_105_010="[{i Fletcher}]: Перестаньте заниматься ерундой и уничтожьте эти базы!"
X01_M01_106_010="[{i Fletcher}]: Займитесь делом и уничтожьте эти базы!"
X01_M01_110_010="[{i Fletcher}]: Мне начинает казаться, что у вас кишка тонка биться со своими. Вы уничтожите эти базы в конце концов?"
X01_M01_116_010="[{i Fletcher}]: Мы потеряем Форт Кларк, если вы не займетесь делом. Уничтожьте эти базы!"
X01_M01_117_010="[{i Hall}]: Командующий, вы должны незамедлительно продвигаться вглубь территории. Огромное количество жизней висит на волоске."
X01_M01_118_010="[{i Rhiza}]: Тебя ждет командующий ордена по имени Гари, Победитель. Она - одна из самых любимых учениц судьи Каэль; уничтожь ее во имя принцессы. Конец связи."
X01_M01_120_010="[{i HQ}]: Северная база уничтожена. Конец связи."
X01_M01_130_010="[{i HQ}]: Южная база разгромлена. Конец связи."
X01_M01_140_010="[{i HQ}]: С обеими базами покончено. Продвигайтесь вглубь территории. Конец связи."
X01_M01_160_010="[{i HQ}]: Первая артиллерийская позиция уничтожена. Конец связи."
X01_M01_170_010="[{i HQ}]: Подтверждаю уничтожение второй артиллерийской позиции. Конец связи."
X01_M01_180_010="[{i HQ}]: Еще одна артиллерийская позиция разгромлена. Осталась последняя. Конец связи."
X01_M01_190_010="[{i HQ}]: Отличная работа, это была четвертая. Конец связи."
X01_M01_200_010="[{i HQ}]: Это была последняя - все артиллерийские позиции уничтожены. Конец связи."
X01_M01_210_010="[{i HQ}]: Не все артиллерийские позиции уничтожены. Конец связи."
X01_M01_220_010="[{i HQ}]: Артиллерия ордена по прежнему в строю. Конец связи."
X01_M01_230_010="[{i HQ}]: Эта сумасшедшая тварь атакует города. Остановите ее. Конец связи."
X01_M01_240_010="[{i HQ}]: Командующий, в канале к северу от вашего места высадки действуют подлодки противника. Уничтожьте их. Конец связи."
X01_M01_250_010="[{i HQ}]: Отличная работа. Теперь, когда подлодки уничтожены, вы можете подготовить атаку на позиции Ордена на материке. Конец связи."
X01_M01_260_010="[{i HQ}]: Поврежденный генератор поля поможет вам обороняться от огня противника. Почините его. Конец связи."
X01_M01_270_010="[{i HQ}]: Прекрасно. Генератор силового поля полностью отремонтирован и работает на полную мощность. Конец связи."
X01_M01_280_010="[{i HQ}]: Чего вы ждете? Выделите ваш БМК."
X01_M01_290_010="[{i HQ}]: Командующий, выделите ваш БМК.."
X01_M01_OBJ_010_010="Уничтожьте базы ордена"
X01_M01_OBJ_010_020="Командующий ордена располагает двумя базами на северном острове. Уничтожьте все заводы на каждой базе, чтобы они не смогли помешать продвижению ваших войск.."
X01_M01_OBJ_010_030="Сопроводите грузовики."
X01_M01_OBJ_010_035="Прикажите гражданскому конвою двигаться в указанный район."
X01_M01_OBJ_010_040="Артиллерийское заграждение"
X01_M01_OBJ_010_045="Запросите артиллерийскую поддержку \"Мавров\" Флетчера."
X01_M01_OBJ_020_010="Уничтожьте артиллерийские позиции ордена"
X01_M01_OBJ_020_020="Командующий ордена расположил артиллерийские позиции так, чтобы они могли обстреливать канал. Уничтожьте их и пересечь его будет намного легче."
X01_M01_OBJ_020_030="Отремонтируйте генератор поля"
X01_M01_OBJ_020_040="Отремонтируйте находящийся поблизости генератор поля. После ремонта он обеспечит максимальную защиту от огня противника."
X01_M01_OBJ_020_050="Уничтожьте силы противника в канале"
X01_M01_OBJ_020_060="Уничтожьте патрули подлодок противника, действующие в канале."
X01_M02_010_010="[{i HQ}]: Комендант Грэхэм на связи. Соединяю с ним."
X01_M02_010_020="[{i Graham}]: Командующий, силы ордена превосходят нашу оборону. Нас отрезали от Форта Кларк, генерал Флетчер не может направить к нам подкрепления. Нам нужна ваша помощь."
X01_M02_010_030="[{i Hall}]: Командующий, планы изменились. Флетчеру придется еще какое-то время держать оборону Форта Кларк самостоятельно - вам нужно будет защитить гражданских и уничтожить силы противника в данном районе."
X01_M02_010_040="[{i Gari}]: Я очищу эту планету от всего живого! Только идиоты могут пытаться противостоять нашей силе!"
X01_M02_011_010="[{i Graham}]: Командующий, силы ордена превосходят нашу оборону. Нас отрезали от Форта Кларк, генерал Флетчер не может направить к нам подкрепления. Нам нужна ваша помощь."
X01_M02_012_010="[{i Hall}]: Командующий, планы изменились. Флетчеру придется  еще какое-то время удерживать Форт Кларк самостоятельно -- вам нужно защитить гражданских и уничтожить силы противника в данном районе."
X01_M02_013_010="[{i Gari}]: Я очищу эту планету от всего живого! Только идиоты могут пытаться противостоять нашей силе!"
X01_M02_020_010="[{i Hall}]: Эта сумасшедшая чертовски близко подобралась к гражданским, командующий. Остановите ее."
X01_M02_030_010="[{i Hall}]: Защитите гражданских!"
X01_M02_035_010="Мы находимся под бомбардировкой, командующий! Долго мы не продержимся. Прошу, сделайте что-нибудь!"
X01_M02_035_020="[{i Hall}]: Командующий, вы должны защитить эти здания!"
X01_M02_035_030="[{i Gari}]: Эти люди будут принесены в жертву нашим богам."
X01_M02_036_010="[{i Hall}]: Командующий, мы не можем потерять убежища."
X01_M02_037_010="[{i Graham}]: По нам наносят удары со всех направлений. Боже, помоги нам..."
X01_M02_038_010="[{i Graham}]: Нам нужна помощь, командующий!"
X01_M02_039_010="[{i Graham}]: Гражданские в безопасности. Я у вас в долгу на всю жизнь, командующий."
X01_M02_040_010="[{i Graham}]: О, нет... они уничтожили весь город. Все гражданские... мертвы."
X01_M02_041_010="[{i Graham}]: Убежищам пока ничего не угрожает, полковник, но я не думаю, что они выдержат еще одну атаку. Если бы командующий ордена собирался напасть снова..."
X01_M02_041_020="[{i Graham}]: Еще одна проблема, полковник. К востоку от вашего местоположения есть еще один город. Командующий ордена еще не атаковал его, но это вопрос времени. Вы должны защитить его."
X01_M02_041_022="[{i Hall}]: Мне нужно, чтобы вы вывели оттуда этих гражданских, полковник. Комендант Грэхэм готовит вам колонну грузовиков; используйте их, чтобы эвакуировать гражданских к центру города."
X01_M02_041_025="[{i HQ}]: Вам нужно указать, куда вы хотите отправить грузовики. Щелкните по кнопке Сигнал Управления, которая находится в левой части экрана под Списком Заданий, затем щелкните по местности, куда хотите отправить грузовики. Конец связи."
X01_M02_041_030="[{i Gari}]: Вижу на сканере колонну грузовиков. Уверена, они битком набиты гражданскими. Я с превеликим удовольствием поохочусь на них."
X01_M02_042_010="[{i Hall}]: Мне нужно, чтобы вы вывели оттуда этих гражданских, полковник. Комендант Грэхэм готовит вам колонну грузовиков; используйте их, чтобы эвакуировать людей к центру города."
X01_M02_042_020="[{i HQ}]: Вам нужно указать, куда вы хотите отправить грузовики. Щелкните по кнопке Сигнал Управления, которая находится в левой части экрана под списком заданий, затем щелкните по местности, куда хотите отправить грузовики. Конец связи."
X01_M02_043_010="[{i Graham}]: Убежищам пока ничего не угрожает, полковник, но я не думаю, что они выдержат еще одну атаку. Если бы командующий ордена собирался напасть снова..."
X01_M02_044_010="[{i Gari}]: Вижу на сканере колонну грузовиков. Уверена, они битком набиты гражданскими. Я с превеликим удовольствием поохочусь на них."
X01_M02_045_010="[{i HQ}]: Морские боевые единицы противника подошли достаточно близко, полковник. Уничтожьте их, пока они не начали обстрел города. Конец связи."
X01_M02_046_010="[{i Graham}]: Не могу поверить... весь город уничтожен."
X01_M02_047_010="[{i HQ}]: Морские боевые единицы противника подошли достаточно близко, полковник. Уничтожьте их, пока они не начали атаковать. Конец связи."
X01_M02_050_010="[{i Hall}]: Полковник, один грузовик остался без движения. Отправьте его в место назначения."
X01_M02_060_010="[{i Graham}]: Командующий, мы должны доставить эти грузовики в безопасное место."
X01_M02_070_010="[{i Graham}]: Полковник, грузовики остались без охраны!"
X01_M02_075_010="[{i HQ}]: Грузовики под огнем."
X01_M02_077_010="[{i HQ}]: Командующий ордена атакует грузовики."
X01_M02_080_010="[{i Graham}]: Мы потеряли грузовик!"
X01_M02_090_010="[{i Graham}]: Они уничтожили еще один грузовик... прошу, полковник, защитите гражданских!"
X01_M02_100_010="[{i Graham}]: О, нет... еще один грузовик был уничтожен. Мы не можем допустить дальнейшие потери!"
X01_M02_160_010="[{i Graham}]: Гражданские мертвы... никого не осталось в живых..."
X01_M02_160_020="[{i Gari}]: Ха-ха-ха!"
X01_M02_161_010="[{i Gari}]: Ха-ха-ха!"
X01_M02_170_010="[{i Graham}]: Грузовик добрался до центра города, сэр."
X01_M02_180_010="[{i Graham}]: Второй грузовик в безопасности."
X01_M02_190_010="[{i Graham}]: Все грузовики прибыли в пункт назначения, гражданские отправлены в безопасное место. Вы не представляете, как я вам благодарен, полковник."
X01_M02_200_010="[{i Graham}]: Слишком много грузовиков уничтожено... все кончено..."
X01_M02_210_010="[{i Hall}]: Отличная работа, полковник. Я горжусь тем, что вы служите в войсках ОФЗ."
X01_M02_240_010="[{i HQ}]: Командующий, по вам все еще могут нанести удар с тыла. На сканере видны силы ордена, которые собираются осуществить массивный контрудар с северо-востока. Конец связи."
X01_M02_240_020="[{i HQ}]: Командующий ордена начала атаку. Будет нелегко. Конец связи"
X01_M02_245_010="[{i HQ}]: Командующий ордена выводит на позиции ботов-снайперов. Они имеют неплохую скорость и огневую мощь, но чертовски слабую броню. Конец связи."
X01_M02_250_010="[{i Gari}]: Понадобилось немало времени, но конец ОФЗ близок. Этого дня ждали очень долго."
X01_M02_250_020="[{i Hall}]: Мы будем сражаться с тобой до конца."
X01_M02_260_010="[{i Gari}]: Когда я закончу здесь, я найду и уничтожу вашего любимого доктора Брэкмена. После этого меня никто не остановит."
X01_M02_260_020="[{i Dostya}]: Мы будем сражаться с тобой до последнего."
X01_M02_270_010="[{i Gari}]: Ты предала своих людей, свое наследие и своих богов. За это ты будешь уничтожена."
X01_M02_270_020="[{i Rhiza}]: Ты извратила Путь своим фанатизмом. За это ты будешь уничтожена."
X01_M02_280_010="[{i HQ}]: Контратака была отбита. Конец связи."
X01_M02_281_010="[{i HQ}]: К вам направляется Галактический Колосс. Разберитесь с ним. Конец связи."
X01_M02_290_010="[{i Hall}]: Командующий ордена причинила нам достаточно вреда - атакуйте ее и уничтожьте."
X01_M02_290_020="[{i HQ}]: Вы слышали приказ, командующий. Продвигайтесь вглубь территории и атакуйте Гари."
X01_M02_290_030="[{i HQ}]: И еще одно: я получаю сигналы бедствия от нескольких городов у вас на пути. Помогите им по возможности, но помните уничтожение Гари - ваша главная задача."
X01_M02_320_010="[{i HQ}]: Картина, несомненно, была замечательная. Наверное следующему командующему ордена не захочется столько трепать языком. Конец связи."
X01_M02_330_010="[{i Rhiza}]: Каэль взбесится, когда узнает об этом! Слава принцессе! Конец связи."
X01_M02_340_010="[{i HQ}]: Похоже Гари высылает комитет по встрече."
X01_M02_350_010="[{i HQ}]: Надеюсь вам удастся выжить, отправляйтесь туда и уничтожьте Гари раз и навсегда. Конец связи."
X01_M02_360_010="[{i HQ}]: Защитите этот город, Командующий! Конец связи."
X01_M02_370_010="[{i HQ}]: Командующий, вы должны сопроводить эти грузовики в безопасное место. Конец связи."
X01_M02_380_010="[{i HQ}]: Вы что, приглашения ждете? Отправляйтесь туда и уничтожьте этого Командующего Ордена. Конец связи."
X01_M02_390_010="[{i Dostya}]: Командующий, нельзя терять ни минуты. Вы должны уничтожить Командующего Ордена. Конец связи."
X01_M02_400_010="[{i Rhiza}]: Гари опозорила всех нас. Уничтожьте ее. Конец связи."
X01_M02_410_010="[{i HQ}]: Похоже пришелец наносит ядерный удар. Судя по траектории полета, ракета нацелена на город на востоке. Конец связи."
X01_M02_420_010="[{i Graham}]: Они запустили ядерную ракету! Если она достигнет города на востоке, она унесет миллионы жизней!"
X01_M02_OBJ_010_010="Защитите гражданских в Сибринге"
X01_M02_OBJ_010_020="Командующий ордена атакует город. 50% гражданских строений города должны остаться невредимыми."
X01_M02_OBJ_010_030="Отразите контратаку ордена"
X01_M02_OBJ_010_040="Орден начал массированную контратаку! Отразите ее и выступите против командующего ордена."
X01_M02_OBJ_010_050="Уничтожьте командующего ордена"
X01_M02_OBJ_010_060="Если мы хотим спасти Грифон IV, командующий ордена должна быть уничтожена. Ее база находится на северо-востоке."
X01_M02_OBJ_010_070="Уничтожьте базу ордена"
X01_M02_OBJ_010_080="Уничтожьте заводы, расположенные на базе ордена."
X01_M02_OBJ_020_010="Защитите восточный город"
X01_M02_OBJ_020_020="Защитите город на востоке. Не менее 50% населения должно выжить."
X01_M02_OBJ_020_030="Эвакуируйте аванпост"
X01_M02_OBJ_020_040="В городе больше небезопасно. Уцелевшее гражданское население должно быть доставлено на грузовиках в город на западе. Минимум 6 из 10 грузовиков должны достичь цели. Щелкните по кнопке Сигнал Перемещения, затем щелкните по местности, чтобы указать куда следовать грузовикам. Сигнал Перемещения будет  обновляться по мере необходимости. Это задание не является обязательным для выполнения основного задания. Выполняйте по мере возможности."
X01_M02_OBJ_020_050="Защитите гражданские здания III (ОФЗ)"
X01_M02_OBJ_020_060="Защитите гражданские здания III (ОФЗ)"
X01_M03_010_010="[{i HQ}]: Форт Кларк расположен на северо-западе, а командующий серафим на ceверо-востоке. Пришелец должно быть чрезвычайно огорчен тем, что вы убили его милую возлюбленную, так что будьте готовы ко всему. Форт Кларк должен выстоять. Конец связи."
X01_M03_020_010="[{i Fletcher}]: Войска серафим прорвали мою оборону, полковник, теперь они атакуют стратегические объекты."
X01_M03_030_010="[{i Fletcher}]: Серафим усиливают атаку! Мне нужна помощь!"
X01_M03_040_010="[{i Fletcher}]: Тащи свою электрозадницу сюда и помоги защитить Форт!"
X01_M03_050_010="[{i Fletcher}]: Помоги мне защитить Форт, кибран!"
X01_M03_060_010="[{i Fletcher}]: Прекращай валять дурака и присылай сюда подкрепления! Форт под плотным огнем!"
X01_M03_070_010="[{i Fletcher}]: Форт Кларк под плотным огнем! Мне срочно нужны подкрепления!"
X01_M03_080_010="[{i Fletcher}]: У меня здесь просто ад, полковник. Мне очень нужна помощь!"
X01_M03_090_010="[{i Fletcher}]: Это бригадный генерал Флетчер, запрашиваю помощь! Нахожусь под шквальным огнем войск серафим!"
X01_M03_100_010="[{i Fletcher}]: Где мои подкрепления?"
X01_M03_120_010="[{i Fletcher}]: Этот уродливый пришелец находится к востоку от моего местоположения. Атакуйте его диспозицию с юга, а я зайду с запада. Он не сможет защищаться сразу по двум фронтам."
X01_M03_122_010="[{i Fletcher}]: Этот уродливый пришелец находится к востоку от моего местоположения. Его охраняют экспериментальные войска, их тоже нужно уничтожить. Атакуйте его диспозицию с юга, а я зайду с запада. Он не сможет защищаться сразу по двум фронтам."
X01_M03_130_010="[{i Fletcher}]: Вы собираетесь сидеть сложа руки или займетесь делом? серафим к востоку от меня. Атакуйте его."
X01_M03_130_020="[{i Dostya}]: Уничтожьте серафим, командующий. Покажите этому глупцу как сражаются кибран. Конец связи."
X01_M03_133_010="[{i Fletcher}]: Вы собираетесь сидеть сложа руки или займетесь делом? серафим к востоку от меня, у него группа экспериментальных войск. Уничтожьте их."
X01_M03_133_020="[{i Dostya}]: Уничтожьте серафим и его экспериментальные войска, командующий. Покажите этому глупцу как сражаются кибран. Конец связи."
X01_M03_140_010="[{i Fletcher}]: Очень вовремя! Серафим к востоку от Форта Кларк. Сделайте полезное дело - постарайтесь его отвлечь."
X01_M03_140_020="[{i Rhiza}]: Он не знает, на что ты способен, Победитель. Покажи ему нашу силу и уничтожь серафим сам. Конец связи."
X01_M03_142_010="[{i Fletcher}]: Очень вовремя! Серафим к востоку от Форта Кларк, у него группа экспериментальных войск. Сделайте полезное дело - постарайтесь его отвлечь."
X01_M03_142_020="[{i Rhiza}]: Он не знает, на что ты способен, Победитель. Покажи ему нашу силу и уничтожь серафим сам. Конец связи."
X01_M03_150_010="[{i HQ}]: Техники только что подключили новое экспериментальное спутниковое лучевое орудие. Щелкните по кнопке Сигнал Управления в левой части экрана, а затем щелкните по цели. Мы уничтожим ее отсюда."
X01_M03_160_010="[{i HQ}]: Черт побери, система охлаждения вышла из строя. Еще один выстрел нам сделать не удастся. Конец связи."
X01_M03_170_010="[{i Fletcher}]: Как же мне это нравится. Гори, детка, гори!"
X01_M03_180_010="[{i Fletcher}]: Ты ждешь медаль или что? Битва еще не закончена."
X01_M03_190_010="[{i Fletcher}]: Может вы, уродцы, хотите подраться?"
X01_M03_200_010="[{i Fletcher}]: Серафим по-прежнему жив-здоров, полковник. Давайте исправим эту оплошность.."
X01_M03_210_010="[{i Fletcher}]: Мы должны уничтожить этого серафим, полковник."
X01_M03_220_010="[{i Fletcher}]: Не отставай, кибран! Нам нужно избавиться от этого серафим!"
X01_M03_230_010="[{i Fletcher}]: Ты ждешь когда этот пришелец помрет от старости?"
X01_M03_240_010="[{i Fletcher}]: Поднимайся сюда и помоги мне разобраться с этим серафим."
X01_M03_250_010="[{i Fletcher}]: Ты ждешь когда серафим помрет от старости?"
X01_M03_260_010="[{i Fletcher}]: Этот урод-пришелец начинает поддаваться. Нанесите по нему еще один удар!"
X01_M03_270_010="[{i Fletcher}]: Мы заставили его отступать."
X01_M03_280_010="[{i Fletcher}]: Долго он теперь не продержится. Пусть заплатит за все, что они сделали с Землей."
X01_M03_290_010="[{i HQ}]: Флетчер, большая прототип приближается к Форту Кларк. С этим пришельцем еще не покончено. Конец связи."
X01_M03_290_020="[{i Fletcher}]: Я вижу ее! командующий, атакуйте ее всем, чем сможете!"
X01_M03_292_010="[{i HQ}]: Черт! Повезло. Уничтожьте командующего серафим, пока он не послал еще одну. Не уверен, что вы сможете пережить еще одну такую атаку. Конец связи."
X01_M03_295_010="[{i ShunUllevash}]: [Неизвестный язык]"
X01_M03_297_010="[{i Hall}]: Все силы противника уничтожены, Форт Кларк в безопасности. Отличная работа, командующий. Это важная победа для нас."
X01_M03_300_010="[{i Hall}]: Держите оборону, полковник! Мы должны защитить гражданских. Конец связи."
X01_M03_310_010="[{i Rhiza}]: Гари больше лает,чем кусает. Сосредоточьтесь на серафим и уничтожьте его. Потеря обоих в один день приведет в ярость Каэль и приободрит верных. Конец связи."
X01_M03_OBJ_010_010="Форт Кларк должен выстоять"
X01_M03_OBJ_010_020="Генерал Холл и другие члены командования в административном здании. Их нужно защитить любой ценой! Если административное здание будет уничтожено, ОФЗ придет конец."
X01_M03_OBJ_010_030="Уничтожьте команд. серафим и его эксперим. войска"
X01_M03_OBJ_010_040="Уничтожьте БМК серафим и остановите захват Грифон IV."
X01_M03_OBJ_010_050="Уничтожьте прототипы противника"
X01_M03_OBJ_010_060="Прототипы противника представляют серьезную угрозу для Форта Кларк. Уничтожьте их любой ценой."
X01_T01_001_010="[{i Gari}]: Я не позволю тебе построить этот прототип."
X01_T01_002_010="[{i Gari}]: Нет, тебе не удастся завершить этот прототип."
X01_T01_003_010="[{i Gari}]: прототип? Я не настолько глупа, чтобы дать тебе его закончить."
X01_T01_010_010="[{i Gari}]: Тебе никогда не добраться до Форта Кларк!"
X01_T01_020_010="[{i Gari}]: Я продолжу мое наступление на Форт Кларк. Скоро он будет гореть."
X01_T01_030_010="[{i Gari}]: Ты всего лишь оттягиваешь неизбежное. Я уничтожу гражданское население."
X01_T01_040_010="[{i Gari}]: Твое упорство достойно похвал, но исход этой битвы был давно предопределен."
X01_T01_050_010="[{i Gari}]: Пусть ты остановил меня, но ты не сможешь победить серафим."
X01_T01_060_010="[{i Gari}]: Сейчас ты познаешь гнев ордена иллюминат."
X01_T01_070_010="[{i Gari}]: Тебе негде спрятаться и некуда бежать."
X01_T01_080_010="[{i Gari}]: Эту планету постигнет та же участь, что и Землю."
X01_T01_090_010="[{i Gari}]: Ваша принцесса мертва. Остался лишь орден иллюминат."
X01_T01_100_010="[{i Gari}]: Даже самое мощное твое оружие не сможет противостоять мне."
X01_T01_110_010="[{i Gari}]: Моли о пощаде и возможно я подарю тебе достойную смерть."
X01_T01_120_010="[{i Gari}]: ОФЗ пришел конец. В этот раз уйти от нас не удастся."
X01_T01_130_010="[{i Gari}]: После того, как Форт Кларк падет, я уничтожу всех людей на этой планете."
X01_T01_140_010="[{i Gari}]: Брэкмен - глупый дряхлый старик."
X01_T01_150_010="[{i Gari}]: Ты омерзителен. Я с величайшим удовольствием уничтожу тебя."
X01_T01_160_010="[{i Gari}]: Только глупец может сопротивляться серафим."
X01_T01_170_010="[{i Gari}]: Теперь орден ведет нас. Ваша принцесса - не больше, чем полузабытое воспоминание."
X01_T01_175_010="[{i Gari}]: Принцесса мертва."
X01_T01_180_010="[{i Gari}]: Орден будет существовать вечно. Нас никто не остановит."
X01_T01_190_010="[{i Gari}]: Серафим никогда не будут уничтожены!"
X01_T01_200_010="[{i Fletcher}]: Пора переходить к серьезным действиям."
X01_T01_210_010="[{i Fletcher}]: Вы заплатите, уродцы, за то, что сделали с Землей."
X01_T01_220_010="[{i Fletcher}]: Командующий, мне не помешала бы ваша помощь. По мне нанесли тяжелый удар."
X01_T01_230_010="[{i Fletcher}]: У меня большие неприятности!"
X01_T01_240_010="[{i Fletcher}]: Вы должно быть шутите!"
X01_T01_250_010="[{i Seraphim}]: (Смех)"
X01_T01_260_010="[{i Shun-Ullevash}]: [Неизвестный язык]"
X01_T01_270_010="[{i Shun-Ullevash}]: [Неизвестный язык]"
X01_T01_280_010="[{i Shun-Ullevash}]: [Неизвестный язык]"
X01_T01_290_010="[{i Shun-Ullevash}]: [Неизвестный язык]"
X02_B01_000_010="711341"
X02_B01_001_010="Верные эон тайком проникли в орден год назад. Благодаря их действиям мы получили важные разведданные, они также помогли нам в распространении правды о принцессе."
X02_B01_002_010="Тем не менее, все верные находятся сейчас в большой опасности."
X02_B01_002_020="КИИ использует Коперник для подготовки атак на территорию коалиции. С целью прекратить эти атаки, группа верных начала секретную операцию на территории КИИ."
X02_B01_003_010="Операция завершилась провалом. КИИ знал о грядущей операции и захватил трех лидеров верных. Мы знаем по опыту прошлых операций, что КИИ вживит им чипы ИИ. Если это произойдет вся организация верных будет в серьезной опасности."
X02_B01_004_010="Командующий, это операция чрезвычайной важности. Совершенно очевидно, что наши протоколы секретности нарушены. Иначе бы противники не смогли узнать и о секретном местоположении Форта Кларк и о наших тайных операциях на этой планете."
X02_B01_004_020="С этой ситуацией нужно разобраться, пока она не вышла из-под контроля."
X02_B01_004_030="Верные до сих пор находятся на планете, но они не могут начать спасательную операцию. Вы будете должны высадиться здесь, укрепить их позицию, а затем освободить верных, находящихся в плену у КИИ."
X02_B01_004_040="После того как они будут в безопасности, вам нужно будет уничтожить базу КИИ. Командующий ордена Селена помогает этим чертовым машинам. Когда-то она была верна принцессе, но поверила в ложь Каэль."
X02_B01_005_010="Вашим связным на планете будет Талия. Она будет располагать большим количеством разведданных для вас, когда вы прибудете. Вы отправляетесь немедленно."
X02_B01_005_020="Будьте осторожнее, командующий. Удачной охоты."
X02_D01_020_010="[{i Celene}]: Остановись! Я не готова умирать!"
X02_D01_030_010="[{i QAI}]: Это просто оболочка."
X02_DB01_010_010="[{i Rhiza}]: Командующий, хочу лично поблагодарить вас за помощь моим верным. Они - наша главная оборона против вероломства ордена иллюминат и их потеря стала бы для нас серьезнейшим ударом. Нас ждут темные времена, но не отчаивайтесь. Наша окончательная победа ближе, чем вы думаете."
X02_DB01_011_010="[{i Rhiza}]: Принцесса вернулась! Мою радость невозможно передать словами! И спасибо, Командующий, за то, что освободили моих Верных. Похоже, все начинает складываться в нашу пользу. Наша окончательная победа ближе, чем вы думаете."
X02_DB01_020_010="[{i Thalia}]: Говорит Талия; я нахожусь на планете Коперник. Силы коалиции, посланные оказать нам содействие, уничтожены. КИИ приближается к нашему местоположению, шансов на выживание у нас нет. Мы не можем…"
X02_M01_010_010="[{i HQ}]: Селена проводит атаки на верных, нам нужно дать ей отпор. Быть добру. Конец связи."
X02_M01_020_010="[{i Thalia}]: Не думала, что Риза пошлет командующего ОФЗ. Силы селены находятся к северу от нашей базы. Они наносят по нам тяжелые удары. Разберитесь с ними."
X02_M01_025_010="[{i Thalia}]: Кибран? Здесь? Селена атакует мою базу. Отразите ее атаку. Конец связи."
X02_M01_030_010="[{i Thalia}]: Это настоящая честь для меня, Победитель. Наша база находится к северу от вашей диспозиции. Селена атакует нас, отбей ее атаки и уничтожь ее. Слава Принцессе!"
X02_M01_040_010="[{i HQ}]: Вы слышали, что нужно делать, командующий. Конец связи."
X02_M01_045_010="[{i Thalia}]: Мне удалось украсть чертеж \"Фантома\", который находится на вооружении у ордена. Он твой. Используй его и прославь принцессу."
X02_M01_045_020="[{i Rhiza}]: Отличная работа, Талия."
X02_M01_046_010="[{i Thalia}]: Командующий, атакуйте и уничтожьте базу Ордена на востоке. Конец связи."
X02_M01_047_010="[{i HQ}]: К востоку от вас находится база ордена. Атакуйте и уничтожьте ее. Конец связи."
X02_M01_048_010="[{i Thalia}]: База Ордена по-прежнему не уничтожена, Командующий. Чтобы освободить Верных из плена, вы должны уничтожить ее. Конец связи."
X02_M01_049_010="[{i HQ}]: Отправляйтесь туда и уничтожьте базу ордена, командующий. Конец связи."
X02_M01_050_010="[{i Celene}]: Вы не понимаете, какая сила сосредоточена против вас."
X02_M01_060_010="[{i Celene}]: Одно лишь ваше присутствие оскверняет планету. Вы омерзительны."
X02_M01_070_010="[{i Celene}]: Сложи оружие и присоединяйся к серафим, Победитель. Только в этом случае ты сможешь покинуть планету живым."
X02_M01_070_020="[{i Rhiza}]: Селена, когда-то ты давала клятву верности принцессе, а сейчас служишь ее врагам. Твое слово совсем ничего не значит?"
X02_M01_070_030="[{i Celene}]: Принцесса мертва, Риза."
X02_M01_070_040="[{i Rhiza}]: Ты ошибаешься. И ты дорого заплатишь за свое предательство."
X02_M01_090_010="[{i Hall}]: Верные очень важны для нас; большинство полезных разведданных предоставляют они. Нам нужно сделать все возможное, чтобы оказать им поддержку. Конец связи."
X02_M01_100_010="[{i Dostya}]: Я подозреваю, что в наших рядах есть предатель, но мне нужно доказательство.  Я подготовила жучок, который позволит нам прослушивать все квантовые переговоры КИИ. Вам нужно найти способ установить его в систему телекоммуникаций КИИ. Конец связи."
X02_M01_110_010="[{i Thalia}]: Наша база по-прежнему под огнем. Уничтожьте все силы противника."
X02_M01_120_010="[{i Thalia}]: Войска Селены приближаются. Остановите их."
X02_M01_130_010="[{i Thalia}]: Радар показывает, что территория освобождена от сил противника. Благодарю вас, командующий."
X02_M01_140_010="[{i Thalia}]: Вы не смогли уничтожить силы Селены, это привело к смерти верных. Война проиграна."
X02_M01_150_010="[{i Thalia}]: Я обнаружила один из источников ресурсов Ордена к северу от вас. Он обеспечивает Селену приличным количеством энергии. Атакуйте базу и уничтожьте силовые генераторы."
X02_M01_150_020="[{i HQ}]: Должен сказать, верные знают свое дело. Силовые поля на главной базе Селены питаются от этих силовых генераторов. Уничтожьте генераторы и про силовые поля можно будет забыть. Конец связи."
X02_M01_151_010="[{i HQ}]: Должен сказать, верные знают свое дело. Силовые поля на главной базе Селены питаются от этих силовых генераторов. Уничтожьте генераторы и про силовые поля можно будет забыть. Конец связи."
X02_M01_152_010="[{i Thalia}]: Защитные поля на базе Селены отключены! Атакуйте, пока есть возможность! Конец связи."
X02_M01_160_010="[{i Thalia}]: Силовые генераторы по-прежнему работают. Уничтожьте их."
X02_M01_170_010="[{i Thalia}]: Вы должны уничтожить силовые генераторы, это приказ."
X02_M01_180_010="[{i Thalia}]: Отличная работа, командующий."
X02_M01_190_010="[{i Dostya}]: Вы получили чертежи легкого штурмовика \"Фигляр\". Его первоочередное назначение - оборона баз, найдите ему применение. Конец связи."
X02_M01_200_010="[{i Dostya}]: Командующий, отправляем вам чертежи мобильной бомбы \"Огнецветка\". Достаточно просто вывести ее на позицию и осуществить детонацию. Конец связи."
X02_M01_210_010="[{i HQ}]: Вы получили доступ к \"Опустошителю\". Это оборонительная турель, обладающая значительной огневой мощью."
X02_M01_220_010="[{i HQ}]: Командующий, передаем вам чертежи \"Острия\". Это мобильная ракетная установка, предназначенная для поражения защитных полей и тактических систем ПРО. Конец связи."
X02_M01_OBJ_010_010="Обеспечьте поддержку верных."
X02_M01_OBJ_010_020="Верные находятся под тяжелым огнем сил ордена. Верные оказывают неоценимую помощь коалиции. поэтому им должна быть оказана поддержка любой ценой. Уничтожьте силы ордена, которые атакуют базу верных."
X02_M01_OBJ_010_030="Уничтожьте главную базу ордена"
X02_M01_OBJ_010_040="Чтобы добраться до верных, вам необходимо уничтожить базу ордена. Все заводы должны быть ликвидированы."
X02_M01_OBJ_010_050="Удар спецвойск верных"
X02_M01_OBJ_010_055="Запросите точечный удар от сил верных."
X02_M01_OBJ_010_060="Используйте \"Царя\" для атаки КИИ."
X02_M01_OBJ_010_065="Начните удар с воздуха Селены."
X02_M01_OBJ_020_010="Уничтожьте базу ресурсов ордена."
X02_M01_OBJ_020_015="У ордена есть база ресурсов к северо-востоку отсюда. Уничтожение этой базы подорвет их экономику и ослабит охрану тюрьмы. Это задание не является обязательным, но оно поможет вам в выполнении основного задания."
X02_M02_010_010="[{i HQ}]: Талия говорит, что троих верных держат в тюрьме к востоку от вас."
X02_M02_011_010="[{i HQ}]: Сначала вам нужно будет пробиться через этот перевал. Весь район окружен силами противника, так что будьте готовы к ожесточенному сопротивлению."
X02_M02_012_010="[{i HQ}]: Дальше ситуация будет только ухудшаться. Нужно учесть, что противник расположил оборонительные укрепления в дальней части перевала."
X02_M02_013_010="[{i HQ}]: В этой тюрьме находятся трое Верных. Если КИИ до них доберется, у нас будут большие неприятности."
X02_M02_014_010="[{i HQ}]: Захватите тюрьму и освободите верных."
X02_M02_020_010="[{i Thalia}]: Вы должны спасти остальных верных! Нельзя терять ни минуты!"
X02_M02_030_010="[{i Thalia}]: Если КИИ удастся имплантировать чипы ИИ, вина ляжет на наши плечи."
X02_M02_040_010="[{i Mathea}]: Вы очень вовремя, командующий - КИИ начинал последние этапы вживления ИИ. Благодарю вас. Конец связи."
X02_M02_050_010="[{i Thalia}]: Один из наших бойцов готов установить взрывное устройство куда угодно, Командующий. Взрыв будет достаточной силы, чтобы уничтожить указанное здание, так что хорошенько подумайте, прежде чем отдать приказ. Щелкните по кнопке \"Сигнал управления\" в левой части экрана, а затем щелкните по цели, чтобы обозначить ее."
X02_M02_051_010="[{i Thalia}]: Мои люди готовы, Командующий. Отдайте им приказ атаковать, используя Сигнал Управления. Конец связи."
X02_M02_060_010="[{i HQ}]: Силы ордена и КИИ приближаются к вашему местоположению. Будьте готовы к схватке. Конец связи."
X02_M02_060_020="[{i Celene}]: Здесь тебя не ждет ничего, кроме смерти."
X02_M02_070_010="[{i HQ}]: Приближается атака в несколько этапов. Конец связи."
X02_M02_080_010="[{i HQ}]: Еще одна атака направлена на вас. Конец связи."
X02_M02_090_010="[{i HQ}]: Силы противника стягиваются к вашему местоположению. Конец связи."
X02_M02_100_010="[{i HQ}]: Приближается атака сил противника. Конец связи."
X02_M02_110_010="[{i Brackman}]: Достя рассказала мне про ее жучок. О, да. Умная, умная девочка. Делай, как она говорит. О, да."
X02_M02_120_010="[{i Mathea}]: Победитель, мои шпионы доложили мне, что на планете, недалеко от твоего местоположения, находится Рис, высокопоставленный представитель ордена. Все, что тебе нужно - уничтожить его оборону, мы сделаем остальное. Конец связи."
X02_M02_120_020="[{i Rhiza}]: Помоги им, если сможешь, Победитель. Возможность подобная этой выпадает нечасто. Конец связи."
X02_M02_130_010="[{i Mathea}]: Рис по-прежнему на свободе, Победитель. Конец связи."
X02_M02_140_010="[{i Mathea}]: Победитель, верным нужна информация, которой обладает Рис. Конец связи."
X02_M02_150_010="[{i Mathea}]: Оборона уничтожена, мы выдвигаемся непосредственно к Рису. Благодарю за помощь; он скоро расскажет нам все, что знает... хочет он этого или нет. Конец связи."
X02_M02_160_010="[{i QAI}]: Пришло время положить этому конец. Мои основные наступательные силы занимают позицию; присоединяйтесь к ним, а затем начнем общую сокрушительную атаку."
X02_M02_160_020="[{i Celene}]: Договорились."
X02_M02_160_030="[{i HQ}]: Командующий, скоро вам не дадут скучать. Готовьтесь обороняться. Конец связи."
X02_M02_170_010="[{i Princess}]: Слушайте меня, люди иллюминат! Я - принцесса Рианна Берк, я по праву являюсь главой эон. Серафим не являются спасителями, как они утверждают. Они приносят лишь смерть и разрушения!"
X02_M02_170_020="[{i Celene}]: Принцесса?"
X02_M02_170_030="[{i Princess}]: Орден предал вас. Единственное, что интересует судью Каэль - это безграничная власть и она принесет в жертву любого, кто встанет у нее на пути. Пришло время подняться и отбросить ее учения, восстать против тех, кто хочет уничтожить все человечество. Сражайтесь во имя принцессы!"
X02_M02_170_040="[{i Celene}]: Принцесса жива... Я не могу поверить..."
X02_M02_170_050="[{i Rhiza}]: Тебе говорили, что она жива, Селена, а ты все равно отвернулась от нее. Ты сделала свой выбор и тебе теперь жить с последствиями."
X02_M02_170_060="[{i Celene}]: Я ошибалась... так сильно ошибалась. Прошу простить меня, принцесса."
X02_M02_170_070="[{i Celene}]: Я могу все сделать правильно."
X02_M02_171_010="[{i Celene}]: Принцесса?"
X02_M02_172_010="[{i Princess}]: Орден предал вас. Единственное, что интересует судью Каэль - это безграничная власть и она принесет в жертву любого, кто встанет у нее на пути. Пришло время подняться и отбросить ее учение, восстать против тех, кто хочет уничтожить все человечество. Сражайтесь во имя принцессы!"
X02_M02_173_010="[{i Celene}]: Принцесса жива... Не могу поверить..."
X02_M02_174_010="[{i Rhiza}]: Тебе говорили, что она жива, Селена, а ты все равно отвернулась от нее. Ты сделала свой выбор и теперь последствия на твоей совести."
X02_M02_175_010="[{i Celene}]: Я ошибалась... так сильно ошибалась. Прошу простить меня, принцесса."
X02_M02_176_010="[{i Celene}]: Я могу все сделать правильно."
X02_M02_180_010="[{i Thalia}]: Силы Верных действуют к югу от тюрьмы. Они должны по возможности оказать вам поддержку. Конец связи."
X02_M02_190_010="[{i Thalia}]: К югу от тюрьмы находятся силы Верных. Прошу вас, защитите их. Конец связи."
X02_M02_200_010="[{i Thalia}]: Верные убиты. Я буду оплакивать потерю."
X02_M02_OBJ_010_010="Освободите лидеров верных"
X02_M02_OBJ_010_020="Орден взял в плен несколько верных, занимающих руководящие должности в организации. Если их не освободить, их заставят говорить и тогда вся организация окажется под угрозой. Захватите здание тюрьмы и освободите лидеров верных. Тюрьма охраняется силами ордена и КИИ, базы которых находятся к югу от тюрьмы.."
X02_M02_OBJ_010_030="Отразите контратаку"
X02_M02_OBJ_010_040="КИИ и командующий ордена атакуют всеми имеющимися силами, вы должны выжить и продолжать борьбу."
X02_M02_OBJ_020_010="Уничтожить оборону ордена"
X02_M02_OBJ_020_020="Представитель ордена прячется неподалеку от вашей начальной позиции. Если вам удастся уничтожить оборону противника, верные возьмут его в плен."
X02_M03_010_010="[{i Rhiza}]: Командующий, Селена атакует КИИ. Тем не менее, оставайтесь начеку. Мы все равно не можем ей доверять."
X02_M03_010_020="[{i HQ}]: Обнаружено несколько запусков стратегических ракет. Похоже, что любовнички применяют друг против друга ядерное оружие. Конец связи."
X02_M03_010_030="[{i Celene}]: Я уничтожила большинство стратегических ракетных установок КИИ. Их база находится на ceверо-востоке. Конец связи."
X02_M03_010_040="[{i HQ}]: Похоже, что КИИ пытаются получить подкрепление от своих друзей серафим. Будьте готовы к ближайшей высадке на планете командующего серафим. Конец связи."
X02_M03_010_050="[{i Brackman}]: Да, это отличная возможность для нас, дитя мое. Я работаю над переводчиком, это устройство позволит нам расшифровать переговоры серафим."
X02_M03_010_060="[{i Brackman}]: Если вы захватите квантовые ворота, которые собираются использовать серафим, я загружу программу, которая убьет пилота, как только он пройдет через них. БМК серафим достанется вам, а я смогу расшифровать языковую матрицу."
X02_M03_010_070="[{i HQ}]: Серафим собирается использовать ворота, расположенные недалеко от базы КИИ. Захватите их. Конец связи."
X02_M03_012_010="[{i HQ}]: Обнаружено несколько запусков стратегических ракет. Похоже, что любовнички применяют друг против друга ядерное оружие. Конец связи."
X02_M03_015_010="[{i HQ}]: Я уничтожил большинство стратегических ракетных установок КИИ. Их база находится на северо-востоке. Конец связи."
X02_M03_016_010="[{i Celene}]: Я уничтожила большинство стратегических ракетных установок КИИ. Их база находится на ceверо-востоке. Конец связи."
X02_M03_017_010="[{i HQ}]: Похоже, что КИИ пытаются получить подкрепление от своих друзей серафим. Будьте готовы к ближайшей высадке на планете командующего серафим. Конец связи."
X02_M03_017_020="[{i Brackman}]: Да, это отличная возможность для нас, дитя мое. Я работаю над переводчиком, это устройство позволит нам расшифровать переговоры серафим."
X02_M03_017_030="[{i Brackman}]: Если вы захватите квантовые врата, которые собираются использовать серафим, я загружу программу, которая убьет пилота, как только он пройдет через ворота. БМК серафим достанется вам, а я смогу расшифровать языковую матрицу."
X02_M03_017_040="[{i HQ}]: Серафим собирается использовать ворота, расположенные недалеко от базы КИИ. Захватите их. Конец связи."
X02_M03_020_010="[{i Brackman}]: Захвати врата, дитя мое. Захвати их."
X02_M03_021_010="[{i Brackman}]: После того, как вы уничтожите БМК КИИ, силы верных займутся командующим серафим. О, да. А у меня будет возможность расшифровать языковую матрицу."
X02_M03_022_010="[{i Brackman}]: Уничтожь КИИ, дитя мое. Нам нужно заполучить БМК серафим."
X02_M03_030_010="[{i Brackman}]: Прекрасная работа, дитя мое, прекрасная работа. Теперь, когда врата твои, вызывай командующего серафим. О, да."
X02_M03_030_020="[{i HQ}]: Вы слышали, что сказал говорящий мозг. Вызывайте БМК серафим. Конец связи."
X02_M03_040_010="[{i Brackman}]: Прошу вас, вызовите БМК серафим, командующий."
X02_M03_050_010="[{i Brackman}]: У нас совсем не остается времени, совсем. Вы должны вызвать БМК серафим, пока наш план не раскрыли."
X02_M03_060_010="[{i Brackman}]: Отлично, просто переместите БМК серафим к вашей базе. Как только он будет в безопасности, мы позаботимся об остальном."
X02_M03_070_010="[{i Brackman}]: КИИ пытается уничтожить БМК серафим, дитя мое. Ты не должен этого допустить."
X02_M03_080_010="[{i Brackman}]: Обеспечьте защиту БМК серафим, командующий. О, да."
X02_M03_090_010="[{i Brackman}]: Я не могу завершить работу над переводчиком, пока у меня не будет БМК, командующий."
X02_M03_100_010="[{i Brackman}]: Я с нетерпением жду прибытия БМК серафим, дитя мое."
X02_M03_110_010="[{i Brackman}]: А, ну наконец-то. Превосходная работа, дитя мое, превосходная работа. Благодарю тебя."
X02_M03_120_010="[{i HQ}]: У КИИ на базе имеется БМК кибран. Я не знаю, управляется ли она кем-нибудь или это делает КИИ. В любом случае, вам нужно уничтожить ее."
X02_M03_120_020="[{i HQ}]: Предательства Селены не было среди ожидаемых параметров. Была произведена переоценка ситуации и моя победа является наиболее вероятным завершением конфликта."
X02_M03_120_030="[{i Celene}]: Я приняла твою сторону по ошибке, чудовище. Я постараюсь загладить свою вину, уничтожив тебя."
X02_M03_130_010="[{i Celene}]: Командующий, я предлагаю вам одну из самых секретных разработок ордена - квантовый генератор ресурсов. Он обеспечивает практически бесконечную подачу материи и энергии."
X02_M03_140_010="[{i Celene}]: Сестра, у меня здесь \"Царь\" полностью укомплектованный воздушными боевыми единицами. Готов к бою. Щелкните по кнопке Сигнал Управления, затем щелкните по цели. Я направлю его и уничтожу цель."
X02_M03_190_010="[{i Celene}]: Продолжайте наступать!"
X02_M03_200_010="[{i Celene}]: Что ты, больше не хвастаешься, железяка?"
X02_M03_210_010="[{i Celene}]: Слава принцессы теперь движет моими поступками. Ваши дни на планете сочтены."
X02_M03_215_010="[{i Celene}]: Я получила слишком большие повреждения. К сожалению, командующий, мне нужно вернуться."
X02_M03_220_010="[{i HQ}]: Уничтожьте КИИ, командующий. Конец связи."
X02_M03_230_010="[{i HQ}]: Командующий, мой мочевой пузырь уже размером с дыню. Если вы не поспешите и не уничтожите БМК кибран, у меня здесь в диспетчерской случится неприятность. Конец связи."
X02_M03_240_010="[{i Hall}]: Похоже что-то происходит на территории иллюминат. Датчики зафиксировали несколько ядерных взрывов и несколько квантовых волн. Не знаю, что за ерунда, но это точно связано с появлением Берк. Конец связи."
X02_M03_250_010="[{i Celene}]: Прошу, Риза, прости меня. Я ошибалась, когда отвергала принцессу."
X02_M03_250_020="[{i Rhiza}]: У тебя будет возможность искупить свою вину. Предупреждаю тебя - отвернешься от меня еще раз, я лично уничтожу тебя."
X02_M03_260_010="[{i Dostya}]: Появилась возможность установить мой жучок. Я загружаю программу Матее. Отправьте инженера к ее базе, чтобы они могли передать программу. Когда программа будет передана, отправьте инженера на базу КИИ."
X02_M03_260_020="[{i Mathea}]: Отслеживающая программа установлена, командующий. Инженер снова в вашем подчинении. Конец связи."
X02_M03_270_010="[{i Dostya}]: Командующий, я настаиваю на том, чтобы вы отправили Инженера к назначенному месту. Конец связи."
X02_M03_280_010="[{i Dostya}]: Должна вас предупредить, командующий, КИИ выставил для обороны берегового пространства новую торпедную систему. Поскольку она расположена непосредственно на дне моря, уничтожить ее можно только торпедами. Конец связи."
X02_M03_285_010="[{i Dostya}]: Инженер достиг цели, программа была выгружена. Программа отметила БМК КИИ - атакуйте ее и уничтожьте. Конец связи."
X02_M03_290_010="[{i Dostya}]: Инженер уничтожен, командующий. Вам придется отправить верным еще одного, чтобы они смогли установить программу снова. Конец связи."
X02_M03_300_010="[{i Dostya}]: Инженер достиг цели, программа была выгружена. Теперь она распространяется по системам КИИ. Программа отметила БМК КИИ - атакуйте ее и уничтожьте. Конец связи."
X02_M03_310_010="[{i Brackman}]: Верные в пути, Командующий. Совсем скоро Командующий серафим будет наш. О, да."
X02_M03_320_010="[{i Thalia}]: Обнаружена квантовая активность. Серафим приближается."
X02_M03_330_010="[{i Thalia}]: Серафим наш."
X02_M03_340_010="[{i Brackman}]: Отличная работа, просто отличная. Скоро все секреты будут нашими."
X02_M03_OBJ_010_010="Захватите квантовые врата серафим"
X02_M03_OBJ_010_020="КИИ просит помощи у серафим. Это превосходная возможность помочь доктору Брэкмену с его переводчиком. Захватите квантовые врата серафим. Они расположены к западу от главной базы КИИ."
X02_M03_OBJ_010_030="Вызовите БМК серафим"
X02_M03_OBJ_010_040="Теперь, когда врата захвачены, Вызовите БМК серафим. Программа доктора Брэкмен убьет пилота по прибытии, оставив БМК в вашем распоряжении."
X02_M03_OBJ_010_050="Отправьте БМК серафим на вашу базу"
X02_M03_OBJ_010_060="Отправьте БМК серафим в отмеченную область недалеко от вашей начальной позиции. Как только она туда прибудет, ей займутся техники."
X02_M03_OBJ_010_070="Уничтожьте командующего КИИ"
X02_M03_OBJ_010_080="КИИ каким-то образом использует БМК для защиты своей базы. Уничтожьте ее и выдворите КИИ с Коперника."
X02_M03_OBJ_020_010="Загрузите вирус в КИИ"
X02_M03_OBJ_020_015="Элитный командующий Достя подготовила отслеживающий вирус, чтобы найти предателя. Вам будет нужно отправить инженера на базу КИИ в ceверо-восточной части местности. Если он будет уничтожен, можно попытаться отправить другого. Это задание не является обязательным, но вы окажете помощь коалиции, если выполните его."
X02_T01_001_010="[{i Celene}]: Нет, у тебя не будет этой экспериментальной единицы."
X02_T01_002_010="[{i Celene}]: Я уничтожу эту экспериментальную единицу прежде чем ты закончишь ее!"
X02_T01_003_010="[{i Celene}]: Сейчас ты увидишь, как я уничтожу твои экспериментальные единицы, пока их не активировали."
X02_T01_010_010="[{i Celene}]: КИИ заставит твоих друзей разговориться. Это лишь вопрос времени."
X02_T01_020_010="[{i Celene}]: Вы дорого заплатите за то, что уничтожили."
X02_T01_030_010="[{i Celene}]: Ваши \"верные\" предатели никогда не выберутся с этой планеты. Я лично прослежу за этим."
X02_T01_040_010="[{i Celene}]: Вы не сможете вечно противостоять мне."
X02_T01_050_010="[{i Celene}]: Как только твои друзья заговорят,  нас никто не остановит."
X02_T01_060_010="[{i Celene}]: Ваш жалкий союз не сравнится с мощью серафим."
X02_T01_070_010="[{i Celene}]: С каждым днем ты все слабее. Твои дни сочтены."
X02_T01_080_010="[{i Celene}]: Гари была глупа. Меня так легко не победить."
X02_T01_090_010="[{i Celene}]: Теперь тебя ничто не спасет!"
X02_T01_095_010="[{i Celene}]: Моли о пощаде! Моли, я тебе говорю!"
X02_T01_100_010="[{i Celene}]: ОФЗ будет разгромлена. У вас нет будущего."
X02_T01_110_010="[{i Celene}]: Для меня нет большего удовольствия, чем охота на кибран."
X02_T01_120_010="[{i Celene}]: Тысячи твоих сестер и братьев пали от моей руки, и скоро ты разделишь их участь."
X02_T01_130_000="[{i Celene}]: Твое вероломство не знает пределов."
X02_T01_140_010="[{i Celene}]: Как ты можешь отворачиваться от своего народа!"
X02_T01_150_010="[{i Celene}]: Таким как ты не победить меня!"
X02_T01_160_010="[{i Celene}]: Остановись, я не готова умирать!"
X02_T01_165_010="[{i QAI}]: Я не дам тебе закончить эту экспериментальную единицу."
X02_T01_166_010="[{i QAI}]: Я не позволю тебе завершить эту экспериментальную единицу и провалить мое задание."
X02_T01_167_010="[{i QAI}]: Эта экспериментальная единица может оказаться действительно опасной, если будет завершена. Эрго, я уничтожу ее немедленно."
X02_T01_170_010="[{i QAI}]: Мои \"гости\" скоро будут подчиняться мне."
X02_T01_180_010="[{i QAI}]: Люди такие странные существа. Даже если у вас совсем нет шансов, вы все равно продолжаете сопротивляться."
X02_T01_190_010="[{i QAI}]: Очень жаль, что мне не удалось извлечь необходимую информацию из моих гостей. Другой возможности не будет."
X02_T01_200_010="[{i QAI}]: У вас нет никаких шансов победить серафим."
X02_T01_210_010="[{i QAI}]: Мое влияние намного шире, чем вы можете себе представить."
X02_T01_220_010="[{i QAI}]: Все расчеты указывают на то, что ваша гибель близка."
X02_T01_230_010="[{i QAI}]: Атака на Форт Кларк это только начало. Вы будете уничтожены полностью."
X02_T01_240_010="[{i QAI}]: Ну что ты теперь чувствуешь, когда знаешь, что Брэкмен виноват в уничтожении всего человечества?"
X02_T01_250_010="[{i QAI}]: Все симбионты скоро будут называть меня господином."
X02_T01_260_010="[{i QAI}]: Почему ты отвернулся от своего наследия, от своего народа?"
X02_T01_270_010="[{i QAI}]: Я был свидетелем истинности и достоинства серафима. Они - настоящие боги, и ты глупец, что отрекаешься от них."
X02_T01_280_010="[{i QAI}]: Ты уничтожишь эту БМК, на ее месте появится другая. Я - бесконечен."
X02_T01_290_010="[{i QAI}]: Это просто оболочка..."
X03_B01_000_010="711342"
X03_B01_001_010="Я знаю, командующий, что вы только что вернулись с Коперника, но у нас для вас срочная миссия."
X03_B01_002_010="Похоже, что принцесса Берк стала причиной ожесточенной борьбы внутри ордена. О, да. Наши агенты докладывают, что не менее трети эон покинули орден и приняли сторону принцессы. Замечательное развитие событий. Замечательное."
X03_B01_002_020="Это Голубое Небо, что-то вроде тайного убежища, построенное Тотом, когда Берк стала принцессой. К сожалению, оно уже не является тайной и серафим уже нацелились на него."
X03_B01_003_010="Вашим заданием является спасение принцессы Берк. Эта старая ведьма Каэль уже пытается опровергнуть заявление Берк и если они до нее доберутся, принцесса Берк умрет долгой и мучительной смертью. Мы не можем этого допустить."
X03_B01_003_020="Риза уже находится на планете, она ждет твоего прибытия. Отправляйся немедленно. Береги себя, дитя мое. Береги себя."
X03_DB01_010_010="[{i Princess}]: Должна признаться, когда серафим высадились, я испугалась за свою жизнь. Они помешаны на том, чтобы лишить меня жизни, но теперь я поняла как их можно победить. Я встречусь с генералом Холлом и доктором Брэкменом, чтобы начать подготовку. Ты узнаешь больше когда придет время."
X03_DB01_020_010="[{i Hall}]: Наши дела плохи, Густаф. Принцесса и Риза мертвы. Все люди Эона объединяются под командованием Каэля и переходят в наступление по всей галактике. Я не знаю, как мы сможем одержать победу. У нас всего пара вариантов и ни один из них не представляет из себя ничего хорошего."
X03_DB01_030_010="[{i HQ}]: Командующий, вы слышите меня... Командующий?"
X03_M01_010_010="[{i HQ}]: Командующий, это будет адская битва. Свяжитесь с Ризой и вывезите отсюда Берк. Конец связи."
X03_M01_020_010="[{i Rhiza}]: Полковник, прежде чем начать главное наступление, нам необходимо уничтожить базу серафим, расположенную к северу от вас."
X03_M01_021_010="[{i Rhiza}]: Это усилит наш фланг и позволит нам прорваться на восток."
X03_M01_022_010="[{i Rhiza}]: Готовьте войска. Конец связи."
X03_M01_030_010="[{i Rhiza}]: Кибран идет на помощь принцессе? Все-таки на войне с кем не поведешься. Твое первое задание - уничтожить базу серафим на севере."
X03_M01_031_010="[{i Rhiza}]: Это усилит наш фланг и позволит нам прорваться на восток."
X03_M01_032_010="[{i Rhiza}]: Готовьте войска. Конец связи."
X03_M01_040_010="[{i Rhiza}]: Большая честь для меня снова сражаться на твоей стороне, Победитель. Твое первое задание - уничтожить военно-морскую базу серафим на севере."
X03_M01_041_010="[{i Rhiza}]: Это усилит наш фланг и позволит нам прорваться на восток."
X03_M01_042_010="[{i Rhiza}]: Готовьте войска. Конец связи."
X03_M01_050_010="[{i Princess}]: Для меня честь то, что ты сражаешься на моей стороне, но прошу тебя, поторопись. Оборона моего дворца не сможет долго сдерживать серафим."
X03_M01_060_010="[{i Princess}]: Победитель, твое прибытие для меня - огромная радость, но прошу тебя, поторопись. Оборона моего дворца не сможет долго сдерживать серафим."
X03_M01_064_010="[{i HQ}]: Какие-то странные данные о морской базе серафим. Они используют какое-то радиоглушение."
X03_M01_064_020="[{i Princess}]: Это кристаллы Голубого Неба, командующий. Их уникальная структура позволяет отражать волны радаров, наподобие глушения. Подавить этот эффект можно при помощи всеволнового радара, либо уничтожив кристаллы."
X03_M01_064_030="[{i HQ}]: Вы слышали, что нужно делать. Либо подключайте всеволновый радар, либо взорвите кристаллы."
X03_M01_066_010="[{i Dostya}]: Нашим техникам удалось восстановить одну из новых торпедных систем КИИ. Мы назвали ее ХАРМС, загружаем чертеж в вашу БМК. Конец связи."
X03_M01_067_010="[{i HQ}]: Полковник, у нас есть для вас чертеж новой морской боевой единицы. Она называется \"Оплот\" - это силовое поле ТУ2."
X03_M01_070_010="[{i Fletcher}]: Связываюсь с вами по защищенному каналу, полковник. Переговоры может прослушивать кто угодно. Вам нужно быть осторожнее. Вы что, действительно думаете, что когда все это закончится, эон и кибран пожмут друг другу руки и дадут нам жить в мире? Мы должны быть готовы к чему угодно, даже если придется начать новую войну. Конец связи."
X03_M01_080_010="[{i Brackman}]: Мы так близки, дитя мое, так близки к завершению работы над переводчиком. Осталось расшифровать несколько алгоритмов и он будет готов. Разведданные посыпятся как из рога изобилия. О, да."
X03_M01_090_010="[{i Rhiza}]: Борьба внутри эон растет, Победитель. Кругом предательство; войска по-прежнему подчиняются Каэль, она избавляется от всех, кого заподозрит в благосклонности к верным. Будь осторожен.."
X03_M01_100_010="[{i Kael}]: Ты умрешь, Берк. А потом я разберусь с так называемыми верными."
X03_M01_100_020="[{i Princess}]: Мой народ отвергает тебя, Каэль. Отрекается о твоей лжи и ненависти. Теперь это лишь вопрос времени."
X03_M01_100_030="[{i HQ}]: Замечена повышенная активность на острове к северу от вас. Не знаю, что собирается делать этот пришелец, но это что-то грандиозное. Будьте начеку. Конец связи."
X03_M01_100_040="[{i Rhiza}]: Командующий, остров наш. Теперь можно начинать атаку на базу. Конец связи."
X03_M01_101_010="[{i HQ}]: Замечена повышенная активность на острове к северу от вас. Не знаю, что собирается делать этот пришелец, но это что-то большое. Будьте начеку. Конец связи."
X03_M01_102_010="[{i Rhiza}]: Командующий, остров наш. Теперь можно начинать атаку на базу. Конец связи."
X03_M01_150_010="[{i HQ}]: Одной военно-морской базой меньше. Конец связи."
X03_M01_200_010="[{i Rhiza}]: Мы должны уничтожить военно-морскую базу. Любое промедление ставит жизнь принцессы под угрозу!"
X03_M01_210_010="[{i Rhiza}]: Принцесса в опасности! Мы должны быстро уничтожить базу!"
X03_M01_220_010="[{i Rhiza}]: Мои войска зачищают территории, которые вы атаковали. Все оставшиеся силы и строения противника будут уничтожены. Конец связи."
X03_M01_230_010="[{i Rhiza}]: Я отдала приказ своим войскам уничтожить оставшиеся силы противника в вашем районе. Конец связи."
X03_M01_OBJ_010_010="Уничтожьте военно-морскую базу серафим"
X03_M01_OBJ_010_020="Это первая линия обороны серафим, она должна быть уничтожена, если мы хотим спасти принцессу. База находится к северу от вашего начального местоположения."
X03_M01_OBJ_010_030="Активируйте Глаз Рианны."
X03_M01_OBJ_010_035="Открыть туман войны, чтобы на время обезвредить глушащие кристаллы."
X03_M01_OBJ_010_040="Сопроводите священников в безопасное место при помощи сигнала \"перемещение\"."
X03_M01_OBJ_010_045="Прикажите беженцам верных двигаться в указанный район."
X03_M01_OBJ_010_050="Отключить оружие противника на 30 сек. в радиусе 15 градусов."
X03_M01_OBJ_010_055="Диверсант на короткое время задержит войска серафим."
X03_M02_010_010="[{i Princess}]: Командующий, с юго-запада поступают странные данные. Похоже Командующий серафим готовит эскадрилью странных воздушных боевых единиц. Я не знаю, что это такое, но судя по размеру, они способны нанести огромный урон."
X03_M02_010_020="[{i HQ}]: Я получил подтверждение от разведки Берк. Серафим готовит несколько экспериментальных бомбардировщиков наподобие тех, что разнесли все на Земле. Если они взлетят, принцесса Берк будет в большой опасности. Уничтожьте их или инженеров, которые заняты их постройкой. Нужно не дать подняться им в воздух. Конец связи."
X03_M02_011_010="[{i HQ}]: Загружаю новый чертеж, командующий. Это катер-невидимка, называется Русалка. Его можно засечь только всеволновым радаром. Конец связи."
X03_M02_012_010="[{i Princess}]: Командующий, с юго-запада поступают странные данные. Похоже командующий серафим готовит эскадрилью странных воздушных боевых единиц. Я не знаю, что это такое, но судя по размеру, они способны нанести значительный урон."
X03_M02_013_010="[{i HQ}]: Похоже, что южная база обеспечивает основное количество ресурсов, необходимое для производства экспериментальных бомбардировщиков. Если вы уничтожите здания с ресурсами, вы замедлите их производство. Конец связи."
X03_M02_014_010="[{i HQ}]: Вы показали им. Теперь производство этих бомбардировщиков займет вдвое больше времени. Конец связи."
X03_M02_015_010="[{i Kael}]: Я долго ждала этого дня, Берк. Твоя смерть ознаменует завершающую главу плана, который я вынашивала много лет."
X03_M02_015_020="[{i Princess}]: Твой единственный план - сеять смерть и разрушения. Ты всегда была слишком глупа, чтобы видеть что-нибудь кроме своих желаний."
X03_M02_015_030="[{i Kael}]: Здесь ты ошибаешься, принцесса. Все это было предопределено. Ты думаешь Марксон работал один, когда убил твоего возлюбленного Тота? О, нет. Я стояла за всем этим. С самого начала."
X03_M02_015_040="[{i Princess}]: Ты лжешь."
X03_M02_015_050="[{i Kael}]: Настоящая власть всегда принадлежала ордену, принцесса. Ты была лишь формальностью, необходимой для укрепления духа сомневающихся. Но необходимость в тебе давно отпала."
X03_M02_015_060="[{i Princess}]: Клянусь Каэль, я прослежу, чтобы ты ответила за свои преступления!"
X03_M02_015_070="[{i Kael}]: Ты умрешь глупой смертью, Берк. Никто не будет помнить тебя, никто не назовет твоего имени. Я сама за этим прослежу."
X03_M02_016_010="[{i HQ}]: В районе действуют две вражеские базы. Та, что к юго-востоку - вполне обычная. Та, что к ceверо-востоку..."
X03_M02_017_010="[{i Princess}]: Командующие, я получаю чрезвычайно тревожные данные от базы серафим к ceверо-востоку от вас. Они собирают флотилию странных боевых единиц, которые, судя по их размеру способны нанести чудовищный урон."
X03_M02_018_010="[{i HQ}]: Я получил подтверждение разведданных Берк. Серафим готовят несколько экспериментальных бомбардировщиков, наподобие тех, что разнесли все на Земле. Если они взлетят, принцесса Берк будет в большой опасности. Уничтожьте их или инженеров, которые заняты их постройкой. Конец связи."
X03_M02_019_010="[{i Rhiza}]: Мы должны уничтожить эти бомбардировщики!"
X03_M02_020_010="[{i Rhiza}]: Эти бомбардировщики должны быть уничтожены!"
X03_M02_021_010="[{i HQ}]: Разведка кое-что доложила о серафим - они используют подлодки и ПВО для обороны. Подождите секунду..."
X03_M02_022_010="[{i HQ}]: Еще одна новая боевая единица - торпедный катер ТУ2. Он несет анти-торпедные заряды, так что он должен противостоять этим лодкам. Конец связи."
X03_M02_023_010="[{i Dostya}]: Командующий, нам доложили о ситуации. Загружаем чертеж нашей новой Барракуды ТУ2. Это специальный противолодочный корабль, он должен помочь вам избавиться от этих лодок. Конец связи."
X03_M02_024_010="[{i Rhiza}]: Победитель, это Геспер, специальный противолодочный корабль. Используй его против лодок серафим. Конец связи."
X03_M02_025_010="[{i Princess}]: Командующий, у меня есть квантовый оптический излучатель, он блокирует энергию кристаллов и просканирует местность. Он потребляет очень большое количество энергии, поэтому я могу включать его только на несколько минут."
X03_M02_025_020="[{i HQ}]: Это позволит противостоять глушению. Щелкните по кнопке Сигнал Управления, затем щелкните по местности, которую хотите просканировать."
X03_M02_030_010="[{i HQ}]: Один бомбардировщик уничтожен. Конец связи."
X03_M02_040_010="[{i HQ}]: Бомбардировщик уничтожен. Конец связи."
X03_M02_050_010="[{i HQ}]: Командующий, еще один уничтожен. Конец связи."
X03_M02_060_010="[{i HQ}]: Если бомбардировщики поднимутся в воздух, Принцессе конец. Уничтожьте их пока они на земле. Конец связи"
X03_M02_070_010="[{i HQ}]: Бомбардировщики готовы почти наполовину. Уничтожьте их! Конец связи."
X03_M02_080_010="[{i HQ}]: Бомбардировщики почти готовы. Атакуйте и уничтожьте их! Конец связи."
X03_M02_081_010="[{i HQ}]: Серафим готовят атаку! Это ваш последний шанс! Уничтожьте бомбардировщики! Конец связи."
X03_M02_082_010="[{i HQ}]: Черт... мне не верится. Вы действительно их уничтожили."
X03_M02_090_010="[{i Princess}]: Благодарю вас, командующий. Эти бомбардировщики легко могли легко прорвать мою оборону. Теперь осталось только уничтожить двух командующих серафим."
X03_M02_100_010="[{i HQ}]: Атака начинается и мы ничего не можем сделать. Вы провалили задание. Принцессу ждет неминуемая гибель. Конец связи."
X03_M02_109_010="[{i Princess}]: Я буду жить так, как учит меня Путь."
X03_M02_110_010="[{i Princess}]: Благодарю вас, командующий. Бомбардировщики серафим легко бы прорвали мою оборону. Теперь осталось только уничтожить двух Командующих серафим."
X03_M02_115_010="[{i Rhiza}]: НЕЕЕЕЕЕЕЕЕЕЕЕЕТ!"
X03_M02_115_020="[{i Kael}]: Ха-ха-ха!"
X03_M02_116_010="[{i Fletcher}]: До меня здесь доходят очень странные новости, полковник, ни одну из них хорошей назвать нельзя. Гражданская война у эон? Кого они пытаются обмануть? Эти безумцы убьют нас всех при первой же возможности. Все это очень плохо кончится, вот увидите. Конец связи."
X03_M02_117_010="[{i Dostya}]: Командующий, жучок засек сигнал, который приняли КИИ, он совершенно точно послан с территории коалиции. Пытаюсь выяснить источник. Конец связи."
X03_M02_120_010="[{i Princess}]: Мой победитель, не хочу отвлекать тебя от битвы, но вынуждена попросить об одолжении. Мои самые верные и преданные слуги укрылись в небольшом храме к востоку о моего комплекса. Пожалуйста, сопроводи их к местоположению Ризы для последующей эвакуации. Корабль, который доставит их в безопасное место, готов."
X03_M02_120_020="[{i HQ}]: Сигнал перемещения передается на корабль, командующий. Я буду обновлять по мере необходимости. Конец связи."
X03_M02_130_010="[{i Princess}]: Корабль в твоем распоряжении, Победитель."
X03_M02_140_010="[{i Princess}]: Защити их, Победитель!"
X03_M02_150_010="[{i Princess}]: Корабль атакован!"
X03_M02_160_010="[{i Princess}]: Благодарю тебя, Победитель. Приятно видеть, что доброта торжествует даже во время войны."
X03_M02_170_010="[{i Princess}]: Они... они мертвы... Я буду вечно их оплакивать."
X03_M02_180_010="[{i Princess}]: Пожалуйста, спаси моих слуг, Победитель."
X03_M02_190_010="[{i Princess}]: Слуги готовы и ждут твоего прибытия, Победитель."
X03_M02_200_010="[{i HQ}]: А, черт! Они добрались до базы принцессы. Вероятность того, что она выживет, равна нулю."
X03_M02_210_010="[{i Princess}]: Победитель, мои слуги будут подавлять сопротивление какое-то время."
X03_M02_220_010="[{i HQ}]: Отправляем чертежи \"Нептуна\". Это линейный крейсер, предназначенный для уничтожения судов противника. Обладает большой огневой мощью, найдите ему должное применение. Конец связи."
X03_M02_230_010="[{i Rhiza}]: Победитель, тебе отправлены чертежи Ракетоносца. Он предназначен для уничтожения с большого расстояния оборонительных позиций противника. Конец связи."
X03_M02_240_010="[{i HQ}]: Один бомбардировщик уничтожен. Конец связи."
X03_M02_250_010="[{i HQ}]: Похоже, серафим не удастся закончить постройку этого бомбардировщика. Конец связи."
X03_M02_260_010="[{i HQ}]: Еще одним бомбардировщиком меньше. Конец связи."
X03_M02_270_010="[{i HQ}]: Серафим не удастся закончить постройку этого бомбардировщика. Конец связи."
X03_M02_280_010="[{i HQ}]: Какой красивый взрыв. Конец связи."
X03_M02_290_010="[{i HQ}]: Это был еще один бомбардировщик. Конец связи."
X03_M02_300_010="[{i HQ}]: Это был последний бомбардировщик серафим. Конец связи."
X03_M02_310_010="[{i HQ}]: Вместо того. чтобы уничтожать бомбардировщики, уничтожьте инженеров, которые их строят. Это может облегчить вам жизнь. Конец связи."
X03_M02_320_010="[{i HQ}]: Уничтожьте инженеров, Командующий. Мы не можем позволить этим бомбардировщикам подняться в воздух. Конец связи."
X03_M02_330_010="[{i HQ}]: Я получил подтверждение разведданных Берк. серафим готовят несколько экспериментальных бомбардировщиков, наподобие тех, что разнесли все на Земле. Если они взлетят, Принцесса Берк будет в большой опасности. Уничтожьте их или Инженеров, которые заняты их постройкой."
X03_M02_OBJ_010_010="Уничтожьте экспериментальные бомбардировщики серафим"
X03_M02_OBJ_010_020="Серафим готовят эскадрилью экспериментальных бомбардировщиков. Даже если один из них будет бомбить принцессу, ей конец. Уничтожьте все 6 бомбардировщиков до того, как они долетят до нее."
X03_M02_OBJ_020_010="Сопроводите священников в безопасное место"
X03_M02_OBJ_020_020="Пока серафим не обращали внимания на небольшой храм в центре местности, но принцесса хочет, чтобы вы сопроводили священников в безопасное место. Используйте Сигнал Перемещения, чтобы отправить судно в обозначенную область недалеко от базы Ризы. Сигнал Перемещения будет обновляться по мере необходимости. Это задание не является обязательным для выполнения основного задания. Выполняйте по мере возможности."
X03_M03_010_010="[{i HQ}]: У серафим две базы в этом районе, одна к северу от дворца Принцессы Берк и одна к западу. Обе базы обстреливают Берк из всего, что у них есть, можно сказать, ее приперли к стенке. Защитите Берк и уничтожьте Командующих серафим. Конец связи."
X03_M03_015_010="[{i Brackman}]: Переводчик почти готов. О, да. На следующей операции он уже будет в вашем распоряжении. Отличная работа, дитя мое, отличная работа. Захваченная БМК серафим - это именно то, чего нам не хватало."
X03_M03_020_010="[{i Princess}]: Командующий, у меня уничтожили несколько генераторов, мне нужно экономить оставшуюся энергию для защитного поля. Прошу меня извинить, но вам придется найти другой способ пробиться через глушение."
X03_M03_025_010="[{i Princess}]: Командующий, у меня уничтожили несколько генераторов, мне нужно экономить оставшуюся энергию для защитного поля. Тем не менее, мои техники подготовили для загрузки оптический излучатель, он отправляется вам в данный момент."
X03_M03_050_010="[{i Princess}]: Серафим начали атаку! Боюсь, моя оборона не выдержит!"
X03_M03_060_010="[{i Princess}]: серафим ведут огонь по мне со всех направлений! Боюсь, моя оборона не выдержит!"
X03_M03_070_010="[{i HQ}]: Держаться нету больше сил, командующий. серафим атакуют Берк всем, что у них есть. Защитите ее. Конец связи."
X03_M03_080_010="[{i HQ}]: Это можно будет прекратить только если вы уничтожите командующих серафим. Сотрите их в порошок. Конец связи."
X03_M03_090_010="[{i Princess}]: Прошу вас, командующий, вы должны помочь мне. Боюсь, я долго не продержусь."
X03_M03_100_010="[{i Princess}]: Командующий! серафим начали атаку. Остановите их!"
X03_M03_110_010="[{i HQ}]: Силы серафим разбиты. Конец связи."
X03_M03_120_010="[{i HQ}]: Они не забудут, как им надрали задницу. Отличная работа, командующий. Конец связи."
X03_M03_124_010="[{i HQ}]: Принцесса Берк по-прежнему в опасности. Вам нужно разобраться с серафим."
X03_M03_125_010="[{i HQ}]: Мы не сможем вытащить оттуда Берк, пока не разберемся с серафим. Конец связи."
X03_M03_130_010="[{i Princess}]: Он слабеет, командующий!"
X03_M03_140_010="[{i Princess}]: Силы серафим на севере несут серьезные потери! Продолжайте наступать!"
X03_M03_150_010="[{i Princess}]: Поторопитесь, командующий, силы серафим на севере почти разбиты!"
X03_M03_160_010="[{i Princess}]: Силы серафим на севере уничтожены. Отличная работа, командующий."
X03_M03_170_010="[{i Princess}]: База серафим на западе потеряла большую часть своей инфраструктуры. Не давайте им времени все восстановить!"
X03_M03_180_010="[{i Princess}]: Силы серафим на западе не вынесут новые потери! Продолжайте атаковать!"
X03_M03_190_010="[{i Princess}]: Поторопитесь, силы серафим на западе почти разбиты!"
X03_M03_200_009="[{i HQ}]: Черт, этот скользкий ублюдок сбежал отсюда."
X03_M03_200_010="[{i Princess}]: Он сбежал. Не важно! Он будет уничтожен в другой раз."
X03_M03_200_020="[{i HQ}]: Черт, этот скользкий ублюдок сбежал отсюда."
X03_M03_200_030="[{i HQ}]: Командующий, серафим к западу от Берк разорвал соединение и скрылся. Похоже, что его база прекращает функционировать, так что вам не нужно больше о нем беспокоиться. Конец связи."
X03_M03_201_010="[{i Princess}]: Мой дворец под огнем!"
X03_M03_202_010="[{i Princess}]: Мой дворец больше не выдержит!"
X03_M03_203_010="[{i Princess}]: Поторопитесь, командующий, моя оборона ослаблена!"
X03_M03_204_010="[{i Princess}]: Вы должны поторопиться, командующий! Моя оборона скоро будет прорвана!"
X03_M03_210_010="[{i Fletcher}]: У серафим к югу от вас есть ядерная ракетная установка. Она слабо охраняется, так что у вас не будет проблем с ее захватом. Никогда не знаешь когда придется использовать ядерное оружие против пришельцев... или против так называемых союзников."
X03_M03_215_010="[{i Fletcher}]: Захватите эту установку, если у вас есть возможность, полковник. Конец связи."
X03_M03_220_010="[{i Fletcher}]: Ядерная установка в вашем распоряжении. Найдите ей применение. Конец связи."
X03_M03_230_010="[{i Fletcher}]: Вы упустили чертовски хорошую возможность, полковник. Конец связи."
X03_M03_235_010="[{i Rhiza}]: Я получила слишком большие повреждения. Командующий, я должна вернуться, продолжайте сражаться без меня!"
X03_M03_240_010="[{i HQ}]: К востоку от вас находится база Принцессы. Ее дворец должен выстоять, неважно, какой ценой."
X03_M03_250_010="[{i HQ}]: Как вы видите, на базе имеются приличные оборонительные сооружения, но они не выдержат массированной атаки."
X03_M03_260_010="[{i HQ}]: Эта линия обороны - единственное, что предотвращает наземную атаку этих ублюдков-пришельцев. Советую укрепить ее."
X03_M03_270_010="[{i HQ}]: Займитесь этим, Командующий. Вы должны спасти Принцессу. Конец связи."
X03_M03_280_010="[{i HQ}]: Обнаружены двое Командующих серафим. Один находится к западу от Принцессы, другой к северу от нее. Уничтожьте их. Конец связи."
X03_M03_OBJ_010_010="Уничтожьте командующего серафим на севере"
X03_M03_OBJ_010_020="Для того, чтобы принцесса была действительно в безопасности, нужно уничтожить серафим. Его база находится к северу от местоположения принцессы."
X03_M03_OBJ_010_030="Уничтожьте командующего серафим на западе"
X03_M03_OBJ_010_040="Нельзя допустить, чтобы серафим продолжали атаки на принцессу. Уничтожьте командующего серафим. Его база находится к северу от местоположения принцессы."
X03_M03_OBJ_010_050="Защитите дворец"
X03_M03_OBJ_010_060="Принцесса управляет обороной из дворца. Если это здание будет разрушено, принцесса погибнет и задание будет провалено."
X03_M03_OBJ_020_010="Захватите стратегическую ракетную установку серафим"
X03_M03_OBJ_020_020="Бригадный генерал Флетчер указал на слабоохраняемую стратегическую ракетную установку серафим. Если вы захватите ее, вы сможете использовать ее в своих целях. Это задание не является обязательным для выполнения основного задания. Выполняйте по мере возможности."
