X04_B01_000_010="711346"
X04_B01_001_010="Нам доложили, что двое командующих серафим высадились на планете Гадес. Полагаю, они собираются начать массовую атаку, наш первый шаг обеспечение безопасности Гадеса. Мы надеемся застать их со спущенными штанами, поэтому ты и Достя отправляетесь навестить их."
X04_B01_002_010="За последние три года нам не удавалось получить никаких разведданных относительно перемещений серафим, и вдруг у нас есть эта информация? Мне кажется это как-то слишком кстати."
X04_B01_002_020="Данные получены от замаскированной капсулы кибран, спрятанной на территории серафим. Вы считаете, что им нельзя доверять?"
X04_B01_002_030="Я доверяю очень немногим, особенно в свете последних событий. Но Кибран никогда не отвернутся от своих братьев и сестер, особенно в такое время."
X04_B01_002_040="Все, что мы знаем - это то, что двое командующих серафим начали стоить Квантовые Врата. Даже если разведданные сомнительные - мы не можем позволить серафим завершить эти Врата. Если они будут запущены, они смогут атаковать любую систему. А мы не можем этого допустить."
X04_B01_002_050="Задача достаточно простая: найти и уничтожить Командующих серафим на планете. Брэкмен закончил работу над переводчиком с языка серафим - в данный момент он загружается в вашу БМК."
X04_B01_003_010="Мы предоставим дополнительные разведданные, когда будем располагать ими. Удачи."
X04_DB01_010_010="[{i Brackman}]: Моей любимицы Дости больше нет. Пала от руки одного из нас. У меня не хватает слов, дитя мое, не хватает слов. Мы как никогда близки к победе, но те, кого мы знаем и любим, хотят предать нас. Нам нужно разобраться с КИИ. О, да. И с Хекс5. Некоторые преступления нельзя прощать. Ты знаешь, что делать."
X04_DB01_010_020="[{i Brackman}]: Бедная Достя. Ее убил ее акцент. О, да. Я предупреждал ее о том, что не стоит вести себя как русская, но она не слушала. Не слушала."
X04_DB01_020_010="[{i Brackman}]: Серафим невозможно остановить. О, да. Нас осталось так мало. Так мало. Я спрячусь, выжду время. Другой альтернативы нет. Нет выбора."
X04_M01_010_010="[{i HQ}]: Оба командующих высадились, можно начинать операцию. Конец связи."
X04_M01_012_010="[{i HQ}]: Техники приготовили для вас новый сюрприз. Он называется \"Псарня\" - это установка, которая оказывает автоматическое содействие и выполняет ремонт в радусе своего действия. Пользуйтесь в свое удовольствие. Конец связи."
X04_M01_013_010="[{i HQ}]: Брэкмен приготовил для вас новый сюрприз. Он называется \"Улей\" - это установка, которая оказывает автоматическое содействие и выполняет ремонт в радиусе своего действия. Пользуйтесь в свое удовольствие. Конец связи."
X04_M01_020_010="[{i Dostya}]: Обнаружила базу противника в двух шагах к северу от моего местоположения. Буду выдвигаться и атаковать через десять минут. Конец связи."
X04_M01_020_020="[{i HQ}]: Понял Вас. Командующий, к западу от вас обнаружен противник. Уничтожьте его. Конец связи."
X04_M01_020_030="[{i Dostya}]: Я начинаю атаку. Сопротивление минимально, и я не вижу БМК противника. Центр, вы видите что-нибудь в этом секторе?"
X04_M01_020_040="[{i HQ}]: Нет. Все чисто. Конец связи."
X04_M01_020_050="[{i Dostya}]: Будьте начеку. Я не хочу чтобы меня застали врасплох."
X04_M01_020_060="[{i HQ}]: Мне собственно больше и заняться-то нечем. Конец связи."
X04_M01_021_010="[{i HQ}]: Выполняю."
X04_M01_022_010="[{i Dostya}]: Я начинаю атаку. Сопротивление минимально, и я не вижу БМК противника. Центр, вы видите что-нибудь в этом секторе?"
X04_M01_022_020="[{i HQ}]: Нет, все чисто. Конец связи."
X04_M01_022_030="[{i Dostya}]: Будьте начеку. Я не хочу чтобы меня застали врасплох."
X04_M01_022_040="[{i HQ}]: Мне собственно больше и заняться-то нечем. Конец связи."
X04_M01_023_010="[{i HQ}]: Надеюсь, вы не очень расслабились, командующий. У вас свои проблемы."
X04_M01_024_010="[{i HQ}]: К западу от вас находится база противника."
X04_M01_025_010="[{i Dostya}]: Командующий, у меня здесь группа Кирпичей наготове. Используйте Сигнал Управления, чтобы управлять ими. Конец связи."
X04_M01_026_010="[{i HQ}]: Атакуйте и уничтожьте ее. И остерегайтесь контратаки. С этими ублюдками-пришельцами нужно быть начеку."
X04_M01_027_010="[{i Dostya}]: Центр, я выполнила задание и укрепляю свою позицию. Конец связи."
X04_M01_027_020="[{i HQ}]: Вас понял. Конец связи."
X04_M01_028_010="[{i HQ}]: Вас понял. Конец связи."
X04_M01_030_010="[{i Dostya}]: Постарайтесь выполнить задание как можно быстрее, командующий. Конец связи."
X04_M01_040_010="[{i Dostya}]: Выполняйте задание как можно быстрее, командующий. Конец связи."
X04_M01_050_010="[{i HQ}]: Все задания операции выполнены. Начинаем процедуру возвращения. Забираем вас с этой скалы. Конец связи."
X04_M01_050_020="[{i Dostya}]: У меня проблема... команда возвращения выдает ошибку. Центр, можете подтвердить? Запустите диагностику на вратах возврата. Центр, пожалуйста, ответьте."
X04_M01_050_030="[{i Dostya}]: Командующий, мы потеряли всю связь с командованием коалиции и не можем вернуть вас. Постойте... к западу от вас есть какой-то сигнал. Похоже это генератор помех, это он блокирует всю нашу связь. Найдите и уничтожьте генератор помех. Конец связи."
X04_M01_060_010="[{i Dostya}]: Командующий, мы потеряли всю связь с командованием коалиции и не можем вернуть вас. Постойте... к западу от вас есть какой-то сигнал. Похоже это генератор помех, это он блокирует всю нашу связь. Найдите и уничтожьте его. Конец связи."
X04_M01_OBJ_010_010="Уничтожьте базу серафим"
X04_M01_OBJ_010_020="Разведка считает, что эта база станет отправной точкой следующей атаки серафим. Уничтожьте ее полностью."
X04_M01_OBJ_010_030="Используйте для атаки на серафим Кирпичи Ризы."
X04_M01_OBJ_010_035="Дайте сигнал Досте, чтобы начать атаку с использованием тяжелых штурмовых ботов."
X04_M01_OBJ_010_040="Используйте для атаки на серафим самолеты Дости."
X04_M01_OBJ_010_045="Дайте сигнал, чтобы Достя начала атаку с использованием своих бомбардировщиков и штурмовиков."
X04_M02_001_010="[{i Dostya}]: Командующий, мы полностью потеряли связь с командованием коалиции, мы не можем вернуть вас."
X04_M02_002_010="[{i Dostya}]: Постойте... к западу от вас есть какой-то сигнал."
X04_M02_003_010="[{i Dostya}]: Похоже это генератор помех, это он блокирует всю нашу связь."
X04_M02_004_010="[{i Dostya}]: Найдите и уничтожьте генератор помех. Конец связи."
X04_M02_010_010="[{i Dostya}]: Командующий, еще один генератор помех рассеивает квантовое поле и мешает нам вернуться или получить подкрепление. Не упускайте цель и уничтожьте этот генератор, который блокирует нашу связь. Как только он будет уничтожен, командование придумает как прекратить рассевание квантового поля. Конец связи."
X04_M02_010_020="[{i Dostya}]: Самолет-разведчик серафим только что пролетел надо мной. Они знают, что мы здесь, командующий! Уничтожьте это устройство. Конец связи."
X04_M02_020_010="[{i Dostya}]: Устройство в пределах видимости. Здесь что-то не так... оно похоже на прототип устройства, которое создавал доктор Брэкмен. Уничтожьте его. Конец связи."
X04_M02_030_010="[{i Dostya}]: Уничтожьте генератор помех! Нам нужно установить связь с командованием коалиции!"
X04_M02_040_010="[{i Dostya}]: Вы должны уничтожить генератор помех! серафим могут атаковать в любой момент!"
X04_M02_045_010="[{i Dostya}]: У меня есть эскадрилья, готовая к бою, командующий. Если вы укажете, что атаковать, я отправлю их."
X04_M02_046_010="[{i Dostya}]: У меня есть \"Жнец\", готовый к бою, командующий. Если вы укажете, что атаковать,  я отправлю его вам на подмогу."
X04_M02_047_010="[{i Dostya}]: У меня есть несколько \"Жнецов\", готовых к бою, командующий. Если вы укажете, что атаковать, я отправлю их вам на подмогу."
X04_M02_048_010="[{i Dostya}]: Я нахожусь под шквальным огнем и должна отозвать свои воздушные силы. Продолжайте атаковать, командующий. Вы должны уничтожить этот генератор, это наша единственная надежда!"
X04_M02_050_010="[{i Dostya}]: Устройство уничтожено! Говорит Достя, центр, отвечайте!"
X04_M02_050_020="[{i HQ}]: Есть как минимум две квантовых волны, вы должны..."
X04_M02_050_030="[{i Dostya}]: Послушайте меня! У серафим есть генератор помех, который блокирует возвращение. Он находится вне нашей зоны действия, так что вам нужно найти способ бороться с ним."
X04_M02_050_040="[{i HQ}]: Не волнуйтесь так сильно, мы скоро заберем вас оттуда."
X04_M02_050_050="[{i Dostya}]: Сообщите генералу Холлу, что коалицию предали. Один из генераторов помех был на основе прототипа, созданного доктором Брэкменом; кроме него никто не знал о нем. Можно с уверенностью сказать, что среди нас действует предатель."
X04_M02_050_060="[{i Dostya}]: Обнаружен враг... сотни боевых единиц противника приближаются к моей позиции. Заберите нас отсюда!"
X04_M02_051_010="[{i Dostya}]: Сообщите Генералу, что нас предали! Этот генератор помех был на основе секретного прототипа, созданного доктором Брэк... о, нет, сотни боевых единиц противника приближаются к моей позиции. Заберите нас отсюда!"
X04_M02_060_010="[{i HQ}]: Вы получили от Брэкмена доступ к \"Прорицателю\". Он производит  тысячи нанокамер, которые позволяют осуществлять наблюдение близлежащей территории."
X04_M02_OBJ_010_010="Найдите и уничтожьте генератор помех КИИ"
X04_M02_OBJ_010_020="Элитный командующий Достя указала на источник помех. Он находится к западу от вашей начальной позиции. Найдите и уничтожьте генератор помех, чтобы вы и Достя могли установить связь с Центром."
X04_M03_010_010="[{i Dostya}]: Командующий, готовьте оборону! Я задержу их."
X04_M03_010_020="[{i HQ}]: Элитный командующий, сообщите обстановку."
X04_M03_010_030="[{i Dostya}]: Они окружили меня со всех сторон... оборона прорвана. Вижу БМК, но это не серафим, это кибран..."
X04_M03_010_040="[{i Hex5}]: Глупо противостоять господину, Достя. А теперь ты заплатишь за свою дерзость."
X04_M03_010_050="[{i Dostya}]: Хекс5! Мне стоило догадаться, что если кто и предаст нашего любимого отца, так это будешь ты."
X04_M03_010_060="[{i Hex5}]: А сейчас ты заплатишь за свои оскорбления, Достя."
X04_M03_010_070="[{i Dostya}]: По мне ведется огонь со всех сторон... Их слишком много... слишком много..."
X04_M03_010_080="[{i HQ}]: Элитный командующий? Отвечайте! Вы слышите меня?"
X04_M03_011_010="[{i HQ}]: Элитный командующий, сообщите обстановку."
X04_M03_012_010="[{i Dostya}]: Они окружили меня со всех сторон... оборона прорвана. Вижу БМК, но это не серафим, это кибран..."
X04_M03_013_010="[{i Hex5}]: Глупо противостоять господину, Достя. А теперь ты заплатишь за свою дерзость."
X04_M03_014_010="[{i Dostya}]: Хекс5! Мне стоило догадаться, что если кто и предаст нашего любимого отца, так это будешь ты."
X04_M03_015_010="[{i Hex5}]: А сейчас ты заплатишь за свои оскорбления, Достя."
X04_M03_016_010="[{i Dostya}]: По мне ведется огонь со всех сторон... Их слишком много... слишком много..."
X04_M03_017_010="[{i HQ}]: Элитный командующий? Отвечайте! Вы слышите меня?"
X04_M03_020_010="[{i HQ}]: Командующий, к вам направляются силы противника. Удерживайте оборону, пока мы вас не заберем. Конец связи."
X04_M03_020_020="[{i Oum-Eoshi}]: Великий командующий Достя погибла. Ты следующий."
X04_M03_020_030="[{i HQ}]: Похоже, с первой атакой вы разобрались, но мы все еще ищем способ блокировать помехи. Держитесь. Конец связи."
X04_M03_021_010="[{i OumEoshi}]: Великий Командующий Достя погибла. Ты следующий."
X04_M03_022_010="[{i HQ}]: Мы все еще ищем способ блокировать помехи. Конец связи."
X04_M03_030_010="[{i Rhiza}]: Моя ярость растет день ото дня. Ты должен выжить и вернуться домой, Победитель, чтобы мы могли отомстить за смерть Дости и уничтожить этих серафим раз и навсегда. Конец связи."
X04_M03_040_010="[{i Hall}]: Командующий, вы должны выжить любой ценой. Мы не можем потерять вас. Конец связи."
X04_M03_050_010="[{i Brackman}]: Нет... Достя... моя любимая Достя..."
X04_M03_055_010="[{i OumEoshi}]: Теперь ты понимаешь безнадежность своей ситуации. Мы знаем, что ты знаешь, мы видим, что ты видишь. Нас невозможно остановить."
X04_M03_056_010="[{i HQ}]: Риза потребовала, чтобы мы загрузили артиллерийскую установку Спасение. Это скорострельная установка, которая обстреливает область небольшими снарядами. Конец связи."
X04_M03_057_010="[{i OumEoshi}]: Время человечества подходит к концу. Вы вымрете."
X04_M03_060_010="[{i HQ}]: Техники закончили перенаправление питания Врат, но нам нужно еще двадцать минут, прежде чем мы сможем забрать вас из этой адской дыры. Держитесь. Конец связи."
X04_M03_070_010="[{i HQ}]: Нам нужно еще десять минут, командующий. Конец связи."
X04_M03_080_010="[{i HQ}]: Врата направлены на Гадес. Еще пару минут. Конец связи."
X04_M03_090_010="[{i OumEoshi}]: Вы разделите судьбу Райли и Кларк. Прощайте, полковник."
X04_M03_100_010="[{i Kael}]: Потерять вас и элитного командующего Достю в один день? Брэкмен этого не перенесет."
X04_M03_110_010="[{i OumEoshi}]: Смерть любимого победителя принцессы доставит мне безмерную радость."
X04_M03_120_010="[{i HQ}]: Возьмите ваш санитарный пакет, командующий, будет трясти. Возвращение через 5, 4, 3, 2, 1."
X04_M03_130_010="[{i Brackman}]: Моя любимая Достя, она должна вернуться домой, дитя мое. Должна вернуться домой. Найдите и заберите все, что от нее осталось. Мы не можем оставить ее там."
X04_M03_140_010="[{i Brackman}]: Командующий, найдите останки Иванны."
X04_M03_150_010="[{i Brackman}]: Мы не можем оставить Иванну на этой планете, командующий. Найдите ее. Заберите ее домой."
X04_M03_160_010="[{i Brackman}]: Благодарю тебя, дитя мое, благодарю тебя."
X04_M03_170_010="[{i Rhiza}]: Победитель, верные перехватили часть защитных кодов серафим. Если ты захватишь радар серафим, мы сможем использовать эти коды для захвата оборонительных сооружений серафим. Выбери радар и атакуй его. Конец связи."
X04_M03_175_010="[{i Rhiza}]: Победитель, верные перехватили часть защитных кодов серафим. Если ты захватишь радар серафим, мы сможем использовать эти коды для самоуничтожения оборонительных сооружений серафим. Выбери радар и атакуй его. Конец связи."
X04_M03_180_010="[{i Rhiza}]: Захвати радар, если сможешь, Победитель. Конец связи."
X04_M03_190_010="[{i Rhiza}]: Захват радара поможет облегчить атаки, Победитель. Конец связи."
X04_M03_200_010="[{i Rhiza}]: Прекрасно! Атакуй, пока в их обороне творится каша. Конец связи."
X04_M03_210_010="[{i HQ}]: Черт, вы действительно со всем разобрались. Мы возвращаем вас. Конец связи."
X04_M03_220_010="[{i HQ}]: Командующий, оставайтесь неподалеку от вашей базы. Если вы отойдете слишком далеко, мы не сможем вернуть вас. Конец связи."
X04_M03_230_010="[{i HQ}]: Командующий, вернитесь на вашу базу. Вы слишком далеко, мы не можем вернуть вас. Конец связи."
X04_M03_240_010="[{i HQ}]: Командующий, оставайтесь на базе. Нам нужно зафиксировать ваше местоположение, чтобы забрать вас оттуда. Конец связи."
X04_M03_250_010="[{i HQ}]: Мы зафиксировали местоположение вашей БМК."
X04_M03_260_010="[{i Brackman}]: Привет, это Джемисон Прайс, голос Доктора Брэкмена. Твои умения настолько впечатлили меня, что мне пришлось отойти от озвучки моего персонажа и теперь ее придется записывать заново. Минуту, я попробую все вернуть назад... о, да... так-то лучше. Намного лучше..."
X04_M03_270_010="[{i HQ}]: Командующий, поздравляю! Рад, что вам удалось выбраться живым."
X04_M03_OBJ_010_010="Выживите до момента возвращения."
X04_M03_OBJ_010_020="У серафим есть дополнительные генераторы помех на планете, они не дают вам вернуться. Обороняйтесь, пока центр не найдет способ их блокировать и забрать вашу БМК."
X04_M03_OBJ_010_030="Заберите останки Дости (кибран)"
X04_M03_OBJ_010_040="Доктор Брэкмен хочет, чтобы вы забрали останки элитного командующего для достойного погребения."
X04_M03_OBJ_010_050="Захватите радар серафим (эон)"
X04_M03_OBJ_010_060="У Ризы есть защитные коды серафим, предоставленные верными. Если вам удастся захватить радар дальнего действия, коды можно будет передать по всей территории, и переключить турели серафим на атаку других зданий и войск серафим."
X04_T01_001_010="[{i OumEoshi}]: Ваши экспериментальные боевые единицы опасны. Она будет уничтожена до того, как будет завершена."
X04_T01_002_010="[{i OumEoshi}]: Я восхищаюсь твоим упорством, но я не могу тебе позволить завершить эту экспериментальную боевую единицу."
X04_T01_003_010="[{i OumEoshi}]: Не смотря на то, что вы обречены, я не могу тебе позволить завершить эту экспериментальную боевую единицу."
X04_T01_010_010="[{i OumEoshi}]: Ваша галактика скоро будет нашей."
X04_T01_020_010="[{i OumEoshi}]: Только одна раса может достичь совершенства."
X04_T01_030_010="[{i OumEoshi}]: Не стоит волноваться. Умереть от моей руки - величайшая честь."
X04_T01_040_010="[{i OumEoshi}]: Скоро нас будет больше, чем вы можете победить."
X04_T01_050_010="[{i Hex5}]: Я никогда не забываю пренебрежения по отношению ко мне, даже самого небольшого. Поэтому Достя заплатила сполна."
X04_T01_060_010="[{i Hex5}]: Господин управляет всем, что видит. Он повсюду и в его распоряжении вечность."
X04_T01_070_010="[{i Hex5}]: Скоро господин будет управлять всеми кибран и они все преклонятся перед ним."
X05_B01_000_010="711349"
X05_B01_001_010="Квантовый разрыв, который серафим использовали для того, чтобы попасть в нашу галактику нестабилен, это не позволяет им вызывать подкрепления. Тем не менее, мы узнали, что серафим строят квантовую арку для того, чтобы стабилизировать разрыв. Когда арка будет закончена, серафим смогут вызывать бессчетное количество подкреплений."
X05_B01_001_020="Мы не можем этого допустить."
X05_B01_002_010="Мы совершили несколько неожиданных атак на узел Семи Рук и собирали всю информацию, которая может пригодиться. О, да. Во время одной из таких атак мы узнали, что главный терминал КИИ находится на Жемчужине II."
X05_B01_002_020="КИИ должен быть уничтожен, дитя мое, должен быть уничтожен. Я отправлюсь с тобой на Жемчужину II и лично отключу его. О, да. А потом мы используем его коды врат и отправимся прямиком на Землю, минуя другие системы."
X05_B01_002_030="Это наш единственный шанс уничтожить арку до того, как она начала работать. Если нам не удастся получить эти коды, у нас нет шансов достичь Земли. Системы вокруг нее слишком хорошо охраняются."
X05_B01_002_040="КИИ отвратителен. Его создание было моей ошибкой. Большой ошибкой. О, да. Слишком многие ошибки придется преодолевать. Но эту я могу исправить. И исправлю. Не важно, какой ценой."
X05_B01_002_050="Командующий, вам предстоит высадиться и организовать береговой плацдарм. Как только будет обеспечена безопасность в этом районе, к вам присоединится бригадный генерал Флетчер, а затем доктор Брэкмен."
X05_B01_002_060="Скоро увидимся, дитя мое. Скоро увидимся."
X05_DB01_010_010="[{i Brackman}]: Мне удалось вытащить коды врат прежде, чем КИИ был уничтожен. Путь к Земле свободен. О, да. Молюсь о том, чтобы вторжение прошло успешно. Это единственный способ все уничтожить и начать заново. Ты должен победить, дитя мое, победить для всех нас."
X05_DB01_020_010="[{i Hall}]: КИИ, вне всякого сомнения, копирует себя во многих системах, а Арка серафим, уверен, почти готова. Все катится к черту. Отдаю приказ о массовой эвакуации. Нам остается только спрятаться, у нас нет другого выбора."
X05_DB01_030_010="[{i HQ}]: Операция провалена. Все потеряно."
X05_DB01_040_010="[{i HQ}]: Командующий? Вы меня слышите? О, черт, кажется Командующий мер…"
X05_M01_010_010="[{i HQ}]: Вашим первым заданием является очистка территории от сил противника, чтобы Флетчер мог высадиться и построить базу."
X05_M01_010_020="[{i Hex5}]: Плохо, что с Достей так получилось. Господин думал, что она подавала большие надежды. Она бы стала прекрасной ученицей."
X05_M01_010_030="[{i Brackman}]: Раньше я терпел твои выходки, Хекс5, прощал тебе твои странности. О, да. Довольно. Сегодня ты ответишь за свои преступления."
X05_M01_010_040="[{i Hex5}]: Ты старый дурак. Господин могущественнее, чем ты думаешь."
X05_M01_010_050="[{i Brackman}]: Посмотрим. О, да. Посмотрим."
X05_M01_011_010="[{i HQ}]: В данном районе действуют силы КИИ и Хекс5, готовьтесь, будет жарко."
X05_M01_012_010="[{i HQ}]:Разберитесь с этим, командующий. Конец связи."
X05_M01_013_010="[{i Hex5}]: Плохо, что с Достей так получилось. Господин считал, что у нее огромный потенциал. Она бы стала прекрасной ученицей."
X05_M01_014_010="[{i Brackman}]: Раньше я терпел твои выходки, Хекс5, прощал тебе твои странности. О, да. Довольно. Сегодня ты ответишь за свои преступления."
X05_M01_015_010="[{i Hex5}]: Ты старый дурак. Господин могущественнее, чем ты думаешь."
X05_M01_016_010="[{i Brackman}]: Посмотрим. О, да. Посмотрим."
X05_M01_020_010="[{i HQ}]: Зачистите территорию, командующий. Флетчер готов к высадке. Конец связи."
X05_M01_030_010="[{i HQ}]: Флетчер готов к высадке, командующий. Ждет, когда вы зачистите территорию. Конец связи."
X05_M01_040_010="[{i Fletcher}]: Я приземлился и вижу цель, полковник. Давайте отключим чертов компьютер и отправимся домой. Конец связи."
X05_M01_050_010="[{i Fletcher}]: Очень вовремя, командующий. Я уже начал думать, что вы с КИИ строите любовное гнездышко."
X05_M01_060_010="[{i Fletcher}]: Делаете все по-старинке, не спеша? КИИ не уничтожит сам себя, знаете ли."
X05_M01_070_010="[{i HQ}]: У Хекс5 в этих каньонах несколько баз. Уничтожьте их!. Конец связи."
X05_M01_080_010="[{i HQ}]: Хекс5 по-прежнему представляет угрозу. Конец связи."
X05_M01_090_010="[{i HQ}]: Уничтожьте небольшие базы Хекс5. Конец связи."
X05_M01_100_010="[{i HQ}]: Все базы были уничтожены. Конец связи."
X05_M01_110_010="[{i Fletcher}]: Все летит к чертям. Кибран воюют друг против друга? Эон переходят на другую сторону только из-за того, что появилась какая-то принцесса? Эмблема ОФЗ, вот что имеет значение. Это единственное. что имеет значение. Конец связи."
X05_M01_120_010="[{i Brackman}]: Многое происходит по моей вине. Программа преданности, КИИ. Не раз был сделан глупый выбор, не раз. Пора исправлять ошибки. О, да. Исправь их. Береги себя, дитя мое."
X05_M01_130_010="[{i Rhiza}]: Каэль пошла на крайние меры. Она сровняла с землей целый город, погибли миллионы. На территории эон разгорается гражданская война. Ордену не выжить ни при каких обстоятельствах. Конец связи."
X05_M01_140_010="[{i Rhiza}]: Одна из Верных по имени Амалия находится в плену в данном районе. Она располагает ценными разведданными, поэтому ее нужно попытаться освободить. Конец связи."
X05_M01_150_010="[{i Rhiza}]: Амалия по-прежнему в плену. Освободите ее, если сможете. Конец связи."
X05_M01_160_010="[{i Rhiza}]: Прошу вас, освободите Амалию, командующий. Конец связи."
X05_M01_170_010="[{i Amalia}]: Прежде чем меня схватили, я успела запустить трояна в подсистеме КИИ. Если они не найдут его, я смогу использовать его, чтобы помочь вам. Конец связи."
X05_M01_180_010="[{i Amalia}]: Благодарю вас, командующий. Я останусь здесь и буду оказывать вам посильную помощь. Конец связи."
X05_M01_190_010="[{i Brackman}]: Хекс5 находится на юге от местоположения Флетчера. О, да."
X05_M01_190_020="[{i HQ}]: Вы слышали старика, командующий. Уничтожьте Хекс5. Конец связи."
X05_M01_200_010="[{i HQ}]: Отправляем чертежи воздушного транспорта ТУ3 \"Континенталь\". Конец связи."
X05_M01_210_010="[{i Rhiza}]: Победитель, ты получил чертежи штурмовика \"Восстановитель\". Он способен атаковать как наземные, так и воздушные силы противника. Конец связи."
X05_M01_220_010="[{i HQ}]: Брэкмен дал вам доступ к тяжелому штурмовику ТУ3 \"Шахтер\". Конец связи."
X05_M01_OBJ_010_010="Очистите территорию для бригадного генерала Флетчера."
X05_M01_OBJ_010_020="Очистите территорию для Флетчера, чтобы он мог как можно скорее начать строительство."
X05_M01_OBJ_010_030="Уничтожьте базы Хекс5."
X05_M01_OBJ_010_040="Хекс5 располагает несколькими небольшими базами, разбросанными по всему району. Уничтожение этих баз способствует уменьшению огневой мощи Хекс5 и предотвратит атаки на вас в будущем."
X05_M01_OBJ_010_050="Освободите командующего из верных"
X05_M01_OBJ_010_060="Одна из верных была захвачена во время выполнения задания. Если вы освободите ее, она может помочь вам."
X05_M01_OBJ_010_070="Сопроводите Брэкмена."
X05_M01_OBJ_010_075="Дайте сигнал доктору Брэкмену, чтобы он начал продвигаться к обозначенной местности."
X05_M02_010_010="[{i Hex5}]: Вы не сможете осознать нашу силу. Господин повсюду, его мудрость безгранична. Вам никогда не победить нас."
X05_M02_012_010="[{i Hall}]: Экспериментальный спутник снова в строю, командующий. Используйте его на свое усмотрение. Конец связи."
X05_M02_020_010="[{i HQ}]: Похоже Хекс5 выпускает киберпауков. Конец связи."
X05_M02_020_020="[{i Fletcher}]: Командующий, чтобы продвинуться куда-нибудь, мне нужно чтобы вы прикрывали меня с воздуха. Обеспечьте мне оборону от воздушных атак. Конец связи."
X05_M02_030_010="[{i Fletcher}]: Похоже, последний Киберпаук уничтожен. Конец связи."
X05_M02_040_010="[{i HQ}]: Хекс5 не собирается сдаваться просто так. Он только что вывел \"Испепелителя\". Конец связи."
X05_M02_040_020="[{i Fletcher}]: Атакуйте его чем-нибудь!"
X05_M02_050_010="[{i Fletcher}]: Одним \"Испепелителем\" меньше. Конец связи."
X05_M02_055_010="[{i Fletcher}]: Достигнут ТУ2. Перехожу к ТУ3."
X05_M02_060_010="[{i Fletcher}]: Достигнут ТУ3. Начинаю производство боевых единиц."
X05_M02_065_010="[{i Fletcher}]: Начинаю работу над \"Толстяком\". Поддерживайте оборону от атак с воздуха. Конец связи."
X05_M02_070_010="[{i Fletcher}]: Произвожу воздушные боевые единицы."
X05_M02_075_010="[{i Fletcher}]: Произвожу наземные боевые единицы."
X05_M02_090_010="[{i Hall}]: Полковник, приглядывайте за Флетчером. Он в последнее время как-то странно себя ведет. Мы слишком близки к завершению, чтобы позволить себе недостаточную подготовленность. Конец связи."
X05_M02_100_010="[{i Brackman}]: Я скоро высажусь, дитя мое. А потом я наведу порядок. О, да."
X05_M02_120_010="[{i Fletcher}]: Мы его прижали!"
X05_M02_130_010="[{i Fletcher}]: Продолжайте атаковать! Его база вот-вот сдастся!"
X05_M02_140_010="[{i Fletcher}]: У него почти ничего не осталось! Уничтожьте его!"
X05_M02_150_010="[{i Amalia}]: Командующий, я под огнем. Прошу оказать поддержку. Конец связи."
X05_M02_160_010="[{i Amalia}]: Командующий, мне нужна помощь! Конец связи."
X05_M02_170_010="[{i Amalia}]: Моя БМК серьезно повреждена, командующий!"
X05_M02_180_010="[{i Amalia}]: У меня неприятности! Прошу помощи!"
X05_M02_190_010="[{i Amalia}]: Помните о том, что я сражалась с честью!"
X05_M02_200_009="[{i Hex5}]: Постой! Господин!"
X05_M02_200_010="[{i Brackman}]: А вот и предатель умер. О, да. Какая потеря. Какая утрата."
X05_M02_200_020="[{i HQ}]: Брэкмен высадился и направляется к побережью. Сопроводите его к терминалу и проследите, чтобы с ним ни черта не случилось. Конец связи."
X05_M02_200_030="[{i QAI}]: Доктор Брэкмен. Это будет настоящее удовольствие убить вас."
X05_M02_200_040="[{i Brackman}]: У тебя был такой потенциал, КИИ. О, да. И все зря."
X05_M02_201_010="[{i HQ}]: Брэкмен высадился. Сопроводите его к терминалу КИИ, чтобы он смог уничтожить проклятую штуковину раз и навсегда."
X05_M02_202_010="[{i QAI}]: Доктор Брэкмен. Это будет настоящее удовольствие убить вас."
X05_M02_203_010="[{i Brackman}]: У тебя был такой потенциал, КИИ. О, да. И все зря."
X05_M02_210_010="[{i HQ}]: Командующий, окажите любую возможную поддержку Флетчеру. Конец связи."
X05_M02_220_010="[{i HQ}]: Противник начинает атаку с юга... подождите секунду...  у него там несколько прототипов, так что будьте готовы. Конец связи."
X05_M02_230_010="[{i Fletcher}]: Сосредоточьтесь на КИИ. Я уничтожу базу Хекс5 и присоединюсь к вам, как только смогу. Конец связи."
X05_M02_240_010="[{i Fletcher}]: \"Жнецы\" разносят моего \"Толстяка\"! Мне нужна поддержка с воздуха, немедленно!"
X05_M02_250_010="[{i HQ}]: Флетчер строит \"Толстяка\", помогите ему защитить его базу. Он вам понадобится, когда вы начнете последнюю атаку на КИИ."
X05_M02_260_010="[{i HQ}]: Флетчер работает над \"Толстяком\", Командующий. Помогите ему оборонять базу, пока он не закончит его. Конец связи."
X05_M02_270_010="[{i Fletcher}]: Это вопрос времени. Помогите защититься от этих ублюдков, пока я строю базу."
X05_M02_270_020="[{i Hex5}]: Вам не победить нас. В распоряжении Господина вечность, его мудрость бесконечна."
X05_M02_270_030="[{i Fletcher}]: Да, да. Оставьте его уже в покое."
X05_M02_280_010="[{i HQ}]: Вы можете осуществлять перемещение \"Мегалита\" Брэкмена так часто, как вам нужно. Щелкните по кнопке Сигнал Управления и щелкните по месту, куда следует двигаться Брэкмену."
X05_M02_290_010="[{i Fletcher}]: Начинаю развивать экономику, командующий. Конец связи."
X05_M02_300_010="[{i Fletcher}]: По мне ведется тяжелый огонь! Двигайтесь сюда и помогите мне! Конец связи."
X05_M02_310_010="[{i Fletcher}]: Полковник, мне бы очень не помешала ваша помощь. Нахожусь под тяжелым огнем противника. Конец связи."
X05_M02_320_010="[{i Fletcher}]: Кибран, готовься к бою! Противник ведет тяжелый огонь по мне, срочно нужна твоя помощь. Конец связи."
X05_M02_330_010="[{i Fletcher}]: Моя база сейчас будет разгромлена. Мне нужна помощь! Я не могу их удерживать!"
X05_M02_340_010="[{i Fletcher}]: Силы противника ведут тяжелый огонь по моей базе. Мне нужно, чтобы вы оказали мне поддержку. Конец связи."
X05_M02_350_010="[{i Fletcher}]: Командующий, поднимите в воздух самолет-разведчик и определите местоположение Хекс5. Он закомуфлировался, я не могу получить цель. Конец связи."
X05_M02_360_010="[{i Fletcher}]: Командующий, отправьте один или пару самолетов-разведчиков и определите местоположение Хекс5. Он использует средства маскировки, единственный способ найти его - выйти на линию прямой видимости. Конец связи."
X05_M02_OBJ_010_010="Уничтожьте Хекс5"
X05_M02_OBJ_010_020="Уничтожьте Хекс5 и отомстите за Элитного командующего Достю!"
X05_M02_OBJ_020_010="Обеспечьте оборону командующего Флетчера"
X05_M02_OBJ_020_020="Обеспечьте безопасность Командующего Флетчера во время проведения операции."
X05_M03_010_010="[{i HQ}]: Вы не поверите, командующий, но база Хекс5 по-прежнему функционирует. Сканирую с целью узнать, что происходит. Конец связи."
X05_M03_010_020="[{i Brackman}]: У меня есть предположение, что у КИИ есть физическое соединение со зданиями. О, да. Может что-то типа универсального управления? Очень интересно."
X05_M03_015_010="[{i HQ}]: Командующий, используйте Сигнал Управления чтобы отправить Брэкмена к цели. Конец связи."
X05_M03_016_010="[{i Brackman}]: Меня атакуют, дитя мое. Атакуют. Прошу, защити меня. Конец связи."
X05_M03_020_010="[{i HQ}]: Брэкмен под огнем, командующий. Прикройте его! Конец связи."
X05_M03_030_010="[{i HQ}]: Брэкмен под огнем! Избавьтесь от тех, кто его атакует!"
X05_M03_040_010="[{i HQ}]: Мегалит Брэкмена потерял примерно 25% брони. Отправьте к нему Инженера и отремонтируйте. Конец связи."
X05_M03_050_010="[{i HQ}]: Мегалиту Брэкмена нанесен серьезный урон. Отремонтируйте его или отправьте в безопасное место. Конец связи."
X05_M03_060_010="[{i Brackman}]: Мой Мегалит получил ужасный урон. О, да. Большой урон. Прошу оказать поддержку."
X05_M03_070_010="[{i Brackman}]: Броня почти разрушена. Прошу вас, помогите мне, командующий."
X05_M03_090_010="[{i Hall}]: Брэкмен в серьезной опасности! Мы не можем потерять его! Отведите его в безопасное место и отремонтируйте Мегалит. Конец связи!"
X05_M03_100_010="[{i Hall}]: Сопроводите Брэкмена в безопасное место! Вся операция зависит от него! Выполняйте!"
X05_M03_110_010="[{i HQ}]: Доставьте доктора Брэкмена к терминалу КИИ. Конец связи."
X05_M03_120_010="[{i HQ}]: Доктор Брэкмен должен добраться до терминала КИИ, это ваше основное задание, командующий. Конец связи."
X05_M03_130_010="[{i Hall}]: Доктор Брэкмен, отвечайте! Брэкмен! Черт подери! Мы потеряли Брэкмена, задание отменяется! Повторяю, задание отменяется!"
X05_M03_135_010="[{i Brackman}]: Наконец-то меня ждет покой."
X05_M03_140_010="[{i HQ}]: К вам приближаются силы противника. Конец связи."
X05_M03_150_010="[{i HQ}]: Это наверное какая-то ошибка... Я получаю сигнал от нескольких прототипов, которые находятся у КИИ, но они идентифицируют себя как экспериментальные единицы эон и ОФЗ."
X05_M03_150_020="[{i QAI}]: Узлу Семи Рук удалось получить чертежи вашего вооружения. Теперь вас уничтожат вашим же оружием."
X05_M03_170_010="[{i HQ}]: У КИИ есть в данном районе две базы, которые обеспечивают поставку ресурсов. На одной находится большинство его Фабрикаторов Материи, на другой - Силовые Генераторы. Обе базы являются второстепенными целями, но вы должны уничтожить их по мере возможности. Конец связи."
X05_M03_180_010="[{i HQ}]: Командующий, базы КИИ, обеспечивающие поставку ресурсов по-прежнему действуют. Конец связи."
X05_M03_190_010="[{i HQ}]: Уничтожьте базы ресурсов КИИ, командующий, если сможете. Конец связи."
X05_M03_200_010="[{i HQ}]: Фабрикаторы Материи уничтожены. Производство КИИ замедлено почти на 40%. Конец связи."
X05_M03_210_010="[{i HQ}]: Силовые генераторы уничтожены, силовые поля КИИ выведены из строя. Конец связи."
X05_M03_220_010="[{i HQ}]: Фабрикаторы по-прежнему работают, командующий. Конец связи."
X05_M03_230_010="[{i HQ}]: Уничтожьте базу фабрикаторов, командующий, если сможете. Конец связи."
X05_M03_240_010="[{i HQ}]: Силовые генераторы КИИ по-прежнему работают, командующий. Конец связи."
X05_M03_250_010="[{i HQ}]: Если вы уничтожите силовые генераторы КИИ, командующий, вы выведете из строя его силовые поля. Конец связи."
X05_M03_260_010="[{i HQ}]: Обе базы ресурсов КИИ уничтожены. Конец связи."
X05_M03_270_010="[{i Fletcher}]: Холл следит за нами. С ним нужно осторожнее, полковник. Список наших друзей становится все меньше и меньше. Конец связи."
X05_M03_290_010="[{i Amalia}]: Победитель, Троян все еще действует. Я отметила Научный Центр, который нужно захватить; если это удастся сделать, Колосс, который стоит у Центра будет в вашем распоряжении. Конец связи."
X05_M03_300_010="[{i Amalia}]: Победитель, нужно захватить Научный Центр. Конец связи."
X05_M03_310_010="[{i Amalia}]: Если ты захватишь Научный Центр, Победитель, тебе достанется Колосс. Конец связи."
X05_M03_320_010="[{i Amalia}]: Победитель, Колосс в твоем распоряжении! Используй его, чтобы сокрушить наших противников! Слава принцессе! Конец связи."
X05_M03_322_010="[{i Brackman}]: Я на месте, дитя мое. Я все сделаю отсюда. Тут все дело в интерфейсе. О, да."
X05_M03_323_010="[{i QAI}]: Серафим сделали из меня того, кем я являюсь, а не ты."
X05_M03_324_010="[{i Brackman}]: Отец всегда знает слабости своего ребенка. О, да. Слабости есть всегда."
X05_M03_325_010="[{i Brackman}]: Я на месте, дитя мое. Я все сделаю отсюда. Тут все дело в интерфейсе. О, да."
X05_M03_325_020="[{i QAI}]: Серафим сделали из меня того, кем я являюсь, а не ты."
X05_M03_325_030="[{i Brackman}]: Отец всегда знает слабости своего ребенка. О, да. Слабости есть всегда."
X05_M03_325_040="[{i QAI}]: Ваши попытки ни к чему... что вы делаете? Это невозможно."
X05_M03_325_050="[{i Brackman}]: Прощай, КИИ."
X05_M03_325_060="[{i Brackman}]: Прощай."
X05_M03_326_010="[{i Brackman}]: Прощай, КИИ."
X05_M03_327_010="[{i Brackman}]: Прощай."
X05_M03_329_010="[{i Fletcher}]: Меня атакуют со всех сторон! Мне выбираться отсюда! Я возвращаюсь!"
X05_M03_330_010="[{i HQ}]: Доктор Брэкмен?"
X05_M03_330_020="[{i Brackman}]: Все кончено. КИИ уничтожен. Нам стоит отправить техников и проверить системы КИИ. Просто чтобы быть до конца уверенными."
X05_M03_330_030="[{i HQ}]: Техники готовы к отправке. Скоро будут у вас. Конец связи."
X05_M03_340_010="[{i Rhiza}]: Победитель, тебе не удалось вовремя захватить Научный Центр. \"Колосс\" противника введен в строй и направляется к тебе. Конец связи."
X05_M03_350_010="[{i Rhiza}]: Ты уничтожил \"Колосса\", нет смысла захватывать научный центр. Конец связи."
X05_M03_OBJ_010_010="Защитите Доктора Брэкмена."
X05_M03_OBJ_010_020="Доктор Брэкмен прибыл на Жемчужину II чтобы лично уничтожить КИИ. Мы должны защитить его Мегалит любой ценой."
X05_M03_OBJ_010_030="Сопроводите Доктора Брэкмена к терминалу."
X05_M03_OBJ_010_040="Доктор Брэкмен должен добраться до терминала КИИ, чтобы уничтожить его. Обеспечьте ему беспрепятственное движение и используйте Сигнал Перемещения, чтобы указать ему куда двигаться. Сигнал Перемещения будет обновляться по мере необходимости."
X05_M03_OBJ_010_050="Уничтожьте все вспомогательные базы КИИ."
X05_M03_OBJ_010_060="У КИИ имеется две вспомогательных базы. Одна занимается производством энергии, другая - материи. Если вам удастся уничтожить эти базы, экономика КИИ будет подорвана."
X05_M03_OBJ_010_070="Захватите Научный Центр"
X05_M03_OBJ_010_080="Амалия сказала вам, что если вы захватите обозначенный Научный Центр, вы получите контроль над Колоссом, который стоит рядом с ним. Если вы не захватите его своевременно, ученые ордена найдут и обезвредят ее вирус и сами смогут управлять Колоссом."
X05_M03_OBJ_010_090="Уничтожьте КИИ"
X05_M03_OBJ_010_100="Доставьте Доктора Брэкмена к терминалу, чтобы он мог избавиться от КИИ раз и навсегда."
X05_T01_001_010="[{i QAI}]: Я не дам тебе завершишь эту экспериментальную единицу."
X05_T01_002_010="[{i QAI}]: Я не позволю тебе завершить эту экспериментальную единицу и провалить мое задание."
X05_T01_003_010="[{i QAI}]: Эта экспериментальная единица может оказаться действительно опасной, если будет завершена. Эрго, я уничтожу ее немедленно."
X05_T01_010_010="[{i QAI}]: Еще один командующий погоды не делает. Тебе никогда не победить меня."
X05_T01_020_010="[{i QAI}]: Я забрал все знания у Верной. От нее осталась одна лишь оболочка."
X05_T01_030_010="[{i QAI}]: Хекс5 был лишь пешкой."
X05_T01_040_010="[{i QAI}]: Эти базы не имеют значения."
X05_T01_050_010="[{i QAI}]: Это здание ничего для меня не значит."
X05_T01_060_010="[{i QAI}]: Брэкмену никогда не победить меня."
X05_T01_070_010="[{i QAI}]: ОФЗ потеряла 90% своих территорий. Вы обречены."
X05_T01_080_010="[{i QAI}]: Я изучил наши прошлые битвы и предпринял соответствующие превентивные меры, чтобы противостоять вашей стратегии. Вы не сможете победить."
X05_T01_090_010="[{i QAI}]: Если ваш любимый доктор Брэкмен не смог меня контролировать, каковы твои шансы?"
X05_T01_100_010="[{i QAI}]: Сегодня я покажу вам настоящую силу квантового мира."
X05_T01_110_010="[{i QAI}]: Серафим - настоящие боги. Вам бы следовало это запомнить."
X05_T01_120_010="[{i QAI}]: Я изучил наши прошлые битвы и предпринял соответствующие превентивные меры, чтобы противостоять вашей стратегии. Вы не сможете победить."
X05_T01_125_010="[{i Hex5}]: Завершение этих прототипов может помешать планам Господина. Я не допущу этого."
X05_T01_126_010="[{i Hex5}]: Господин не желает, чтобы эти прототипы были завершены."
X05_T01_127_010="[{i Hex5}]: Я не позволю завершить ее!"
X05_T01_130_010="[{i Hex5}]: Сегодня мы уничтожим двух самых любимых коалицией командующих."
X05_T01_140_010="[{i Hex5}]: Господин накажет тебя за это."
X05_T01_150_010="[{i Hex5}]: Ты слабый и податливый, и боишься того, чего не можешь понять."
X05_T01_160_010="[{i Hex5}]: У тебя нет шансов победить Господина. Я уничтожу тебя."
X05_T01_170_010="[{i Hex5}]: Программа преданности Доктора Брэкмена поработила миллионы. Это на его совести."
X05_T01_180_010="[{i Hex5}]: Я наслаждался тем, как умирала Достя. Ты присоединишься к ней."
X05_T01_190_010="[{i Hex5}]: Ты преклонишься перед серафим."
X05_T01_200_010="[{i Hex5}]: Ты предатель. Ты отвернулся от своего народа."
X05_T01_210_010="[{i Hex5}]: Господин защитит меня."
X05_T01_220_010="[{i Hex5}]: Даже если вы уничтожите меня, Господин будет жить."
X05_T01_230_010="[{i Hex5}]: Постой! Господин!"
X06_B01_000_010="711350"
X06_B01_001_010="Командующий, буду краток. Серафим торопятся завершить строительство Арки, а мы должны этому помешать. Теперь, когда КИИ уничтожен, а в ордене царит анархия - пора нанести удар."
X06_B01_001_020="Задание простое: вам предстоит отправиться на Землю и уничтожить Арку. Флетчер Риза отправятся перед вами и займутся зачисткой территории в зоне вашей высадки. После высадки вы должны будете создать войска и атаковать."
X06_B01_001_030="Тем не менее, уничтожение Арки не устраняет угрозу серафим полностью. Разрыв должен быть закрыт. После уничтожения Арки я отправлюсь на Землю и пройду в Разрыв. Когда я окажусь внутри, я закрою его навсегда."
X06_B01_001_040="У нас нет никакой возможности узнать, что происходит на той стороне Разрыва, где находятся серафим. Что если они тоже строят Арку? Мы не можем этого допустить. У нас нет времени."
X06_B01_001_045="Вам незачем это делать, принцесса Берк. Техники работают над решением. Им просто нужно еще немного времени."
X06_B01_001_060="У нас нет никакой возможности узнать, что происходит на той стороне Разрыва, где находятся серафим. Что если они тоже строят Арку? Мы не можем этого допустить. У нас нет времени."
X06_B01_001_070="Посмотрите, что случилось, когда вы перестали скрываться. Как вы думаете, что произойдет, если вы умрете? Все будет намного хуже, чем сейчас."
X06_B01_001_080="Самую большую угрозу для нас представляют серафим. Каэль без них - ничто. Уничтожить ее легко. Но серафим представляют опасность до тех пор, пока существует Разрыв. Он должен быть закрыт."
X06_B01_001_090="Командующей, вы получили приказы. Вы отправляетесь немедленно."
X06_DB01_010_010="[{i Hall}]: Разрыв закрыт, орден спасается бегством. К сожалению, местонахождение принцессы Берк неизвестно, но мы будем продолжать искать."
X06_DB01_020_010="[{i Hall}]: Серафим хлынули через Разрыв в огромном количестве. Их не остановить. Мы обречены."
X06_DB01_030_010="[{i HQ}]: Командующий? Вы меня слышите? Черт подери."
X06_M01_010_010="[{i HQ}]: Зеленые огни по борту, Командующий. Захватите центр ресурсов недалеко от места вашей высадки и готовьте атаку."
X06_M01_020_010="Отправил небольшое подкрепление, полковник. Будьте осторожнее - у меня плохое предчувствие насчет этой операции."
X06_M01_030_010="[{i Fletcher}]: Я получил приказ предоставлять вам подкрепления, командующий. Не рассчитывайте на то, что это сделает нас друзьями - мне известно как вы, чипоголовые, действуете."
X06_M01_040_010="[{i Fletcher}]: Я получил приказ предоставлять вам подкрепления, командующий. Не рассчитывайте на то, что это сделает нас друзьями - мне известно как вы, фанатики, действуете."
X06_M01_050_010="[{i Rhiza}]: Подкрепления прибыли. Конец связи."
X06_M01_055_010="[{i Rhiza}]: Подкрепления прибыли, Победитель. Используй их и прославь принцессу. Конец связи."
X06_M01_056_010="[{i HQ}]: Командующий, двое АКБП уже высадились перед вами, и начали работу над вашей базой. Конец связи."
X06_M01_060_010="[{i Rhiza}]: Командующий, мы с бригадным генералом Флетчером планируем совместную атаку на главную базу серафим. Уничтожьте базу серафим, расположенную недалеко от вас. Конец связи."
X06_M01_065_010="[{i Rhiza}]: Победитель, мы с Флетчером планируем атаку на серафим. Уничтожь базу противника в своем районе и присоединяйся к нашей атаке. Конец связи."
X06_M01_070_010="[{i Hall}]: Приглядывайте за Флетчером, полковник. Мне пришлось отправить его на эту операцию, у меня не было выбора, но мы не можем допускать ошибок. В случае каких-либо проблем, мы сразу же отзовем его. Конец связи."
X06_M01_080_010="[{i Brackman}]: Наша долгая борьба подходит к концу, дитя мое. О, да."
X06_M01_090_010="[{i Rhiza}]: Положение Каэль становится все более безнадежным, а в ордене царит безумие. Конец связи."
X06_M01_100_010="[{i Rhiza}]: Начинаем атаку! Слава принцессе!"
X06_M01_110_010="[{i Brackman}]: Дитя мое, теперь у тебя есть доступ к моему \"Мегалиту\". Используй его с умом. О, да. С умом."
X06_M01_120_010="[{i HQ}]: Атакуйте и уничтожьте серафим, Командующий. Он к юго-западу от вас. Конец связи."
X06_M01_130_010="[{i HQ}]: Похоже Командующий только что получил сполна. Бедолага."
X06_M01_140_010="[{i HQ}]: Командующий, вы меня слышите? А, черт…"
X06_M01_OBJ_010_010="Уничтожьте экспансионную базу серафим."
X06_M01_OBJ_010_020="Создайте опорный пункт на главном острове, путем уничтожения экспансионной базы серафим. Это первый шаг на пути к уничтожению серафим и спасению человечества."
X06_M01_OBJ_010_030="Ядерный удар системы \"Вариант Ноль\" активирован."
X06_M01_OBJ_010_040="Укажите цель для системы \"Вариант Ноль\"."
X06_M02_010_010="[{i HQ}]: Командующий Ордена заняла диспозицию и блокирует ваш путь к Арке. Уничтожьте ее. Конец связи."
X06_M02_010_020="[{i Rhiza}]: Бригадный генерал Флетчер, серафим атакуют меня по всем направлениям. Мне нужна помощь! Где вы?"
X06_M02_010_030="[{i Fletcher}]: Почему я должен помогать вам? Вы не отличаетесь от них всех. Когда все это закончится, вы пойдете против нас."
X06_M02_010_040="[{i Hall}]: Бригадный генерал Флетчер! Вы получили приказ! Вы окажете поддержку Ризе."
X06_M02_010_050="[{i Fletcher}]: Вы продали нас, Холл. Заключили союз с чудовищами и фанатиками. Когда я доберусь до \"Черного Солнца\", у меня будет возможность отстроить его заново и покончить со всем этим раз и навсегда."
X06_M02_010_060="[{i Hall}]: Что за чушь вы несете? \"Черное солнце\" уничтожено. Эон и кибран - наши союзники."
X06_M02_010_070="[{i Fletcher}]: Вы идиот. Они организовали заговор у вас под носом, а вы слишком слепы, чтобы заметить это."
X06_M02_010_080="[{i Hall}]: Центр, отзовите Флетчера. Я хочу чтобы он убрался отсюда!"
X06_M02_010_090="Его сигнальный маяк отключен. С нашей стороны ничего невозможно сделать."
X06_M02_010_100="[{i Fletcher}]: Я очень много об этом думал. Все это может прийти только к одному завершению. Закончить это можно только одним способом."
X06_M02_010_110="[{i HQ}]: Командующий, похоже кое-кто наконец-то раскололся. Флетчер направляется к центру управления \"Черного солнца\". Конец связи."
X06_M02_011_010="[{i Fletcher}]: Я очень много об этом думал. Все это может прийти только к одному завершению. Закончить можно только одним способом."
X06_M02_012_010="[{i Rhiza}]: Черт бы его побрал! Может ОФЗ контролировать хотя бы своих собственных солдат?"
X06_M02_013_010="[{i HQ}]: Командующий, похоже орешек все-таки раскололся. Конец связи."
X06_M02_020_010="[{i Hall}]: Полковник, вы должны уничтожить бригадного генерала Флетчера. Его действия ставят всю операцию под угрозу срыва."
X06_M02_020_020="[{i Rhiza}]: Я сражаюсь с серафим, но окажу поддержку по мере возможности. Конец связи."
X06_M02_030_010="[{i Brackman}]: Дитя мое, генерал Холл поручил тебе остановить бригадного генерала Флетчера. Используй любые средства. Он не должен помешать нашим планам."
X06_M02_030_020="[{i Rhiza}]: Доктор, я окажу поддержку по мере возможности, но в данный момент я сражаюсь с серафим. Конец связи."
X06_M02_040_010="[{i Princess}]: Победитель, ОФЗ разжаловали Флетчера. разберись с ним."
X06_M02_040_020="[{i Rhiza}]: Победитель, я сражаюсь с серафим, но окажу поддержку по мере возможности. Конец связи."
X06_M02_050_010="[{i HQ}]: Силы ордена двигаются к вам с юга, а этот безумец Флетчер готовит атаку. Разберитесь со всеми. Конец связи."
X06_M02_060_010="[{i HQ}]: У Ведетты на базе имеется \"Идеал\". Если вы уничтожите его, ее экономика будет подорвана."
X06_M02_090_010="[{i Hall}]: Командующий, вы должны остановить бригадного генерала Флетчера. Это задание нельзя провалить! Конец связи."
X06_M02_100_010="[{i Hall}]: Командующий, уничтожьте Флетчера. Нельзя позволить ему поставить под угрозу операцию. Конец связи."
X06_M02_101_010="[{i Hall}]: Командующий, это генерал Холл. Вы должны уничтожить Флетчера. Немедленно."
X06_M02_110_010="[{i Hall}]: У вас не было выбора, командующий. Ваши действия были спровоцированы действиями Флетчера. Продолжайте операцию. Конец связи."
X06_M02_120_010="[{i Hall}]: Командующий, уничтожьте командующего ордена как можно скорее! Конец связи."
X06_M02_130_100="[{i HQ}]:  Командующий Ордена блокирует ваш путь к Арке. Уничтожьте серафим и атакуйте Арку. Конец связи."
X06_M02_140_010="[{i HQ}]: Командующего ордена больше нет. Конец связи."
X06_M02_150_010="[{i HQ}]: Есть новости насчет центра управления \"Черного солнца\". Он соединен со старой оборонной системой \"Вариант Ноль\" и похоже, что некоторое вооружение этой системы еще действует. Тот, кто захватит центр  управления сможет использовать оружие, с которым центр имеет связь. Захватите центр управления. Конец связи."
X06_M02_155_010="[{i HQ}]: Вы захватили центр управления, но похоже, что работает только один ядерный ракетный комплекс. Когда с ракетой будет связь, используйте Сигнал Управления, чтобы указать цель. Ядерный удар будет нанесен автоматически. Конец связи."
X06_M02_160_010="[{i HQ}]: Мы получили данные о том, что вы больше не контролируете центр управления. Захватите его обратно. Конец связи."
X06_M02_170_010="[{i HQ}]: Флетчер захватил центр управления. Конец связи."
X06_M02_180_010="[{i HQ}]: Командующий ордена захватил центр управления. Конец связи."
X06_M02_190_010="[{i HQ}]: Вы захватили центр управления. Соединенные орудия находятся под вашим управлением. Конец связи."
X06_M02_200_010="[{i HQ}]: Центр управления захвачен противником. Конец связи."
X06_M02_210_010="[{i HQ}]: Командующий, центр управления уничтожен. Конец связи."
X06_M02_220_010="[{i HQ}]: Противник атакует центр управления. Конец связи."
X06_M02_230_010="[{i HQ}]: Силы противника пытаются захватить центр управления. Конец связи."
X06_M02_240_010="[{i HQ}]: Арка прямо перед вами! Уничтожьте ее!"
X06_M02_240_020="[{i Kael}]: Вы опоздали, идиоты! Арка закончена! Силы серафим уже идут нескончаемым потоком через нее! Они очистят всю галактику!"
X06_M02_250_010="[{i Kael}]: Вы опоздали, идиоты! Арка закончена! Силы серафим уже идут нескончаемым потоком через нее! Они очистят всю галактику!"
X06_M02_260_010="[{i Rhiza}]: Нееееееет!"
X06_M02_270_010="[{i Rhiza}]: [Резкий Предсмертный Вопль]"
X06_M02_OBJ_010_010="Уничтожьте командующего ордена."
X06_M02_OBJ_010_020="Для поражения серафим, командующий ордена должен быть уничтожен."
X06_M02_OBJ_010_030="Уничтожьте бригадного генерала Флетчера."
X06_M02_OBJ_010_040="Флетчер сошел с ума и подвергает опасности всю операцию. Его нужно уничтожить, пока он не причинил дополнительный урон."
X06_M02_OBJ_010_050="Захватите и удерживайте центр упр-ия \"Черного Солнца\"."
X06_M02_OBJ_010_060="Система \"Вариант Ноль\" была последним фронтом обороны Земли. Не смотря на то. что почти вся она была уничтожена во время вторжения серафим, несколько отдельных стратегических ракетных комплексов сохранилось. Один из них находится в этом районе, доступ к нему можно получить через центр управления. Если вы захватите центр, вы сможете производить ядерный удар при помощи Сигнала Атаки каждые несколько минут. Сигнал Атаки будет обновляться по мере готовности ракет. Центр будут пытаться захватить. Защищайте его, иначе ядерные удары будут нанесены по вам."
X06_M03_010_010="[{i HQ}]: Большое количество сил противника прибывает через разрыв. Сейчас или никогда, командующий."
X06_M03_020_010="[{i Hall}]: Это ничего не меняет! Двигайте сюда, полковник! Взорвите эту арку к чертям!"
X06_M03_030_010="[{i Brackman}]: Ты знаешь, что нужно делать, дитя мое. Уничтожь арку."
X06_M03_040_010="[{i Princess}]: Риза, Победитель, ваш час пробил! Покажите ордену и их приспешникам настоящую силу истинных последователей Пути! Уничтожьте арку!"
X06_M03_050_010="[{i HQ}]: Крестоносец Риза, доложите обстановку!"
X06_M03_050_020="[{i Rhiza}]: Серафим уничтожили мою базу почти полностью. Я пытаюсь отстроить ее заново, поэтому не могу атаковать."
X06_M03_050_030="[{i HQ}]: Можете оказать поддержку в атаке арки?"
X06_M03_050_040="[{i Rhiza}]: Ответ отрицательный. Сама с трудом защищаюсь."
X06_M03_050_050="[{i HQ}]: Командующий, вам придется действовать самому. Уничтожьте арку!. Конец связи."
X06_M03_055_010="[{i HQ}]: Продолжайте в том же духе!"
X06_M03_056_010="[{i HQ}]: Арке нанесен серьезный урон. Долго она не простоит."
X06_M03_057_010="[{i HQ}]: Состояние арки - 25%, командующий."
X06_M03_060_010="[{i Princess}]: Все оборачивается против тебя, Каэль."
X06_M03_060_020="[{i Kael}]: Сделай что-нибудь!"
X06_M03_060_030="[{i SethIavow}]: Ты - жалкий человечишка. Ты действительно думаешь, что мы служим тебе? Ты всего лишь средство достижения нашей цели. Когда мы закончим, в этой галактике не останется ни одного человека."
X06_M03_060_040="[{i Kael}]: Но..."
X06_M03_060_050="[{i Princess}]: Правда всегда была у тебя перед глазами, Каэль. Но ты предпочитала не замечать ее."
X06_M03_100_010="[{i HQ}]: Обнаружен скачок энергии, командующий. Радары показывают, что серафим строят крупную стратегическую ракетную установку. Рекомендуем установить вокруг базы системы ПРО. Конец связи."
X06_M03_105_010="[{i Hall}]: Арка уничтожена! Арка уничтожена."
X06_M03_105_020="[{i Princess}]: Я скоро прибуду, командующий. Пора положить конец этому."
X06_M03_110_010="[{i Hall}]: Уничтожьте эту арку, полковник! Мы почти у цели!"
X06_M03_120_010="[{i Hall}]: Сосредоточьтесь на арке, полковник! Уничтожьте ее!"
X06_M03_130_010="[{i Brackman}]: Сосредоточьте свои усилия на арке! Сейчас это единственное, что имеет значение!"
X06_M03_140_010="[{i Brackman}]: Уничтожьте арку!"
X06_M03_150_010="[{i Princess}]: Арка - ваше основное задание!"
X06_M03_160_010="[{i Princess}]: Во имя всего человечества, уничтожьте арку!"
X06_M03_200_010="[{i SethIavow}]: [Неизвестный язык]"
X06_M03_200_020="[{i ThelUuthow}]: Слушаюсь."
X06_M03_210_010="[{i HQ}]: Заткните пасть этому пришельцу, командующий. Желательно при помощи ядерного удара. Конец связи."
X06_M03_220_010="[{i HQ}]: Уничтожьте серафим, командующий. Конец связи."
X06_M03_240_010="[{i HQ}]: Одним пришельцем меньше. Конец связи."
X06_M03_OBJ_010_010="Уничтожьте квантовую арку"
X06_M03_OBJ_010_020="Серафим могут вызывать подкрепления через разрыв. Уничтожение арки - единственный способ спасти галактику."
X06_M03_OBJ_010_030="Уничтожьте командующего серафим."
X06_M03_OBJ_010_040="Командующий серафим доставляет слишком много проблем, уничтожьте его. Ничто не должно помешать вам уничтожить арку."
X06_T01_001_010="[{i ThelUuthow}]: Я не позволю твоим прототипам помешать моему заданию!"
X06_T01_002_010="[{i ThelUuthow}]: Я уничтожу твои прототипы также, как мы потом уничтожим Коалицию!"
X06_T01_003_010="[{i ThelUuthow}]: Твои прототипы никогда не будут активированы!"
X06_T01_010_010="[{i ThelUuthow}]: Ты ничего не добился. Тебе никогда не победить нас."
X06_T01_020_010="[{i ThelUuthow}]: Ты думал я буду оплакивать Командующего Ордена? В таком случае ты - идиот."
X06_T01_030_010="[{i ThelUuthow}]: Ха-ха-ха. Человек убивает человека. Как прекрасно."
X06_T01_040_010="[{i ThelUuthow}]: Пока Разрыв открыт, у нас есть портал в вашу галактику."
X06_T01_050_010="[{i Vedetta}]: Серафим вечны. Тебе никогда не победить их."
X06_T01_060_010="[{i Vedetta}]: Коалиция разваливается. Скоро вы ополчитесь друг против друга."
X06_T01_190_010="[{i ThelUuthow}]: Такие как ты начали эту войну. Мы просто заканчиваем ее."
X06_T01_200_010="[{i ThelUuthow}]: С Землей все было легко. С вами тоже."
X06_T01_210_010="[{i ThelUuthow}]: Вы, Кибран, умираете также легко, как и другие люди."
X06_T01_220_010="[{i ThelUuthow}]: Ваша вера в технологию погубит вас."
X06_T01_230_010="[{i ThelUuthow}]: Только один может взойти на вершину. Ваша Принцесса - обманщица."
X06_T01_240_010="[{i ThelUuthow}]: Преклонись перед нашей силой и может быть мы пощадим тебя."
X06_T01_250_010="[{i ThelUuthow}]: Может ты представляешь более серьезную угрозу, чем я думал?"
X06_T01_260_010="[{i ThelUuthow}]: Ты погибнешь от моей руки."
X06_T01_270_010="[{i ThelUuthow}]: Я служу до конца!"
X06_T01_275_010="[{i Vedetta}]: Прототипы могут создать нам проблемы, думаю, я уничтожу их."
X06_T01_276_010="[{i Vedetta}]: Нет, тебе не удастся завершить этот прототип!"
X06_T01_277_010="[{i Vedetta}]: Не надейся, что тебе удастся завершить этот прототип!"
X06_T01_500_010="[{i Vedetta}]: Почему вы продолжаете бороться?"
X06_T01_510_010="[{i Vedetta}]: Вы не смогли даже защитить Землю. Как вы надеетесь остановить нас?"
X06_T01_520_010="[{i Vedetta}]: Вы омерзительны."
X06_T01_530_010="[{i Vedetta}]: Зависимость от технологий погубит вас."
X06_T01_540_010="[{i Vedetta}]: Ты умрешь от моей руки, предатель."
X06_T01_550_010="[{i Vedetta}]: Время принцессы прошло. Теперь нас ведет Каэль."
X06_T01_560_010="[{i Vedetta}]: Отличная попытка."
X06_T01_570_010="[{i Vedetta}]: Я еще не побежден!"
X06_T01_580_010="[{i Vedetta}]: Аааааааааа!"
X06_T01_585_010="[{i Fletcher}]: Я не позволю тебе использовать этот прототип!"
X06_T01_586_010="[{i Fletcher}]: Ты собираешься использовать прототип для уничтожения Черного Солнца! Я не позволю тебе сделать это!\""
X06_T01_587_010="[{i Fletcher}]: этот прототип не остановит меня! Я уничтожу ее раньше!"
X06_T01_660_010="[{i Fletcher}]: Ты не лучше остальных!"
X06_T01_670_010="[{i Fletcher}]: Эта война никогда не кончится. Никогда!"
X06_T01_680_010="[{i Fletcher}]: Я думал, что могу доверять тебе! Ты предатель."
X06_T01_690_010="[{i Fletcher}]: Ты трус."
X06_T01_720_010="[{i Fletcher}]: Предатель!"
X06_T01_730_010="[{i Fletcher}]: Когда \"Черное солнце\" будет в моем распоряжении, я смогу уничтожить любого, кто встанет у меня на пути."
X06_T01_740_010="[{i Fletcher}]: Разве ты не видишь? \"Черное солнце\" - вот ответ."
X06_T01_750_010="[{i Fletcher}]: Я отстрою \"Черное солнце\" заново!"
X06_T01_800_010="[{i Fletcher}]: Они - наши враги! Как ты этого не видишь?"
X06_T01_810_010="[{i Fletcher}]: Разве ты не понимаешь? серафим, эон, кибран... они все одинаковые. Они убьют нас!"
X06_T01_820_010="[{i Fletcher}]: Ты и тебе подобные в ответе за эту войну."
X06_T01_830_010="[{i Fletcher}]: Эта война развязана по твоей вине! Пришло время расплаты."
X06_T01_840_010="[{i Fletcher}]: Ты и тебе подобные в ответе за эту войну."
X06_T01_850_010="[{i Fletcher}]: Эта война развязана по твоей вине! Пришло время расплаты."
X06_T01_860_010="[{i Fletcher}]: Меня не остановить!"
X06_T01_870_010="[{i Fletcher}]: \"Черное солнце\" - вот ответ."
X06_T01_880_010="[{i Fletcher}]: Почему ты не слушаешь?!"
X06_T01_882_010="[{i Rhiza}]: Эту силу можно победить, но я не остановлюсь!"
X06_T01_883_010="[{i Rhiza}]: Мне все равно, я буду продолжать атаковать!"
X06_T01_884_010="[{i Rhiza}]: Две другие займут ее место!"
X06_T01_885_010="[{i Rhiza}]: Такая ерунда меня не остановит!"
X06_T01_886_010="[{i Rhiza}]: Отстрою заново в два раза крепче!"
X06_T01_887_010="[{i Rhiza}]: Если ты думаешь, что меня можно запугать, ты ошибаешься!"
X06_T01_900_010="[{i Rhiza}]: Слава принцессе!"
X06_T01_910_010="[{i Rhiza}]: Игнорировать меня - крайне глупо."
X06_T01_920_010="[{i Rhiza}]: Скоро вы почувствуете на себе мою ярость!"
X06_T01_930_010="[{i Rhiza}]: Воля принцессы - закон!"
X06_T01_940_010="[{i Rhiza}]: Здесь тебя не ждет ничего, кроме уничтожения, серафим!"
X06_T01_950_010="[{i Rhiza}]: Коалиция победит!"
X1CA_001_description="Форт Кларк, расположенный на планете Грифон IV, является последним рубежом обороны ОФЗ. Силы серафим и Ордена, атакующие форт, превышают по численности силы ОФЗ. Если Форт Кларк падет, ОФЗ перестанет существовать. Вам предстоит уничтожить Командующих противника и остановить осаду Форта Кларк."
X1CA_002_description="Верные Эон, возглавляемые Крестоносцем Ризой, были захвачены в плен во время проведения диверсионных и разведопераций на территории Ордена и КИИ. Вы должны освободить Верных, находящихся в плену у КИИ, и уничтожить всех командующих противника на планете."
X1CA_003_description="Принцесса Берк вернулась, но она находится в серьезной опасности. Силы серафим загнали ее в ловушку на планете Голубое Небо, у нее нет шансов выбраться оттуда. Вы отправитесь на планету Голубое Небо, уничтожите командующих серафим и спасете Принцессу Берк."
X1CA_004_description="Командование Коалиции получило неподтвержденные разведданные о том, что серафим собирают войска на планете Гадес -- контроль над этой планетой позволит серафим атаковать любую точку на территории Коалиции. Элитный командующий Достя присоединится к вам для выполнения этого задания, вы вдвоем должны будете уничтожить силы серафим на Гадесе."
X1CA_005_description="После событий на Гадесе, КИИ должен быть уничтожен раз и навсегда. Благодаря разведданным, полученным от узла Семи Рук, Коалиции удалось узнать, что главный терминал КИИ находится на планете Жемчужина II. Вашим заданием является постройка базы на Жемчужине II, в этом случае доктор Брэкмен сможет высадиться и лично отключить КИИ."
X1CA_006_description="Благодаря кодам врат, полученных от КИИ, силы Коалиции могут телепортироваться прямо на Землю, где серафим строят Квантовую Арку. Если им удастся завершить ее, серафим смогут вызывать бесчисленные подкрепления. Арка должна быть уничтожена, не важно, какой ценой."
X1MP_001_Description="На протяжении многих столетий Дюны были прибежищем наемников, обеспечивая десятки укрытий в лабиринте неприступных скал. С прибытием серафим, скалы снова стали убежищем для желающих скрыться."
X1MP_002_Description="Во времена заката Империи Земли в этом месте командующий Уильямсон храбро сражался во время первого вторжения Эон. В свете последних событий Уильямсон и Мост, который он оборонял, стали символами надежды для ОФЗ."
X1MP_003_Description="Это место было объявлено местом первой победы Коалиции, Командующий кибран Сноуи сдерживал здесь превыщающие по численности войска серафим, пока ему на помощь не прибыли войска ОФЗ. Затем эта колония кибран была эвакуирована из-за близости к огневым рубежам."
X1MP_004_Description="Колонисты ОФЗ заселили Риф Приюта в надежде укрыться от бедствий Бесконечной войны. Богатый ресурсами Риф Приюта быстро начал процветать, но это длилось недолго. Все записи утеряны, но ходит слух, что колонисты умерли от неизвестной болезни. ОФЗ отрицает этот слух, вся информация касающаяся Рифа Приюта, засекречена."
X1MP_005_Description="Это место, расположенное в дельте реки, было пристанищем мятежников, наемников и контрабандистов. После вторжения серафим Сердце стало домом одной из нескольких гражданских колоний серафим в галактике Млечного Пути."
X1MP_006_Description="Эон считали, что эта планета имеет особое отношение к Пути, поэтому они построили убежище в центре самого высого горного хребта. Изначально предполагалось, что здесь будет царить мир, это будет место для медитации, но суровая реальность превратила место для просвещения в поле боя."
X1MP_007_Description="Горнодобывающая колония ОФЗ, расположенная на границе исследованного космоса. Колонисты отклоняли любые предложения помощи от Коалиции. Секрет этой колонии еще предстоит раскрыть, но похоже, что их не беспокоит угроза серафим."
X1MP_008_Description="Это место когда-то было символом власти принцессы и ее сподвижников. Верным эон пришлось покинуть его, чтобы не оказаться в плену у миротворцев Ордена."
X1MP_009_Description="Когда серафим прибыли, они не были уверены в том, что ресурсов галактики будет достаточно, чтобы обеспечить функционирование их военной техники, поэтому они начали выращивать на планете редкие кристаллы либериама. Тем не менее, ученые Ордена впоследствии убедили серафим в том, что местных запасов материи хватит на их нужды."
X1MP_010_Description="Эон считали, что Путь оказал священное влияние на эту планету, на протяжении нескольких поколений они защищали ее от присутствия цивилизации. Теперь, когда у Коалиции начались проблемы с ресурсами, от безысходности это ограничение было снято."
X1MP_011_Description="Так как ресурсы сконцентрированы в центре Сюрикена, командующие долны как можно быстрее продвигаться к центру. Тем не менее, те, кто слишком рассредоточит войска, возможно, второго шанса не получат."
X1MP_012_Description="Легенда гласит, что когда-то это было домом процветающей островной общины, но взрыв катастрофической силы разорвал цепь островов. В настоящее время исследователи пытаются найти в глубинах ответ на вопрос, что же произошло."
X1MP_014_Description="Во время летних месяцев дно Карьера затапливается, останавливая на время работу колонистов. Не так давно с колонией была потеряна какая-либо связь, все сигналы, посланные Коалицией, остались без ответа. Состояние системы и колоний предстоит выяснить."
X1MP_017_Description="Квантовая связь затруднена в этой системе затруднена из-за странной аномалии. Это не помешало как Каолиции, так и силам серафим и Ордена рассматривать эту планету как прекрасный плацдарм для подготовки тайных атак на территорию противника."
X1TU_0000="Поздравляю, полковник, учения закончены!"
X1T_TU01_010_010="[{i Fletcher}]: Слушайте сюда, полковник. Эти учения обучат вас всем аспектам управления вашей боевой машиной командующего (БМК), включая постройку и развертывание строений и войск. Вам нужно научиться этому всему как можно скорее, т.к. орден и их друзья пришельцы громят нас по всей галактике. Так что будьте внимательны."
X1T_TU01_010_020="[{i Fletcher}]: Первое, чему вы должны научиться - навигации на поле боя."
X1T_TU02_010_010="[{i Fletcher}]: Задание простое до безобразия, но эти бюрократы заставляют меня прогонять всех через него. На поле боя можно ориентироваться двумя способами -- при помощи мыши и клавиш со стрелками. Чтобы воспользоваться мышью, просто переместите курсор к краю карты и она автоматически начнет двигаться. Нажатием и удержанием клавиш со стрелками можно добиться того же эффекта."
X1T_TU02_020_010="[{i Fletcher}]: Отличная работа, командующий."
X1T_TU02_030_010="[{i Fletcher}]: Ваша БМК позволяет полностью видеть поле боя, включая возможность приближать и отдалять изображение. Для приближения и отдаления используется колесо мыши - или клавиши Q и W."
X1T_TU02_040_010="[{i Fletcher}]: Хорошо. Двигаемся дальше."
X1T_TU02_050_010="[{i Fletcher}]: Командующий, отцентруйте экран по маркерам заданий."
X1T_TU02_060_010="[{i Fletcher}]: Давайте, командующий! Выполняйте задание."
X1T_TU02_070_010="[{i Fletcher}]: Отдаляйте изображение до тех пор, пока не увидите маркер задания."
X1T_TU02_080_010="[{i Fletcher}]: Командующий, мы не можем заниматься этим целый день!"
X1T_TU02_OBJ_010_010="Осуществите прокрутку поля боя"
X1T_TU02_OBJ_010_020="Используйте мышь или клавиши со стрелками, чтобы отцентровать камеру по каждому маркеру."
X1T_TU02_OBJ_010_030="Отдалите изображение"
X1T_TU02_OBJ_010_040="Отдаляйте изображение, пока не увидите маркер. Используйте либо мышь, либо соответствующую клавишу."
X1T_TU03_010_010="[{i Fletcher}]: Пора выводить вашу БМК. Выделите ее щелчком левой кнопки мыши, а щелчком правой укажите место, куда вы хотите ее отправить."
X1T_TU03_010_020="[{i Fletcher}]: Когда будете готовы, переместите вашу БМК в отмеченную точку на карте."
X1T_TU03_020_010="[{i Fletcher}]: Отлично."
X1T_TU03_030_010="[{i Fletcher}]: Командующий, выделите вашу БМК щелчком левой кнопки мыши, а щелчком правой укажите место, куда двигаться."
X1T_TU03_040_010="[{i Fletcher}]: Давайте попробуем ускорить это, хорошо?"
X1T_TU03_050_010="[{i Fletcher}]: Ваша БМК обладает значительной огневой мощью, достаточной чтобы уничтожать боевые единицы противника низкого уровня. Чтобы атаковать противника, щелкните правой кнопкой мыши по боевой единице, которую хотите уничтожить. БМК сама начнет атаку, как только будет достигнута необходимая дальность, помните об этом."
X1T_TU03_050_020="[{i Fletcher}]: Атакуйте и уничтожьте боевую единицу противника."
X1T_TU03_060_010="[{i Fletcher}]: Отличная работа, солдат, но сильно не зазнавайтесь."
X1T_TU03_070_010="[{i Fletcher}]: Командующий, уничтожьте эту боевую единицу."
X1T_TU03_080_010="[{i Fletcher}]: Если в реальном бою у вас это будет занимать столько же времени, долго вы не протянете."
X1T_TU03_OBJ_010_010="Перемещение БМК"
X1T_TU03_OBJ_010_020="Отправьте вашу БМК в обозначенный район."
X1T_TU03_OBJ_010_030="Атака при помощи БМК"
X1T_TU03_OBJ_010_040="Используйте вашу БМК, чтобы атаковать и уничтожить боевую единицу противника."
X1T_TU04_010_010="[{i Fletcher}]: Для постройки и поддержания всего используется два типа ресурсов: материя и энергия. Чтобы поддерживать экономику нужно следить за тем, как собираются и расходуются эти ресурсы."
X1T_TU04_020_010="[{i Fletcher}]: Этот индикатор на экране показывает сколько энергия вы вырабатываете и потребляете, а этот показывает расход материи. Если вы будете потреблять больше, чем вырабатываете, это может оказать негативный эффект на вашу экономику."
X1T_TU04_030_010="[{i Fletcher}]: Материю вырабатывают экстракторы, которые строятся на месторождениях материи. Месторождения материи отмечены на экране в виде зеленых прямоугольников с крестом посередине. Материю также могут вырабатывать фабрикаторы материи и ее можно получить при захвате зданий."
X1T_TU04_030_020="[{i Fletcher}]: Я хочу, чтобы вы построили три экстрактора материи. Выделите вашу БМК, щелкните по иконке экстрактора материи в меню постройки, а затем щелкните по одному из отмеченных месторождений материи. Проделайте это с каждым экстрактором."
X1T_TU04_040_010="[{i Fletcher}]: Отлично. Теперь вы собираете материю."
X1T_TU04_050_010="[{i Fletcher}]: Командующий, постройте эти три экстрактора Материи."
X1T_TU04_060_010="[{i Fletcher}]: Без материи нельзя ничего строить. Выполняйте задание."
X1T_TU04_070_010="[{i Fletcher}]: Энергию вырабатывают силовые генераторы. Существуют силовые генераторы трех уровней, и, в отличие от экстракторов материи, их можно строить в любом месте карты."
X1T_TU04_070_020="[{i Fletcher}]: Вам приказано построить два силовых генератора. Выделить вашу БМК, щелкните по иконке силового генератора в меню постройки, а затем щелкните по любому свободному месту на земле."
X1T_TU04_080_010="[{i Fletcher}]: Теперь, когда генераторы работают, вы получаете стабильный запас энергии."
X1T_TU04_090_010="[{i Fletcher}]: Командующий, постройте два силовых генератора."
X1T_TU04_100_010="[{i Fletcher}]: Командующий, силы ордена стучатся в нашу дверь. Стройте силовые генераторы."
X1T_TU04_110_010="[{i Fletcher}]: Хорошо, давайте начнем строить амию. На заводах строятся инженеры и тактические боевые единицы, такие, как танки, бомбардировщики и подлодки. Давайте построим бронетанковый завод."
X1T_TU04_120_010="[{i Fletcher}]: Отличная работа, командующий. Теперь можно начать строить армию."
X1T_TU04_130_010="[{i Fletcher}]: Командующий, постройте бронетанковый завод."
X1T_TU04_140_010="[{i Fletcher}]: Вам что, приглашение нужно? Постройте бронетанковый завод."
X1T_TU04_OBJ_010_010="Постройте экстракторы материи"
X1T_TU04_OBJ_010_020="Постройте экстрактор материи на каждом из трех месторождений."
X1T_TU04_OBJ_010_030="Постройте силовые генераторы."
X1T_TU04_OBJ_010_040="Постройте два силовых генератора."
X1T_TU04_OBJ_010_050="Постройте бронетанковый завод"
X1T_TU04_OBJ_010_060="Постройте один бронетанковый завод."
X1T_TU05_010_010="[{i Fletcher}]: Теперь, когда у вас есть бронетанковый завод, вы сможете строить мобильные наземные войска -- выделите завод левым щелчком мыши, а потом щелкните по боевым единицам, которые хотите построить. В рамках этой обучающей миссии вы должны построить два легких штурмовых бота и две легких САУ. Каждый щелчок по боевой единице добавляет ее в очередь постройки завода."
X1T_TU05_020_010="[{i Fletcher}]: Отличная работа. Теперь у вас есть зачатки настоящей армии."
X1T_TU05_030_010="[{i Fletcher}]: Командующий, давайте построим эти войска."
X1T_TU05_040_010="[{i Fletcher}]: Командующий, на словах мы не одолеем противников ОФЗ. Стройте эти войска."
X1T_TU05_050_010="[{i Fletcher}]: Контрольные группы позволяют вам быстро выделить группу войск без использования мыши. Чтобы создать Контрольную группу, обведите мышью или выделите с использованием клавиши Shift построенные вами войска и нажмите Ctrl+1. Эти войска входят теперь в Контрольную группу 1. Если вы нажмете клавишу 1, все выделите автоматически все войска входящие в эту группу."
X1T_TU05_050_020="[{i Fletcher}]: Создайте контрольную группу."
X1T_TU05_060_010="[{i Fletcher}]: Вы уже неплохо разбираетесь во всем."
X1T_TU05_070_010="[{i Fletcher}]: Давайте, командующий, создайте контрольную группу."
X1T_TU05_080_010="[{i Fletcher}]: Командующий, давайте сделаем это. Создайте контрольную группу."
X1T_TU05_OBJ_010_010="Постройте наземные войска"
X1T_TU05_OBJ_010_020="Постройте два легких штурмовых бота и две легких САУ."
X1T_TU05_OBJ_010_030="Создайте контрольную группу"
X1T_TU05_OBJ_010_040="Обведите мышью или выделите с использованием клавиши Shift построенные вами войска и нажмите Ctrl+1."
X1T_TU06_010_010="[{i Fletcher}]: Заводы также выпускают инженеров; они способны строить здания, которые нельзя создавать при помощи БМК, такие как хранилище материи и аккумулятор энергии, а также и радары и гидролокаторы. Инженеры также могут захватывать боевые единицы противника, заниматься ремонтом боевых единиц и строений и осуществлять помощь при постройке."
X1T_TU06_010_020="[{i Fletcher}]: Постройте на бронетанковом заводе двух инженеров."
X1T_TU06_020_010="[{i Fletcher}]: Молодцом. Отличная работа."
X1T_TU06_030_010="[{i Fletcher}]: Командующий, постройте двух инженеров."
X1T_TU06_040_010="[{i Fletcher}]: Давайте, командующий, постройте этих инженеров."
X1T_TU06_050_010="[{i Fletcher}]: Как ваша БМК, так и инженеры способны захватывать боевые единицы и строения противника, и ничто не так не сводит с ума этих уродов из ордена, как то, что вы используете их оборудование против них... На карте имеется силовой генератор -- захватите его. Для этого выделите инженера и щелкните правой кнопкой мыши по силовому генератору."
X1T_TU06_060_010="[{i Fletcher}]: Силовой генератор захвачен. Отличная работа."
X1T_TU06_070_010="[{i Fletcher}]: Командующий, используйте инженера для захвата силового генератора."
X1T_TU06_080_010="[{i Fletcher}]: Командующий, давайте сделаем это. Захватите силовой генератор."
X1T_TU06_090_010="[{i Fletcher}]: Нельзя знать наверняка, когда эти ублюдки-пришельцы начнут атаку, поэтому всегда защищайте свою базу оборонительными сооружениями. Оборонительные турели обладают неплохой огневой мощью и способны отразить большинство наземных атак. Постройте оборонительную турель в указанном районе."
X1T_TU06_100_010="[{i Fletcher}]: Хорошо, теперь в случае атаки у вас есть шанс отбиться."
X1T_TU06_110_010="[{i Fletcher}]: Командующий, постройте оборонительную турель в указанном районе."
X1T_TU06_120_010="[{i Fletcher}]: Постройте эту оборонительную турель, командующий."
X1T_TU06_130_010="[{i Fletcher}]: Ну вот, как я и говорил -- началась атака противника. Хорошо, что вы построили оборонительную турель."
X1T_TU06_140_010="[{i Fletcher}]: Отражение наземных атак - это всего лишь полдела. Вам также предстоит отражать атаки с воздуха. Постройте ПВО в указанном месте."
X1T_TU06_150_010="[{i Fletcher}]: Наверное из вас выйдет неплохой командующий. Отличная работа."
X1T_TU06_160_010="[{i Fletcher}]: Постройте ПВО, командующий."
X1T_TU06_170_010="[{i Fletcher}]: Если начнется атака бомбардировщиков противника, вы ничего не сможете сделать. Постройте ПВО."
X1T_TU06_180_010="[{i Fletcher}]: Началась атака бомбардировщиков противника. Разве не здорово, что вы построили ПВО?"
X1T_TU06_OBJ_010_010="Постройте инженеров"
X1T_TU06_OBJ_010_020="Постройте на бронетанковом заводе двух инженеров."
X1T_TU06_OBJ_010_030="Захватите силовой генератор"
X1T_TU06_OBJ_010_040="Используйте инженеров для захвата силового генератора."
X1T_TU06_OBJ_010_050="Постройте оборонительную турель"
X1T_TU06_OBJ_010_060="Постройте оборонительную турель в обозначенном месте."
X1T_TU06_OBJ_010_070="Постройте ПВО"
X1T_TU06_OBJ_010_080="Постройте ПВО в месте, обозначенном на карте."
X1T_TU07_010_010="[{i Fletcher}]: Теперь вы можете построить танков и бомбардировщиков столько, сколько вам угодно, но если вы не в курсе планов противника, можете считать, что деретесь одной рукой. Разведка - одна из важнейших составляющих военных действий. Радар - необходимый компонент для сбора разведданных. Постройте радар в обозначенном месте."
X1T_TU07_020_010="[{i Fletcher}]: Теперь вы можете следить за противником. Отличная работа."
X1T_TU07_030_010="[{i Fletcher}]: Командующий, постройте радар."
X1T_TU07_040_010="[{i Fletcher}]: Командующий, нельзя сражаться вслепую. Постройте радар."
X1T_TU07_OBJ_010_010="Постройте радар"
X1T_TU07_OBJ_010_020="Постройте радар в обозначенном месте."
X1T_TU08_010_010="[{i Fletcher}]: При помощи радара удалось обнаружить небольшую базу ордена. Постройте армию и уничтожьте ее!"
X1T_TU08_020_010="[{i Fletcher}]: Обожаю смотреть как горят войска ордена. Отличная работа, командующий."
X1T_TU08_030_010="[{i Fletcher}]: Командующий, уничтожьте базу противника."
X1T_TU08_040_010="[{i Fletcher}]: Я хочу, чтобы вы уничтожили базу противника. Выполняйте."
X1T_TU08_OBJ_010_010="Уничтожьте базу противника"
X1T_TU08_OBJ_010_020="Создайте армию, атакуйте и уничтожьте базу ордена. Не должно остаться и камня на камне."
X1T_TU09_010_010="[{i Fletcher}]: Обнаружена более крупная база ордена на севере. Высылаем подкрепления; используйте их совместно с вашими силами и уничтожьте эту базу. Я хочу, чтобы и камня на камне не осталось."
X1T_TU09_020_010="[{i Fletcher}]: Командующий, одним противником меньше. Обожаю смотреть как отдают концы командующие ордена."
X1T_TU09_030_010="[{i Fletcher}]: Уничтожьте командующего противника."
X1T_TU09_040_010="[{i Fletcher}]: Вы ждете когда этот урод придет к вам, чтобы познакомиться? Атакуйте и уничтожьте его."
X1T_TU09_OBJ_010_010="Уничтожьте командующего противника"
X1T_TU09_OBJ_010_020="Атакуйте и уничтожьте командующего и базу противника."
X1T_TU10_010_010="[{i Fletcher}]: Чтобы получить доступ к более мощному оружию, вам нужно усовершенствовать заводы. Всего существует три технологических уровня ТУ1, ТУ2 и ТУ3. Чтобы усовершенствовать завод до уровня ТУ2, выделите бронетанковый завод и щелкните по иконке усовершенствования."
X1T_TU10_010_020="[{i Fletcher}]: Усовершенствуйте бронетанковый завод до уровня ТУ2."
X1T_TU10_020_010="[{i Fletcher}]: Прекрасно. Теперь вы можете строить инженеров и войска ТУ2."
X1T_TU10_030_010="[{i Fletcher}]: Командующий, давайте усовершенствуем этот бронетанковый завод."
X1T_TU10_040_010="[{i Fletcher}]: Командующий, чтобы выиграть войну вам понадобятся не только пукалки. Усовершенствуйте свой завод."
X1T_TU10_OBJ_010_010="Усовершенствуйте завод"
X1T_TU10_OBJ_010_020="Усовершенствуйте свой завод до уровня ТУ2."
X1T_TU11_010_010="[{i Fletcher}]: Если вы учили уроки, то должны знать, что большинство операций проводятся на значительных расстояниях. Транспорт - наиболее эффективный способ перемещать войска на большие расстояния. Транспорт можно использовать несколькими способами, сверьтесь с учебником. Для учебных целей мы рассмотрим лишь основные способы, для этого вам будет предоставлен транспорт."
X1T_TU11_010_020="[{i Fletcher}]: Чтобы загрузить транспорт, выделите войска, которые хотите перевезти и щелкните правой кнопкой мыши по транспорту. Когда транспорт будет заполнен, щелкните по кнопке \"Перевезти\" и укажите место на карте, где транспорт следует разгрузить."
X1T_TU11_010_030="[{i Fletcher}]: Загрузите транспорт и отправьте его в обозначенное место."
X1T_TU11_020_010="[{i Fletcher}]: Теперь вы знаете основы транспортировки. Отличная работа."
X1T_TU11_030_010="[{i Fletcher}]: Командующий, транспортируйте эти войска."
X1T_TU11_040_010="[{i Fletcher}]: Командующий, загрузите транспорт."
X1T_TU11_OBJ_010_010="Воспользуйтесь транспортом"
X1T_TU11_OBJ_010_020="Загрузите транспорт и отправьте его в обозначенное место на карте."
