XGG_GD1_010_010="[{i HQ}]: Командующий, с востока к вашей позиции движется большая группа наземных сил противника! Конец связи."
XGG_GD1_020_010="[{i HQ}]: Командующий, с запада к вашей позиции движется большая группа наземных сил противника! Конец связи."
