XGG_GD1_100_010="[{i HQ}]: Командующий, к вам приближаются наземные войска ТУ1. Конец связи."
XGG_GD1_110_010="[{i HQ}]: Командующий, к вам приближаются наземные войска ТУ2. Конец связи."
