XGG_MP1_330_010="[{i Dostya}]: Таким как ты меня не напугать."
XGG_MP1_340_010="[{i Dostya}]: Смотри внимательно. Может научишься чему-нибудь."
XGG_MP1_350_010="[{i Dostya}]: На твоем месте, я бы бежала."
XGG_MP1_360_010="[{i Dostya}]: Ты пополнишь список моих побед."
XGG_MP1_370_010="[{i Dostya}]: Не стоит тратить на тебя время."
XGG_MP1_380_010="[{i Dostya}]: Твое поражение неминуемо."
XGG_MP1_390_010="[{i Dostya}]: Храбрости тебе хватает. А вот ума нет."
