XGG_MP1_410_010="[{i Brackman}]: Боюсь, для тебя нет никакой надежды, да."
XGG_MP1_420_010="[{i Brackman}]: По крайней мере хоть какое-то развлечение."
XGG_MP1_430_010="[{i Brackman}]: Может, перейдем к дополнительным занятиям?"
XGG_MP1_440_010="[{i Brackman}]: Ты уверен, что хочешь этого?"
XGG_MP1_450_010="[{i Brackman}]: Меня, знаешь ли, не просто так называют гением."
XGG_MP1_460_010="[{i Brackman}]: Победа над тобой вряд ли стоит этих усилий, о, да."
XGG_MP1_470_010="[{i Brackman}]: Ты ничего не сможешь сделать."
XGG_MP1_480_010="[{i Brackman}]: Долго ты страдать не будешь."
XGG_MP1_490_010="[{i QAI}]: Тебе не победить."
XGG_MP1_500_010="[{i QAI}]: Вероятность твоего уничтожения равна 99%."
XGG_MP1_510_010="[{i QAI}]: Меня не победить."
XGG_MP1_520_010="[{i QAI}]: Твоя стратегия бесполезна."
XGG_MP1_530_010="[{i QAI}]: Никто не усомнится в моей победе."
XGG_MP1_540_010="[{i QAI}]: Все может закончиться только твоим поражением."
XGG_MP1_550_010="[{i QAI}]: Твои попытки ни к чему не приведут."
XGG_MP1_560_010="[{i QAI}]: Бегство - единственный логичный выход для тебя."
XGG_MP1_570_010="[{i Hex5}]: Тебе конец!"
XGG_MP1_580_010="[{i Hex5}]: Я делаю все, чтобы это выглядело просто."
XGG_MP1_590_010="[{i Hex5}]: Тебе нужно бежать прямо сейчас."
XGG_MP1_600_010="[{i Hex5}]: От тебя останется один дымящийся кратер."
XGG_MP1_610_010="[{i Hex5}]: Так, поражения - это у вас семейное?"
XGG_MP1_620_010="[{i Hex5}]: Черт, а у меня это здорово получается!"
XGG_MP1_630_010="[{i Hex5}]: Прощай!"
XGG_MP1_640_010="[{i Hex5}]: Не беспокойся, скоро все закончится."
