fmv_timeline_0000="Supreme Commander: хронология вторжения серафим"
fmv_timeline_0001="3844.9 (X-Day)"
fmv_timeline_0002="В результате выстрела Черного Солнца"
fmv_timeline_0003="3844.9 (X-Day)"
fmv_timeline_0004="Райли, президент ОФЗ, убит. Земля в руинах. серафим сразу же появляются во всех уголках галактики, убивая всех людей, которые им встречаются."
fmv_timeline_0005="3844.9 (X-Day)"
fmv_timeline_0006="Находясь под контролем серафим, КИИ выводит из строя сеть квантовых врат."
fmv_timeline_0007="3844.9 (X+2)"
fmv_timeline_0008="Принцесса Рианна Берк, совершившая первый шаг на пути к восхождению, исчезает. Ее судьба неизвестна."
fmv_timeline_0009="3844.9 (X+4)"
fmv_timeline_0010="Большинство эон считают серафим богами. Риза пытается предупредить всех их о том, что серафим представляют угрозу для человечества, но ее не слушают."
fmv_timeline_0011="3844.10 (X+21)"
fmv_timeline_0012="Судья Каэль захватывает власть над эон иллюминат. Основан орден Иллюминат, который заключает союз с Серафим. Риза и принцесса Берк объявлены отступницами."
fmv_timeline_0013="3844.10 (X+29)"
fmv_timeline_0014="Риза и горстка командующих эон, сохраняющих верность Принцессе, начинают партизанскую войну против ордена и серафим."
fmv_timeline_0015="3844.11 (X+45)"
fmv_timeline_0016="После серии сокрушительных атак КИИ войска кибран несут огромные потери."
fmv_timeline_0017="3844.11 (X+47)"
fmv_timeline_0018="Потерпев поражение от КИИ, Брэкмен отступает на окраины освоенного космоса."
fmv_timeline_0019="3845.3 (X+172)"
fmv_timeline_0020="ОФЗ несет тяжелые потери. Командование над сильно поредевшими войсками принимает генерал Уильям Холл."
fmv_timeline_0021="3845.4 (X+196)"
fmv_timeline_0022="ОФЗ и кибран формируют Коалицию Колониальной Обороны (Коалицию). Обе армии находятся под объединенным командованием."
fmv_timeline_0023="3845.7 (X+283)"
fmv_timeline_0024="Несмотря на протесты Брэкмена, Риза и Верные приняты в Коалицию."
fmv_timeline_0025="3846.3 (X+526)"
fmv_timeline_0026="Силы Коалиции проводят первую атаку на Серафим. Несмотря на многочисленные потери, Коалиция одерживает первую победу."
fmv_timeline_0027="3847.2 (X+866)"
fmv_timeline_0028="В форте Кларк, новой базе ОФЗ на планете Грифон IV, вовсю ведется строительство."
fmv_timeline_0029="3846.9 (X+716)"
fmv_timeline_0030="Генерал Саманта Кларк убита в бою."
